INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(39015, 'Assault Sentinel', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute this card; Special Summon 1 monster from your hand or Deck that specifically lists \"Assault Mode Activate\" in its text, except \"Assault Sentinel\", also you cannot Special Summon monsters from the Extra Deck for the rest of this turn, except Synchro Monsters. You can target 1 face-up monster you control; reveal 1 Synchro Monster in your Extra Deck, and if you do, the targeted monster\'s Type and Attribute become the same as the revealed monster\'s, until the end of this turn. You can only use each effect of \"Assault Sentinel\" once per turn.', 15, NULL, 'https://images.ygoprodeck.com/images/cards/39015.jpg', 771, 771, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(242146, 'Ballista of Rampart Smashing', 'Spell Card', 'Spell Card', 'spell', 'If the equipped monster attacks a face-down Defense Position monster, it gains 1500 ATK during damage calculation only.', 3, NULL, 'https://images.ygoprodeck.com/images/cards/242146.jpg', 895, 895, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(295517, 'A Legendary Ocean', 'Spell Card', 'Spell Card', 'spell', '(This card\'s name is always treated as \"Umi\".)\r\nAll WATER monsters on the field gain 200 ATK/DEF. Reduce the Level of all WATER monsters in both players\' hands and on the field by 1.', 10, 7, 'https://images.ygoprodeck.com/images/cards/295517.jpg', 24, 24, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(303660, 'Amplifier', 'Spell Card', 'Spell Card', 'spell', 'Equip only to \"Jinzo\". While this card is equipped, the equipped monster\'s effect does not negate the effects of its controller\'s Trap Cards. When this card is removed from the field, destroy the equipped monster. This card\'s activation and effect cannot be negated.', 3, NULL, 'https://images.ygoprodeck.com/images/cards/303660.jpg', 380, 380, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(365213, 'Arrive in Light', 'Spell Card', 'Spell Card', 'spell', 'When this card is activated: Place 1 Level 1 Dragon monster from your hand or Deck on top of the Deck. Neither player can return \"Stardust Dragon\", or a Synchro Monster that lists \"Stardust Dragon\" in its text, from the field to the Extra Deck. If a Synchro Monster(s) is Special Summoned (except during the Damage Step): You can apply 1 of these effects, but you cannot apply that same effect of \"Arrive in Light\" again this turn.\r\n● Draw 1 card.\r\n● Special Summon 1 Tuner from your hand.', 1, 21, 'https://images.ygoprodeck.com/images/cards/365213.jpg', 718, 718, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(410904, 'Awakening of the Possessed - Rasenryu', 'Effect Monster', 'Effect Monster', 'effect', 'You can Special Summon this card (from your hand or Deck) by sending 1 face-up Spellcaster monster and 1 face-up Level 4 or lower WIND monster you control to the GY. You can only use each of the following effects of \"Awakening of the Possessed - Rasenryu\" once per turn.\r\n● When this card is Special Summoned by its effect: You can return 1 card your opponent controls to the hand.\r\n● If this card is sent from the field to the GY: You can add 1 \"Spiritual Wind Art\" card or 1 \"Possessed\" Spell/Trap from your Deck to your hand.', 19, 143, 'https://images.ygoprodeck.com/images/cards/410904.jpg', 830, 830, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(440556, 'Bahamut Shark', 'XYZ Monster', 'XYZ Monster', 'xyz', '2 Level 4 WATER monsters\nOnce per turn: You can detach 1 material from this card; Special Summon 1 Rank 3 or lower WATER Xyz Monster from your Extra Deck. This card cannot attack for the rest of this turn.', 20, NULL, 'https://images.ygoprodeck.com/images/cards/440556.jpg', 889, 889, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(595626, 'Ankuriboh', 'Effect Monster', 'Effect Monster', 'effect', 'When an opponent\'s monster declares an attack: You can discard this card, then target 1 monster in either GY, except this card; Special Summon it to your field, but send it to the GY during the End Phase. If this card is destroyed by battle or card effect and sent to the GY: You can add 1 \"Monster Reborn\" from your Deck or GY to your hand during the End Phase of this turn. You can only use each effect of \"Ankuriboh\" once per turn.', 9, 85, 'https://images.ygoprodeck.com/images/cards/595626.jpg', 488, 488, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(652362, 'Alien Ammonite', 'Tuner Monster', 'Tuner Monster', 'effect', 'When this card is Normal Summoned, you can Special Summon 1 Level 4 or lower \"Alien\" monster from your Graveyard. Destroy it during the End Phase.', 27, 1, 'https://images.ygoprodeck.com/images/cards/652362.jpg', 209, 209, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(662855, 'Amatsu-Okami of the Divine Peaks', 'Link Monster', 'Link Monster', 'link', '3+ Dragon Effect Monsters\r\nMust be Link Summoned. If this Extra Linked card attacks your opponent directly and reduces their LP to 0, you win the Match.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/662855.jpg', 303, 303, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(706925, 'Atlantean Marksman', 'Effect Monster', 'Effect Monster', 'effect', 'When this card inflicts battle damage to your opponent: You can Special Summon 1 Level 4 or lower \"Atlantean\" Sea Serpent-Type monster from your Deck, except \"Atlantean Marksman\". When this card is sent to the Graveyard to activate a WATER monster\'s effect: Target 1 Set card your opponent controls; destroy that target.', 20, 131, 'https://images.ygoprodeck.com/images/cards/706925.jpg', 792, 792, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(712559, 'Amazoness Village', 'Spell Card', 'Spell Card', 'spell', 'All \"Amazoness\" monsters gain 200 ATK. Once per turn, when an \"Amazoness\" monster is destroyed by battle or card effect and sent to the GY: You can Special Summon 1 \"Amazoness\" monster from your Deck with a Level less than or equal to that \"Amazoness\" monster in the GY.', 10, 61, 'https://images.ygoprodeck.com/images/cards/712559.jpg', 353, 353, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(975299, 'B.E.F. Zelos', 'Spell Card', 'Spell Card', 'spell', 'When this card is activated: You can add 1 \"Boss Rush\" from your Deck to your hand. All \"B.E.S.\" monsters you control gain 500 ATK and DEF, your opponent cannot target them with card effects, and they cannot be destroyed by your opponent\'s card effects. Once per turn: You can Special Summon 1 \"B.E.S.\" monster from your hand. If a \"B.E.S.\" monster(s) is Normal or Special Summoned to your field: Place 1 counter on it.', 10, 146, 'https://images.ygoprodeck.com/images/cards/975299.jpg', 850, 850, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(980973, 'Armed Dragon LV3', 'Effect Monster', 'Effect Monster', 'effect', 'During your Standby Phase: You can send this card to the GY; Special Summon 1 \"Armed Dragon LV5\" from your hand or Deck.', 19, 111, 'https://images.ygoprodeck.com/images/cards/980973.jpg', 650, 650, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(1225009, 'Arianna the Labrynth Servant', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned: You can add 1 \"Labrynth\" card from your Deck to your hand, except \"Arianna the Labrynth Servant\". If another monster(s) leaves the field by your Normal Trap effect (except during the Damage Step): You can draw 1 card, then you can apply this effect.\r\n● From your hand, either Special Summon 1 Fiend monster, or Set 1 Spell/Trap.\r\nYou can only use 1 \"Arianna the Labrynth Servant\" effect per turn, and only once that turn.', 9, 106, 'https://images.ygoprodeck.com/images/cards/1225009.jpg', 629, 629, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(1278431, 'Ancient Gear Frame', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard 1 card; add 1 \"Ancient Gear Golem\", or 1 Spell/Trap that specifically lists the card \"Ancient Gear Golem\" in its text, from your Deck to your hand. You can only use this effect of \"Ancient Gear Frame\" once per turn. If this card attacks, your opponent cannot activate Spell/Trap Cards until the end of the Damage Step. If this face-up card in its owner\'s control leaves the field because of an opponent\'s card effect: You can Special Summon up to 3 \"Ancient Gear Golem\" and/or \"Ancient Gear Golem - Ultimate Pound\" from your hand, ignoring their Summoning conditions.', 12, 75, 'https://images.ygoprodeck.com/images/cards/1278431.jpg', 418, 418, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(1474910, 'Bee List Soldier', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute this card and 1 face-up Insect monster, except \"Bee List Soldier\"; draw 2 cards.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/1474910.jpg', 1049, 1049, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(1475311, 'Allure of Darkness', 'Spell Card', 'Spell Card', 'spell', 'Draw 2 cards, then banish 1 DARK monster from your hand, or, if you do not have any in your hand, send your entire hand to the GY.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/1475311.jpg', 233, 233, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(1508649, 'Altergeist Hexstia', 'Link Monster', 'Link Monster', 'link', '2 \"Altergeist\" monsters\r\nGains ATK equal to the original ATK of each \"Altergeist\" monster it points to. When a Spell/Trap Card or effect is activated (Quick Effect): You can Tribute 1 \"Altergeist\" monster this card points to; negate the activation, and if you do, destroy that card. If this card is sent from the field to the GY: You can add 1 \"Altergeist\" card from your Deck to your hand. You can only use this effect of \"Altergeist Hexstia\" once per turn.', 11, 57, 'https://images.ygoprodeck.com/images/cards/1508649.jpg', 279, 279, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(1561110, 'ABC-Dragon Buster', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"A-Assault Core\" + \"B-Buster Drake\" + \"C-Crush Wyvern\"\r\nMust first be Special Summoned (from your Extra Deck) by banishing the above cards you control and/or from your GY. (You do not use \"Polymerization\".) Once per turn (Quick Effect): You can discard 1 card, then target 1 card on the field; banish it. During your opponent\'s turn (Quick Effect): You can Tribute this card, then target 3 of your banished LIGHT Machine Union monsters with different names; Special Summon them.', 12, 8, 'https://images.ygoprodeck.com/images/cards/1561110.jpg', 47, 47, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(1712616, 'Beetrooper Fly & Sting', 'Trap Card', 'Trap Card', 'trap', 'When your opponent activates a monster effect, while you control a \"Beetrooper\" monster: Negate the activation, and if you do, destroy it. During your End Phase, if this card is in your GY and you control an Insect monster with 3000 or more ATK: You can banish 1 Insect monster from your GY; Set this card. You can only use 1 \"Beetrooper Fly & Sting\" effect per turn, and only once that turn.', 23, 170, 'https://images.ygoprodeck.com/images/cards/1712616.jpg', 1058, 1058, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(1953925, 'Ancient Gear Engineer', 'Effect Monster', 'Effect Monster', 'effect', 'Negate any Trap effects that target this card, and if you do, destroy that Trap Card. If this card attacks, your opponent cannot activate any Spell/Trap Cards until the end of the Damage Step. At the end of the Damage Step, if this card attacked: Target 1 Spell/Trap Card your opponent controls; destroy that target.', 12, 75, 'https://images.ygoprodeck.com/images/cards/1953925.jpg', 413, 413, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(1966438, 'Abominable Unchained Soul', 'Effect Monster', 'Effect Monster', 'effect', 'You can only Special Summon \"Abominable Unchained Soul(s)\" once per turn. If a card(s) you control is destroyed by battle or card effect: You can Special Summon this card from your hand. If this card is Special Summoned: You can discard 1 card; destroy 1 card on the field. Once per turn, during the End Phase, if this card is in the GY because it was destroyed on the field and sent there this turn: You can Special Summon this card, but place it on the bottom of the Deck when it leaves the field.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/1966438.jpg', 50, 50, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(2009101, 'Blackwing - Gale the Whirlwind', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control a \"Blackwing\" monster other than \"Blackwing - Gale the Whirlwind\", you can Special Summon this card (from your hand). Once per turn: You can target 1 face-up monster your opponent controls; that target\'s ATK and DEF become half its current ATK and DEF.', 24, 35, 'https://images.ygoprodeck.com/images/cards/2009101.jpg', 1213, 1213, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(2095764, 'Bixi, Water of the Yang Zing', 'Effect Monster', 'Effect Monster', 'effect', 'When this card you control is destroyed by battle or card effect and sent to your Graveyard: You can Special Summon 1 \"Yang Zing\" monster from your Deck in Attack Position, except \"Bixi, Water of the Yang Zing\". You can only use this effect of \"Bixi, Water of the Yang Zing\" once per turn. Once per turn, during your opponent\'s Main Phase or Battle Phase, you can: Immediately after this effect resolves, Synchro Summon 1 Synchro Monster, using only \"Yang Zing\" monsters you control (this is a Quick Effect). A Synchro Monster that used this card as a Synchro Material is unaffected by Trap effects.', 25, 163, 'https://images.ygoprodeck.com/images/cards/2095764.jpg', 1139, 1139, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(2129638, 'Blue-Eyes Twin Burst Dragon', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Blue-Eyes White Dragon\" + \"Blue-Eyes White Dragon\"\r\nMust be either Fusion Summoned, or Special Summoned by sending the above monsters you control to the GY (in which case you do not use \"Polymerization\"). Cannot be destroyed by battle. This card can make up to 2 attacks on monsters during each Battle Phase. At the end of the Damage Step, when this card attacks an opponent\'s monster, but the opponent\'s monster was not destroyed by the battle: You can banish that opponent\'s monster.', 19, 164, 'https://images.ygoprodeck.com/images/cards/2129638.jpg', 1331, 1331, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(2134346, 'Asura Priest', 'Spirit Monster', 'Spirit Monster', 'effect', 'Cannot be Special Summoned. During the End Phase of the turn this card is Normal Summoned or flipped face-up: Return it to the hand. This card can attack all monsters your opponent controls once each.', 18, NULL, 'https://images.ygoprodeck.com/images/cards/2134346.jpg', 784, 784, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(2139640, 'Amabie', 'Effect Monster', 'Effect Monster', 'effect', 'At the start of your Main Phase 1: You can reveal this card in your hand; each player gains 300 LP.', 18, NULL, 'https://images.ygoprodeck.com/images/cards/2139640.jpg', 298, 298, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(2148918, 'Armor Ninjitsu Art of Rust Mist', 'Trap Card', 'Trap Card', 'trap', 'When a monster(s) is Special Summoned to your opponent\'s field, if you control a \"Ninja\" monster: Halve the current ATK of that Special Summoned monster(s).', 1, 38, 'https://images.ygoprodeck.com/images/cards/2148918.jpg', 675, 675, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(2368215, 'Abyss Actor - Hyper Director', 'Link Monster', 'Link Monster', 'link', '1 \"Abyss Actor\" Pendulum Monster\r\nYou can target 1 card in your Pendulum Zone; Special Summon it, then place 1 \"Abyss Actor\" Pendulum Monster with a different name, from your Deck or face-up Extra Deck, to your Pendulum Zone, also you cannot Normal or Special Summon monsters for the rest of this turn, except \"Abyss Actor\" monsters. You can only use this effect of \"Abyss Actor - Hyper Director\" once per turn.', 9, 16, 'https://images.ygoprodeck.com/images/cards/2368215.jpg', 66, 66, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(2411269, 'Agave Dragon', 'Link Monster', 'Link Monster', 'link', '2+ monsters, except Tokens\r\nIf this card is Link Summoned: You can apply these effects in sequence, depending on the Types of monsters in the GYs (skip over any that do not apply). You can only use this effect of \"Agave Dragon\" once per turn.\r\n● Inflict 100 damage to your opponent for each Dragon.\r\n● This card gains 200 ATK for each Dinosaur.\r\n● All monsters your opponent currently controls lose 300 ATK for each Sea Serpent.\r\n● You gain 400 LP for each Wyrm.', 25, NULL, 'https://images.ygoprodeck.com/images/cards/2411269.jpg', 172, 172, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(2547033, 'Altergeist Haunted Rock', 'Trap Card', 'Trap Card', 'trap', 'If this card was Set by the effect of an \"Altergeist\" card, you can activate it the turn it was Set. When this card is activated: Send 1 \"Altergeist\" monster from your hand to the GY. When your opponent activates a Trap Card (except during the Damage Step): You can send 1 \"Altergeist\" monster from your hand to the GY; negate that effect, and if you do, destroy that card. You can only use each effect of \"Altergeist Haunted Rock\" once per turn.', 1, 57, 'https://images.ygoprodeck.com/images/cards/2547033.jpg', 278, 278, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(2656842, 'Beetrooper Scout Buggy', 'Effect Monster', 'Effect Monster', 'effect', 'You cannot Special Summon monsters, except Insect monsters. If this card is Normal or Special Summoned: You can Special Summon 1 \"Beetrooper Scout Buggy\" from your hand, Deck, or GY. You can only use this effect of \"Beetrooper Scout Buggy\" once per turn.', 7, 170, 'https://images.ygoprodeck.com/images/cards/2656842.jpg', 1063, 1063, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(2674965, 'Argostars - Home Stadium', 'Spell Card', 'Spell Card', 'spell', 'Once per turn: You can pay 1000 LP; add 1 \"Argostars\" card from your GY or banishment to your hand. Each time a Continuous Trap in the Spell & Trap Zone is Special Summoned to your field, inflict 500 damage to your opponent. Once per Chain, if a Continuous Trap activates its effect in your Monster Zone, while you have a banished \"Argostars\" monster: You can target 1 face-up card your opponent controls; negate its effects until the end of this turn.', 10, 105, 'https://images.ygoprodeck.com/images/cards/2674965.jpg', 623, 623, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(2801664, 'Ancient Warriors - Valiant Zhang De', 'Effect Monster', 'Effect Monster', 'effect', 'Gains 300 ATK for each monster your opponent controls, during your turn only. You can only use each of the following effects of \"Ancient Warriors - Valiant Zhang De\" once per turn.\r\n● If you control 2 or more \"Ancient Warriors\" monsters: You can Special Summon this card from your hand.\r\n● If your opponent controls more monsters than you do: You can activate this effect; this card can make up to 2 attacks on monsters during each Battle Phase this turn.', 15, 77, 'https://images.ygoprodeck.com/images/cards/2801664.jpg', 462, 462, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(2834264, 'Beetrooper Armor Horn', 'Link Monster', 'Link Monster', 'link', '2 Insect monsters\r\nYou cannot Special Summon monsters, except Insect monsters. You can only use each of the following effects of \"Beetrooper Armor Horn\" once per turn. During your Main Phase, you can: Immediately after this effect resolves, Normal Summon 1 Insect monster. If this card is in your GY: You can banish 3 other Insect monsters from your GY; Special Summon this card, but banish it when it leaves the field.', 7, 170, 'https://images.ygoprodeck.com/images/cards/2834264.jpg', 1054, 1054, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(3048768, 'Angello Vaalmonica', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nEach time you gain LP while you control a Fiend Monster Card in your other Pendulum Zone, place 1 Resonance Counter on this card. Once per turn, when an opponent\'s monster declares an attack, you can: Immediately after this effect resolves, Link Summon 1 \"Vaalmonica\" Link Monster.\n\n[ Monster Effect ] \nIf this card is in your hand: You can discard 1 other card; take 1 \"Dimonno Vaalmonica\" from your Deck, and place this card and that card in your Pendulum Zones. During your Main Phase, if this card was Normal or Special Summoned this turn: You can banish 1 \"Vaalmonica\" Normal Spell/Trap from your GY; apply whichever effect on that card includes gaining LP. You can only use each effect of \"Angello Vaalmonica\" once per turn.', 18, 83, 'https://images.ygoprodeck.com/images/cards/3048768.jpg', 484, 484, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(3072808, 'Blackwing - Hillen the Tengu-wind', 'Tuner Monster', 'Tuner Monster', 'effect', 'When you take 2000 or more Battle Damage from your opponent\'s monster\'s direct attack while this card is in the Graveyard, you can select 1 Level 3 or lower \"Blackwing\" monster in your Graveyard. Special Summon that monster and this card from the Graveyard. Their effects are negated. Each player can only use the effect of \"Blackwing - Hillen the Tengu-wind\" once per Duel.', 24, 35, 'https://images.ygoprodeck.com/images/cards/3072808.jpg', 1220, 1220, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(3084730, 'Bio-Insect Armor', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is in your hand or GY and you do not control \"Bio-Insect Armor\": You can target 1 Insect monster you control; equip this card to it, but banish it when it leaves the field, also banish this Equip Card when it leaves the field. You can only use this effect of \"Bio-Insect Armor\" once per turn. The equipped monster gains 1500 ATK/2000 DEF during the Battle Phase and Main Phase 2, only.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/3084730.jpg', 1126, 1126, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(3103067, 'Attack Guidance Armor', 'Trap Card', 'Trap Card', 'trap', 'When a monster declares an attack: Activate 1 of these effects;\r\n● Destroy the attacking monster.\r\n● Target 1 monster on either field, except the attacking monster; change the attack target to it and perform damage calculation.\r\nYou can only activate 1 \"Attack Guidance Armor\" per turn.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/3103067.jpg', 799, 799, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
