(3376703, 'Arcana Force V - The Hierophant', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard this card; this turn, your opponent cannot activate cards or effects when an \"Arcana Force\" monster(s) is Summoned to your field. If this card is Summoned: Toss a coin.\r\n● Heads: Special Summon 1 Level 4 or lower \"Arcana Force\" monster from your Deck with a different name from the monsters you control and in your GY.\r\n● Tails: Special Summon 1 \"Arcana Force\" monster from your Deck to your opponent\'s field.', 18, 101, 'https://images.ygoprodeck.com/images/cards/3376703.jpg', 571, 571, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(3410461, 'Alba-Lenatus the Abyss Dragon', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 \"Fallen of Albaz\" + 1+ Dragon monsters\r\nCannot be used as Fusion Material. Must be either Fusion Summoned, or Special Summoned by sending the above cards from any Monster Zones to the GY. This card can attack monsters a number of times each Battle Phase, up to the number of materials used for it. Once per turn, during the End Phase, if this card is in the GY because it was sent there this turn: You can add 1 \"Polymerization\" Normal Spell or \"Fusion\" Normal Spell from your Deck to your hand.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/3410461.jpg', 192, 192, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
