(3507053, 'Appliancer Dryer Drake', 'Link Monster', 'Link Monster', 'link', '1 \"Appliancer\" monster\r\nCannot be used as Link Material the turn it is Link Summoned. This linked card gains 1000 ATK. Once per turn, during your Battle Phase, if this card is co-linked (except during the Damage Step): You can switch the locations of 2 \"Appliancer\" monsters in your Main Monster Zones, including this card, and if you do, the other monster can make a second attack during each Battle Phase this turn. Once per turn, when this card that is not co-linked is targeted for an attack: You can negate that attack.', 12, 94, 'https://images.ygoprodeck.com/images/cards/3507053.jpg', 524, 524, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
