(3875465, 'Appliancer Electrilyrical World', 'Spell Card', 'Spell Card', 'spell', 'When this card is activated: You can add 1 \"Appliancer\" card from your Deck to your hand, except a Field Spell. Once per turn, if you Link Summon an \"Appliancer\" Link Monster(s): You can add 1 \"Appliancer\" monster from your GY to your hand. Once per turn, when a monster declares an attack: You can move 1 \"Appliancer\" monster you control to another of your Main Monster Zones. You can only activate 1 \"Appliancer Electrilyrical World\" per turn.', 10, 94, 'https://images.ygoprodeck.com/images/cards/3875465.jpg', 525, 525, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
