(4059313, 'Blaze Cannon', 'Spell Card', 'Spell Card', 'spell', '(This card is also always treated as a \"Blaze Accelerator\" card.)\r\nOne \"The Winged Dragon of Ra\" you control gains the following effects until the end of this turn. This card\'s activation and effect cannot be negated.\r\n● This card is unaffected by your opponent\'s card effects.\r\n● When an attack is declared involving this card: You can Tribute any number of other monsters that did not declare an attack this turn; this card gains ATK equal to the Tributed monsters\' combined original ATK, until the end of this turn.\r\n● After damage calculation, if this card attacked: You can send all monsters your opponent controls to the GY.', 2, 186, 'https://images.ygoprodeck.com/images/cards/4059313.jpg', 1270, 1270, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(4064925, 'Ancient Gear Advance', 'Spell Card', 'Spell Card', 'spell', 'When this card is activated: Add 1 \"Ancient Gear\" Spell/Trap from your Deck to your hand, except \"Ancient Gear Advance\". Once per turn: You can Tribute 1 monster; draw 1 card and apply this effect for the rest of this turn (even if this card leaves the field).\r\n● You can Normal Summon \"Ancient Gear Golem\", or Level 5 or higher monsters that mention it, without Tributing.\r\nYou cannot Set cards the turn you activate this card. You can only activate 1 \"Ancient Gear Advance\" per turn.', 1, 75, 'https://images.ygoprodeck.com/images/cards/4064925.jpg', 401, 401, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
