(4179255, 'Ancient Pixie Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nAfter resolving a Field Spell Card that was activated during your turn: Draw 1 card. You can only use this effect of \"Ancient Pixie Dragon\" once per turn. Once per turn: You can target 1 face-up Attack Position monster on the field; destroy that target. There must be a face-up Field Spell Card on the field to activate and to resolve this effect.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/4179255.jpg', 444, 444, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
