(4682617, 'Abyss Actors\' Curtain Call', 'Trap Card', 'Trap Card', 'trap', 'If an \"Abyss Script\" Spell Card or effect is activated this turn: Add face-up \"Abyss Actor\" Pendulum Monsters from your Extra Deck to your hand, up to the number of \"Abyss Script\" Spells in your GY. Then, you can Special Summon \"Abyss Actor\" Pendulum Monsters from your hand with different names, up to the number of monsters added to the hand by this effect. You cannot Special Summon monsters for the rest of this turn, except \"Abyss Actor\" Pendulum Monsters. You can only activate 1 \"Abyss Actors\' Curtain Call\" per turn.', 4, 16, 'https://images.ygoprodeck.com/images/cards/4682617.jpg', 77, 77, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(4709881, 'Auram the World Chalice Blademaster', 'Link Monster', 'Link Monster', 'link', '2 \"World Chalice\" monsters\r\nGains 300 ATK for each \"World Legacy\" monster in your GY with a different name. You can Tribute 1 \"World Chalice\" monster this card points to, then target 1 other monster in your GY; Special Summon it to your zone this card points to. You can only use this effect of \"Auram the World Chalice Blademaster\" once per turn. If this card is sent from the field to the GY: You can Special Summon 1 \"World Chalice\" monster from your hand.', 22, 134, 'https://images.ygoprodeck.com/images/cards/4709881.jpg', 807, 807, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(4729591, 'Appliancer Kappa Scale', 'Link Monster', 'Link Monster', 'link', '1 \"Appliancer\" monster\r\nCannot be used as Link Material the turn it is Link Summoned. You can Tribute this co-linked card; Special Summon 1 \"Appliancer\" Link Monster from your GY, except \"Appliancer Kappa Scale\". You can Tribute this card that is not co-linked; Special Summon 1 Level 4 or lower \"Appliancer\" monster from your GY. You can only use each effect of \"Appliancer Kappa Scale\" once per turn.', 12, 94, 'https://images.ygoprodeck.com/images/cards/4729591.jpg', 526, 526, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(4731783, 'A Bao A Qu, the Lightless Shadow', 'Link Monster', 'Link Monster', 'link', '2+ monsters, including a Fiend monster\r\nDuring the Main Phase (Quick Effect): You can discard 1 card, then activate 1 of these effects;\r\n● Destroy 1 card on the field.\r\n● Banish this card (until the End Phase), and if you do, Special Summon 1 LIGHT or DARK monster from your GY.\r\nDuring your Standby Phase: You can draw cards equal to the number of different Monster Types in your GY, then place cards from your hand on the bottom of the Deck in any order, equal to the number of cards you drew. You can only use each effect of \"A Bao A Qu, the Lightless Shadow\" once per turn.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/4731783.jpg', 17, 17, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
