(6150044, 'Arcana Knight Joker', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Queen\'s Knight\" + \"Jack\'s Knight\" + \"King\'s Knight\"\r\nA Fusion Summon of this card can only be done with the above materials. Once per turn, when a Spell/Trap Card, or monster effect, is activated that targets this face-up card on the field (Quick Effect): You can discard the same type of card (Monster, Spell, or Trap); negate the effect.', 14, 102, 'https://images.ygoprodeck.com/images/cards/6150044.jpg', 579, 579, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(6283472, 'Amorphage Pride', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nWhile you control an \"Amorphage\" monster, neither player takes any effect damage. Once per turn, during your Standby Phase, Tribute 1 monster or destroy this card.\n\n[ Monster Effect ] \nIf this card is Pendulum Summoned or flipped face-up, neither player can Special Summon monsters from the Extra Deck while this card is face-up on the field, except \"Amorphage\" monsters.', 19, 67, 'https://images.ygoprodeck.com/images/cards/6283472.jpg', 371, 371, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(6374519, 'Amazement Special Show', 'Spell Card', 'Spell Card', 'spell', 'When your opponent activates a card or effect that targets an \"Amazement\" monster(s) you control: Target 1 of those \"Amazement\" monsters you control; return it to the hand, then, you can Special Summon 1 \"Amazement\" monster from your hand.', 2, 60, 'https://images.ygoprodeck.com/images/cards/6374519.jpg', 318, 318, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(6438003, 'Ancient Warriors - Deceptive Jia Wen', 'Effect Monster', 'Effect Monster', 'effect', 'You can target 1 Continuous Spell/Trap you control; send it to the GY, and if you do, halve the ATK of 2 face-up monsters on the field, until the end of this turn. If a card(s) your opponent controls is destroyed by battle or card effect: You can target 1 \"Ancient Warriors\" card in your GY, except \"Ancient Warriors - Deceptive Jia Wen\"; add it to your hand. You can only use each effect of \"Ancient Warriors - Deceptive Jia Wen\" once per turn.', 15, 77, 'https://images.ygoprodeck.com/images/cards/6438003.jpg', 453, 453, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(6459419, 'Amazoness Shamanism', 'Trap Card', 'Trap Card', 'trap', 'Destroy all face-up \"Amazoness\" monsters you control. Then, you can Special Summon any number of Level 4 or lower \"Amazoness\" monsters from your Graveyard in face-up Defense Position, up to the number of monsters destroyed by this effect.', 4, 61, 'https://images.ygoprodeck.com/images/cards/6459419.jpg', 345, 345, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(6552971, 'A.I. Meet You', 'Spell Card', 'Spell Card', 'spell', 'Reveal 1 Cyberse monster with 2300 ATK in your hand or Extra Deck, and add 1 \"@Ignister\" monster with the same Attribute from your Deck to your hand. During the End Phase of this turn, take 2300 damage if you did not Special Summon the revealed monster, or a monster with the same name, after you resolved this effect. You cannot activate monster effects for the rest of this turn after this card resolves, except Cyberse monsters. You can only activate 1 \"A.I. Meet You\" per turn.', 4, 10, 'https://images.ygoprodeck.com/images/cards/6552971.jpg', 38, 38, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(6602300, 'Blaze Fenix, the Burning Bombardment Bird', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 Machine-Type monster + 1 Pyro-Type monster\nOnce per turn, during your Main Phase: You can inflict 300 damage to your opponent for each card on the field. This card cannot attack during the turn you activate this effect.', 26, NULL, 'https://images.ygoprodeck.com/images/cards/6602300.jpg', 1271, 1271, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(6625096, 'Beautunaful Princess', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal or Special Summoned: You can banish this card; Special Summon 1 Level 4 or lower Fish-Type monster from your Deck, except \"Beautunaful Princess\". You can only use this effect of \"Beautunaful Princess\" once per turn.', 8, NULL, 'https://images.ygoprodeck.com/images/cards/6625096.jpg', 1045, 1045, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(6628343, 'Beginning Knight', 'Effect Monster', 'Effect Monster', 'effect', 'A \"Black Luster Soldier\" monster Ritual Summoned using this card gains these effects. You can only use this effect of \"Beginning Knight\" once per turn.\r\n● Once per turn: You can target 1 monster your opponent controls; banish it.\r\n● When this card destroys an opponent\'s monster by battle and sends it to the Graveyard: You can activate this effect; this card can make a second attack in a row.\r\nIf this card is banished from the Graveyard: You can add 1 Ritual Spell Card from your Deck to your hand. You can only use this effect of \"Beginning Knight\" once per turn.', 14, 171, 'https://images.ygoprodeck.com/images/cards/6628343.jpg', 1066, 1066, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(6728559, 'Archnemeses Protos', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand) by banishing 3 monsters with different Attributes from your GY and/or face-up field. Cannot be destroyed by card effects. You can declare 1 monster Attribute on the field; destroy all monsters on the field with that Attribute, also until the end of the next turn, neither player can Special Summon monsters with that Attribute. You can only use this effect of \"Archnemeses Protos\" once per turn.', 25, 104, 'https://images.ygoprodeck.com/images/cards/6728559.jpg', 618, 618, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(6840573, 'Barox', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Frenzied Panda\" + \"Ryu-Kishin\"', 9, NULL, 'https://images.ygoprodeck.com/images/cards/6840573.jpg', 916, 916, '2025-03-10 13:13:06', '2025-03-10 13:13:06');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(6850209, 'A Deal with Dark Ruler', 'Spell Card', 'Spell Card', 'spell', '(This card is always treated as an \"Archfiend\" card.)\nIf a Level 8 or higher monster under your control was sent to the Graveyard this turn: Special Summon 1 \"Berserk Dragon\" from your hand or Deck.', 2, 5, 'https://images.ygoprodeck.com/images/cards/6850209.jpg', 19, 19, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(7165085, 'Bait Doll', 'Spell Card', 'Spell Card', 'spell', 'Target 1 Set card in the Spell & Trap Card Zone; reveal that target, force its activation if it is a Trap Card, then negate its effect if the activation timing is incorrect, and if you do, destroy it. (If it is not a Trap Card, return it face-down.) When this card resolves, shuffle it into the Deck instead of sending it to the Graveyard.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/7165085.jpg', 890, 890, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(7180418, 'Armor Exe', 'Effect Monster', 'Effect Monster', 'effect', 'This card cannot attack in the same turn it is Normal Summoned, Flip Summoned, or Special Summoned. During each of your and your opponent\'s Standby Phases, remove 1 Spell Counter on your side of the field. If you do not, destroy this card.', 17, NULL, 'https://images.ygoprodeck.com/images/cards/7180418.jpg', 672, 672, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(7183277, 'Aurkus, Lightsworn Druid', 'Effect Monster', 'Effect Monster', 'effect', 'Neither player can target \"Lightsworn\" monsters (anywhere) with card effects. During each of your End Phases: Send the top 2 cards of your Deck to the Graveyard.', 15, 135, 'https://images.ygoprodeck.com/images/cards/7183277.jpg', 808, 808, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(7279373, 'Abyss Actor - Twinkle Little Star', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nYou cannot Pendulum Summon monsters, except \"Abyss Actor\" monsters. This effect cannot be negated. Once per turn: You can target 1 \"Abyss Actor\" monster you control; this turn, it can make up to 3 attacks on monsters during each Battle Phase, also other monsters you control cannot attack for the rest of this turn (even if this card leaves the field).\n\n[ Monster Effect ] \nCannot be destroyed by battle during your turn. This card can make up to 3 attacks on monsters during each Battle Phase.', 9, 16, 'https://images.ygoprodeck.com/images/cards/7279373.jpg', 74, 74, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(7305060, 'Amorphage Greed', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nWhile you control an \"Amorphage\" monster, neither player can activate Trap Cards or their effects, except for \"Amorphage\" cards. Once per turn, during your Standby Phase, Tribute 1 monster or destroy this card.\n\n[ Monster Effect ] \nIf this card is Pendulum Summoned or flipped face-up, neither player can Special Summon monsters from the Extra Deck while this card is face-up on the field, except \"Amorphage\" monsters.', 19, 67, 'https://images.ygoprodeck.com/images/cards/7305060.jpg', 367, 367, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(7459919, 'Blackwing - Zonda the Dusk', 'Effect Monster', 'Effect Monster', 'effect', 'You cannot Special Summon monsters from the Extra Deck, except Synchro Monsters. You can only use 1 of the following effects of \"Blackwing - Zonda the Dusk\" per turn, and only once that turn. If this card is Normal or Special Summoned: You can target 1 monster on the field; return it to the hand. You can banish this card from your GY; Special Summon 1 Level 5 or higher \"Blackwing\" monster from your hand or Deck, then take damage equal to its ATK.', 24, 35, 'https://images.ygoprodeck.com/images/cards/7459919.jpg', 1245, 1245, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(7480763, 'Artifact Dagda', 'Link Monster', 'Link Monster', 'link', '2 monsters with different names\r\nWhen an effect of another card on the field is activated (Quick Effect): You can Set 1 \"Artifact\" monster from your hand or Deck to your Spell & Trap Zone as a Spell, but destroy it during your opponent\'s next End Phase. During your opponent\'s turn, if this Link Summoned card is destroyed: You can Special Summon 1 \"Artifact\" monster from your GY in Defense Position. You can only use each effect of \"Artifact Dagda\" once per turn.', 18, 123, 'https://images.ygoprodeck.com/images/cards/7480763.jpg', 728, 728, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(7602800, 'Black Feather Whirlwind', 'Spell Card', 'Spell Card', 'spell', 'Once per turn, if you Special Summon a DARK Synchro Monster from the Extra Deck (except during the Damage Step): You can target 1 of your \"Blackwing\" monsters, or \"Black-Winged Dragon\", that is banished or in your GY, with less ATK than that Special Summoned monster; Special Summon it. Once per turn, if a DARK monster you control would be destroyed by battle or card effect, you can remove 1 Black Feather Counter from your field instead.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/7602800.jpg', 1149, 1149, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(7653207, 'Aqua Jet', 'Spell Card', 'Spell Card', 'spell', 'Target 1 face-up Fish, Sea Serpent, or Aqua-Type monster you control; it gains 1000 ATK.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/7653207.jpg', 542, 542, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(7670542, 'Bio Plant', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A monster created from a major accident in an underground lab.\'\'', 9, NULL, 'https://images.ygoprodeck.com/images/cards/7670542.jpg', 1125, 1125, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(7913375, 'Artillery Catapult Turtle', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute 1 monster; Special Summon 1 \"Gaia The Fierce Knight\" monster, or 1 Level 5 Dragon monster, from your hand or Deck. You can only use this effect of \"Artillery Catapult Turtle\" once per turn.', 6, 109, 'https://images.ygoprodeck.com/images/cards/7913375.jpg', 740, 740, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(7935043, 'Aegis of the Ocean Dragon Lord', 'Trap Card', 'Trap Card', 'trap', 'Until the End Phase, face-up Level 3 or lower WATER monsters you control cannot be destroyed by battle or by card effects.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/7935043.jpg', 162, 162, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(7953868, 'Blue-Blooded Oni', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal or Flip Summoned: It is changed to Defense Position. Once per turn: You can detach 1 Xyz Material you control to target 1 Level 4 Zombie-Type monster in your Graveyard; Special Summon that target.', 28, NULL, 'https://images.ygoprodeck.com/images/cards/7953868.jpg', 1319, 1319, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(8058240, 'Binding Chain', 'Normal Monster', 'Normal Monster', 'normal', '\'\'The mystic links of this chain can rob enemies of their power.\'\'', 18, 17, 'https://images.ygoprodeck.com/images/cards/8058240.jpg', 1123, 1123, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(8078366, 'Atlantean Attack Squad', 'Effect Monster', 'Effect Monster', 'effect', 'This card gains 800 ATK while you control a face-up Fish, Sea Serpent, or Aqua-Type monster other than this card.', 20, 131, 'https://images.ygoprodeck.com/images/cards/8078366.jpg', 789, 789, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(8233522, 'Ally of Justice Cycle Reader', 'Tuner Monster', 'Tuner Monster', 'effect', 'During either player\'s turn: You can discard this card to the Graveyard, then target up to 2 LIGHT monsters in your opponent\'s Graveyard; banish those targets.', 12, 53, 'https://images.ygoprodeck.com/images/cards/8233522.jpg', 245, 245, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(8353769, 'Air Eater', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A monster that feeds on oxygen, suffocating any who stand near.\'\'', 9, NULL, 'https://images.ygoprodeck.com/images/cards/8353769.jpg', 181, 181, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(8396952, 'Arcana Force I - The Magician', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Summoned, toss a coin:\n● Heads: When a Spell Card is activated, this card\'s ATK becomes double its original ATK until the End Phase of that turn.\n● Tails: When a Spell Card is activated, your opponent gains 500 Life Points.', 18, 101, 'https://images.ygoprodeck.com/images/cards/8396952.jpg', 568, 568, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(8567955, 'Balancer Lord', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn: You can pay 1000 LP; during your Main Phase this turn, you can Normal Summon 1 Cyberse monster, in addition to your Normal Summon/Set. (You can only gain this effect once per turn.) If this card is banished: You can Special Summon 1 Level 4 or lower monster from your hand. You can only use this effect of \"Balancer Lord\" once per turn.', 22, NULL, 'https://images.ygoprodeck.com/images/cards/8567955.jpg', 894, 894, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(8571567, 'Blackwing - Shamal the Sandstorm', 'Tuner Monster', 'Tuner Monster', 'effect', 'You can send this card from your hand or field to the GY; place 1 \"Black Feather Whirlwind\" from your Deck face-up in your Spell & Trap Zone. If a \"Blackwing\" Synchro Monster(s) or \"Black-Winged Dragon\" is Special Summoned to your field, while this card is in your GY (except during the Damage Step): You can banish this card, then target 1 \"Blackwing\" monster in your GY; add it to your hand, then take 700 damage. You can only use each effect of \"Blackwing - Shamal the Sandstorm\" once per turn.', 24, 35, 'https://images.ygoprodeck.com/images/cards/8571567.jpg', 1232, 1232, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(8719957, 'Abyss-scale of the Kraken', 'Spell Card', 'Spell Card', 'spell', 'Equip only to a \"Mermail\" monster. It gains 400 ATK. When a monster effect that was activated on your opponent\'s side of the field resolves, negate that effect, then send this card to the Graveyard.', 3, 20, 'https://images.ygoprodeck.com/images/cards/8719957.jpg', 96, 96, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(8763963, 'Beelzeus of the Diabolic Dragons', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 DARK Tuner + 2+ non-Tuner monsters\r\nCannot be destroyed by battle or card effects. Other monsters you control cannot attack. Once per turn: You can target 1 monster your opponent controls; any battle damage your opponent takes from attacks involving this card this turn is halved, also, change that monster\'s ATK to 0, and if you do, gain LP equal to its original ATK.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/8763963.jpg', 1052, 1052, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(8822710, 'Ally of Justice Cosmic Gateway', 'Effect Monster', 'Effect Monster', 'effect', 'If your opponent controls 2 or more monsters, including a LIGHT monster, you can Special Summon this card from your hand.', 12, 53, 'https://images.ygoprodeck.com/images/cards/8822710.jpg', 244, 244, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(8873112, 'Artifact Chakram', 'Effect Monster', 'Effect Monster', 'effect', 'You can Set this card from your hand to your Spell & Trap Zone as a Spell Card. During your opponent\'s turn, if this Set card in the Spell & Trap Zone is destroyed and sent to your Graveyard: Special Summon it. During either player\'s turn, when a card or effect is activated that would destroy a Spell/Trap Card(s) you control, while this card is in your hand: You can return 1 Set Spell/Trap Card you control to the hand; Special Summon this card.', 18, 123, 'https://images.ygoprodeck.com/images/cards/8873112.jpg', 727, 727, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(8949584, 'A Hero Lives', 'Spell Card', 'Spell Card', 'spell', 'If you control no face-up monsters: Pay half your LP; Special Summon 1 Level 4 or lower \"Elemental HERO\" monster from your Deck.', 4, 6, 'https://images.ygoprodeck.com/images/cards/8949584.jpg', 23, 23, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(9012916, 'Black-Winged Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf you would take damage from a card effect, place 1 Black Feather Counter on this card instead. This card loses 700 ATK for each Black Feather Counter on it. Once per turn: You can remove all Black Feather Counters on this card, then target 1 face-up monster your opponent controls; that target loses 700 ATK for each Black Feather Counter you removed, and if it does, inflict damage to your opponent equal to the ATK lost by this effect.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/9012916.jpg', 1184, 1184, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(9047460, 'Blackwing - Steam the Cloak', 'Tuner Monster', 'Tuner Monster', 'effect', 'If this face-up card leaves the field: Special Summon 1 \"Steam Token\" (Aqua-Type/WIND/Level 1/ATK 100/DEF 100). If this card is in your Graveyard: You can Tribute 1 monster; Special Summon this card from the Graveyard. You can only use this effect of \"Blackwing - Steam the Cloak\" once per Duel. If this card Summoned this way is used as a Synchro Material Monster, all other Synchro Material Monsters must be \"Blackwing\" monsters.', 24, 35, 'https://images.ygoprodeck.com/images/cards/9047460.jpg', 1238, 1238, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(9076207, 'Armed Ninja', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: Target 1 Spell Card on the field; destroy that target. (If the target is Set, reveal it, and destroy it if it is a Spell Card. Otherwise, return it to its original position.)', 14, 38, 'https://images.ygoprodeck.com/images/cards/9076207.jpg', 660, 660, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(9109991, 'Blackwing - Fane the Steel Chain', 'Effect Monster', 'Effect Monster', 'effect', 'This card can attack your opponent directly. If this card inflicts battle damage to your opponent by a direct attack: Target 1 Attack Position monster your opponent controls; change that target to Defense Position.', 24, 35, 'https://images.ygoprodeck.com/images/cards/9109991.jpg', 1212, 1212, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(9156135, 'Apprentice Magician', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Summoned: Target 1 face-up card on the field that you can place a Spell Counter on; place 1 Spell Counter on that target. If this card is destroyed by battle: You can Special Summon 1 Level 2 or lower Spellcaster monster from your Deck in face-down Defense Position.', 11, 26, 'https://images.ygoprodeck.com/images/cards/9156135.jpg', 535, 535, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(9341993, 'Adamancipator Relief', 'Trap Card', 'Trap Card', 'trap', 'Tribute any number of \"Adamancipator\" monsters, then target cards on the field equal to that number +1; destroy them.', 4, 28, 'https://images.ygoprodeck.com/images/cards/9341993.jpg', 134, 134, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(9453320, 'Abysstrite, the Atlantean Spirit', 'XYZ Monster', 'XYZ Monster', 'xyz', '2+ Level 7 WATER monsters\r\nWATER monsters you control gain 300 ATK/DEF for each material attached to this card. You can only use each of the following effects of \"Abysstrite, the Atlantean Spirit\" once per turn. If this card is Xyz Summoned: You can target 1 Level 7 or lower Fish, Sea Serpent, or Aqua monster in your GY; Special Summon it. You can detach 1 material from this card; Set 1 \"Abyss-\" Trap from your Deck.', 20, 19, 'https://images.ygoprodeck.com/images/cards/9453320.jpg', 107, 107, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(9464441, 'Adamancipator Risen - Dragite', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nDuring your Main Phase: You can excavate the top 5 cards of your Deck, and if you do, you can return cards your opponent controls to the hand, up to the number of excavated Rock monsters, also place the excavated cards on the bottom of your Deck in any order. When your opponent activates a Spell/Trap Card or effect, while a WATER monster is in your GY (Quick Effect): You can negate the activation, and if you do, destroy it. You can only use each effect of \"Adamancipator Risen - Dragite\" once per turn.', 17, 28, 'https://images.ygoprodeck.com/images/cards/9464441.jpg', 137, 137, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(9785661, 'Azamina Sol Erysichthon', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 Illusion monster + 1 Fiend monster\r\nIf this card is Fusion Summoned: You can target 1 card on the field; send it to the GY. During the Standby Phase: You can target 1 \"Azamina\" or \"Sinful Spoils\" card in your GY; add it to your hand. You can only use each effect of \"Azamina Sol Erysichthon\" once per turn.', 36, 144, 'https://images.ygoprodeck.com/images/cards/9785661.jpg', 845, 845, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(9888196, 'Ally of Justice Decisive Armor', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 2 or more non-Tuner monsters \n Once per turn, if your opponent controls a face-up LIGHT monster(s), you can activate 1 of these effects:\n● Select 1 Set card your opponent controls, and destroy it.\n● Send 1 card from your hand to the Graveyard to destroy all Spell/Trap Cards your opponent controls.\n● Send all cards in your hand to the Graveyard to look at your opponent\'s hand and send all LIGHT monsters in their hand to the Graveyard. Then, inflict damage to your opponent equal to the total ATK of the opponent\'s monsters sent to the Graveyard.', 12, 53, 'https://images.ygoprodeck.com/images/cards/9888196.jpg', 247, 247, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
