(13662809, 'Abyss Script - Rise of the Abyss King', 'Spell Card', 'Spell Card', 'spell', 'Target face-up cards on the field, up to the number of Attack Position \"Abyss Actor\" monsters with different names you control; destroy them. If you control a Level 7 or higher \"Abyss Actor\" monster, your opponent cannot activate cards or effects in response to this card\'s activation. If this Set card in its owner\'s control is destroyed by an opponent\'s card effect, and you have a face-up \"Abyss Actor\" Pendulum Monster in your Extra Deck: You can add up to 2 \"Abyss Actor\" cards and/or \"Abyss Script\" Spells with different names from your Deck to your hand.', 4, 16, 'https://images.ygoprodeck.com/images/cards/13662809.jpg', 89, 89, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(13744068, 'Berserk Archfiend', 'Effect Monster', 'Effect Monster', 'effect', 'You can target up to 2 face-up monsters you control, including a Fiend monster; Special Summon this card from your hand, and if you do, destroy those monsters. You can only use this effect of \"Berserk Archfiend\" once per turn. When a monster(s) is destroyed by this card\'s effect: You can target face-up monsters your opponent controls equal to the number destroyed; this card gains ATK equal to their combined original ATK, until the end of your next turn.', 9, 5, 'https://images.ygoprodeck.com/images/cards/13744068.jpg', 1083, 1083, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(13836592, 'Behemoth the King of a Hundred Battles', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute Summon this card by Tributing 1 monster. This card is unaffected by the activated effects of Special Summoned monsters if it was Normal Summoned/Set. If this card is Normal or Special Summoned: You can target 1 Beast, Beast-Warrior, or Winged Beast monster in your GY; add it to your hand, and if you do, this card loses 700 ATK. Once per turn, during your End Phase: You can make this card gain 700 ATK.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/13836592.jpg', 1070, 1070, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(13923256, 'Ancient Warriors - Eccentric Lu Jing', 'Effect Monster', 'Effect Monster', 'effect', 'You can target 1 Continuous Spell/Trap you control; send it to the GY, and if you do, add 1 \"Ancient Warriors\" Spell/Trap with a different name from your GY to your hand. If your other \"Ancient Warriors\" monster\'s effect is activated (except during the Damage Step): You can target 1 Spell/Trap your opponent controls; destroy it. You can only use each effect of \"Ancient Warriors - Eccentric Lu Jing\" once per turn.', 15, 77, 'https://images.ygoprodeck.com/images/cards/13923256.jpg', 454, 454, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(14015067, 'Ancient One of the Deep Forest', 'Normal Monster', 'Normal Monster', 'normal', 'This creature adopts the form of a white goat living in the forest, but is actually a Forest Elder.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/14015067.jpg', 443, 443, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(14089428, 'Blue Thunder T-45', 'Effect Monster', 'Effect Monster', 'effect', 'If this card destroys an opponent\'s monster by battle: Special Summon 1 \"Thunder Option Token\" (Machine-Type/LIGHT/Level 4/ATK 1500/DEF 1500). This Token cannot be Tributed for a Tribute Summon.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/14089428.jpg', 1318, 1318, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(14148099, 'B.E.S. Big Core', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal Summoned: Place 3 counters on it. Cannot be destroyed by battle. At the end of the Damage Step, if this card battled: Remove 1 counter from this card. If you cannot, destroy it.', 12, 146, 'https://images.ygoprodeck.com/images/cards/14148099.jpg', 851, 851, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(14169843, 'Aromage Laurel', 'Effect Monster', 'Effect Monster', 'effect', 'If your LP are higher than your opponent\'s: You can Special Summon this card from your hand. If you gain LP: Target 1 non-Tuner Plant monster on the field; it is treated as a Tuner this turn. If this card is sent to the GY: You can gain 500 LP. You can only use each effect of \"Aromage Laurel\" once per turn.', 21, 121, 'https://images.ygoprodeck.com/images/cards/14169843.jpg', 705, 705, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(14261867, '8-Claws Scorpion', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, you can flip this card into face-down Defense Position. When this card attacks an opponent\'s face-down Defense Position monster, this card\'s ATK becomes 2400 during damage calculation only.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/14261867.jpg', 16, 16, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(14430063, 'Archfiend Interceptor', 'Effect Monster', 'Effect Monster', 'effect', 'While you control this face-up Attack Position card, when an opponent\'s monster declares an attack, inflict 500 damage to your opponent.', 9, 5, 'https://images.ygoprodeck.com/images/cards/14430063.jpg', 597, 597, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(14504454, 'Alice, Lady of Lament', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can target 1 \"Lady of Lament\" monster in your GY; Special Summon it. You can only use each of the following effects of \"Alice, Lady of Lament\" once per turn. You can banish 1 Trap from your hand or GY; Special Summon this card from your hand. If this card is Tributed, or if this card in its owner\'s possession is destroyed by an opponent\'s card: You can add 1 Fiend monster whose combined ATK & DEF equal 2000 from your Deck to your hand, except \"Alice, Lady of Lament\".', 9, 47, 'https://images.ygoprodeck.com/images/cards/14504454.jpg', 207, 207, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(14553285, 'Arcanite Magician/Assault Mode', 'Effect Monster', 'Effect Monster', 'effect', 'This card cannot be Normal Summoned or Set. This card cannot be Special Summoned except with \"Assault Mode Activate\". When this card is Special Summoned, place 2 Spell Counters on it. This card gains 1000 ATK for each Spell Counter on it. You can remove 2 Spell Counters from this card to destroy all cards your opponent controls. When this card on the field is destroyed, you can Special Summon 1 \"Arcanite Magician\" from your Graveyard.', 11, 103, 'https://images.ygoprodeck.com/images/cards/14553285.jpg', 587, 587, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(14558127, 'Ash Blossom & Joyous Spring', 'Tuner Monster', 'Tuner Monster', 'effect', 'When a card or effect is activated that includes any of these effects (Quick Effect): You can discard this card; negate that effect.\r\n● Add a card from the Deck to the hand.\r\n● Special Summon from the Deck.\r\n● Send a card from the Deck to the GY.\r\nYou can only use this effect of \"Ash Blossom & Joyous Spring\" once per turn.', 28, NULL, 'https://images.ygoprodeck.com/images/cards/14558127.jpg', 746, 746, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(14568951, 'Blue Dragon Ninja', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, during either player\'s turn: You can discard 1 \"Ninja\" monster and 1 \"Ninjitsu Art\" card to target 1 face-up monster your opponent controls; this turn, that monster\'s effects are negated, also that monster cannot attack.', 20, 38, 'https://images.ygoprodeck.com/images/cards/14568951.jpg', 1311, 1311, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(14708569, 'Arlownay', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A lady monster dwelling in a flower, she sprinkles the air with poisonous pollen.\'\'', 21, NULL, 'https://images.ygoprodeck.com/images/cards/14708569.jpg', 636, 636, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(14785765, 'Blackwing - Zephyros the Elite', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is in your GY: You can return 1 face-up card you control to the hand; Special Summon this card, and if you do, take 400 damage. You can only use this effect of \"Blackwing - Zephyros the Elite\" once per Duel.', 24, 35, 'https://images.ygoprodeck.com/images/cards/14785765.jpg', 1244, 1244, '2025-03-10 13:13:12', '2025-03-10 13:13:12');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(15013468, 'Andro Sphinx', 'Effect Monster', 'Effect Monster', 'effect', 'You can pay 500 Life Points to Special Summon this card when \"Pyramid of Light\" is on the field. This card cannot attack during the turn that it is Normal Summoned or Special Summoned. This card cannot be Special Summoned from the Graveyard. If this card destroys a Defense Position monster as a result of battle, inflict damage to your opponent\'s Life Points equal to half of the ATK of the destroyed monster.', 5, 78, 'https://images.ygoprodeck.com/images/cards/15013468.jpg', 473, 473, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(15150371, 'Archfiend Mirror', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A wicked mirror that hypnotizes enemies, diverting attacks from their intended targets.\'\'', 9, 5, 'https://images.ygoprodeck.com/images/cards/15150371.jpg', 599, 599, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(15177750, 'Blessed Winds', 'Trap Card', 'Trap Card', 'trap', 'You can activate 1 of the following effects.\r\n● Send 1 Plant monster from your hand or face-up field to the GY; gain 500 LP.\r\n● Target 1 Plant monster in your GY; shuffle it into the Deck, then gain 500 LP.\r\n● Pay 1000 LP; Special Summon 1 \"Aroma\" monster from your GY.\r\nYou can only use this effect of \"Blessed Winds\" once per turn.', 1, 121, 'https://images.ygoprodeck.com/images/cards/15177750.jpg', 1279, 1279, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(15308295, 'Abyss Actor - Comic Relief', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nYou can target 1 \"Abyss Actor\" Pendulum Monster you control and 1 monster your opponent controls; switch control of both monsters, then destroy this card. You can only use this effect of \"Abyss Actor - Comic Relief\" once per turn.\n\n[ Monster Effect ] \nYou take no battle damage from attacks involving this card. Once per turn, during your Standby Phase: Give control of this card to your opponent. Once per turn, if control of this face-up card changes: Activate this effect; the owner of this card can destroy 1 Set \"Abyss Script\" Spell in their Spell & Trap Zone.', 9, 16, 'https://images.ygoprodeck.com/images/cards/15308295.jpg', 61, 61, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(15317640, 'B.E.S. Covered Core', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned, put 2 counters on it. This card cannot be destroyed by battle. If this card attacks or is attacked, at the end of the Damage Step toss a coin and call it. If you call it wrong, remove 1 counter. If this card battles without a counter, destroy it at the end of the Damage Step.', 12, 146, 'https://images.ygoprodeck.com/images/cards/15317640.jpg', 855, 855, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(15381252, 'Berserker Soul', 'Spell Card', 'Spell Card', 'spell', 'When a monster you control inflicts 1500 or less damage to your opponent by a direct attack: Discard your entire hand (min. 1); excavate the top card of your Deck, and if it is a Monster Card, send it to the Graveyard, and if you do that, inflict 500 damage to your opponent, then repeat this effect up to 7 more times or until you excavate a non-Monster Card. If a non-Monster Card is excavated, place it on the top of your Deck. You can only activate 1 \"Berserker Soul\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/15381252.jpg', 1089, 1089, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(15464375, 'Adularia of the June Moon', 'Effect Monster', 'Effect Monster', 'effect', 'If you control a face-up card in your Spell & Trap Zone, you can Special Summon this card (from your hand). You can only Special Summon \"Adularia of the June Moon\" once per turn this way. Gains 600 ATK/DEF for each face-up Spell/Trap on the field. You can send 2 face-up cards from your Spell & Trap Zone to the GY; send 1 Level 4 or lower monster from your Deck to the GY. You can only use this effect of \"Adularia of the June Moon\" once per turn.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/15464375.jpg', 146, 146, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(15471265, 'Berserker Crush', 'Spell Card', 'Spell Card', 'spell', 'Banish 1 monster from your GY, then target 1 \"Winged Kuriboh\" you control; that target\'s ATK/DEF become equal to the ATK/DEF of the monster that was banished, until the end of this turn.', 2, 85, 'https://images.ygoprodeck.com/images/cards/15471265.jpg', 1087, 1087, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(15475415, 'Alien Dog', 'Effect Monster', 'Effect Monster', 'effect', 'When you Normal Summon an \"Alien\" monster, you can Special Summon this card from your hand. When you do, place 2 A-Counters on face-up monster(s) your opponent controls.', 27, 1, 'https://images.ygoprodeck.com/images/cards/15475415.jpg', 211, 211, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(15480588, 'Armored Lizard', 'Normal Monster', 'Normal Monster', 'normal', 'A lizard with a very tough hide and a vicious bite.', 27, NULL, 'https://images.ygoprodeck.com/images/cards/15480588.jpg', 682, 682, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(15629801, 'Battle Waltz', 'Spell Card', 'Spell Card', 'spell', 'Target 1 Synchro Monster you control; Special Summon 1 \"Waltz Token\" with the current Type, Attribute, Level, ATK and DEF of that monster. Neither player takes any battle damage from attacks involving this Token.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/15629801.jpg', 967, 967, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(15808381, 'Achichi @Ignister', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned: You can add 1 Level 4 or lower \"@Ignister\" monster from your Deck to your hand, except \"Achichi @Ignister\". At the start of the Damage Step, when your Cyberse monster battles: You can banish this card from your GY; destroy that monster you control. You can only use each effect of \"Achichi @Ignister\" once per turn.', 22, 11, 'https://images.ygoprodeck.com/images/cards/15808381.jpg', 117, 117, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(15951532, 'Amazoness Queen', 'Effect Monster', 'Effect Monster', 'effect', '\"Amazoness\" monsters you control cannot be destroyed by battle.', 14, 61, 'https://images.ygoprodeck.com/images/cards/15951532.jpg', 341, 341, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(16051717, 'Assault Blackwing - Raikiri the Rain Shower', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nIf this card is Synchro Summoned using a \"Blackwing\" monster as Material, it is treated as a Tuner monster while face-up on the field. Once per turn: You can target cards your opponent controls, up to the number of other \"Blackwing\" monsters you control; destroy them.', 24, 35, 'https://images.ygoprodeck.com/images/cards/16051717.jpg', 759, 759, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(16135253, 'Agido', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is destroyed and sent to the Graveyard as a result of battle, roll a six-sided die. You can Special Summon 1 Fairy-Type monster from your Graveyard whose Level is equal to the number rolled. (If the result is 6, you can Special Summon a Level 6 or higher monster.)', 18, NULL, 'https://images.ygoprodeck.com/images/cards/16135253.jpg', 174, 174, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(16246527, 'Armored Rat', 'Normal Monster', 'Normal Monster', 'normal', '\'\'The fur on this monster rat is tough enough to repel swords.\'\'', 5, 17, 'https://images.ygoprodeck.com/images/cards/16246527.jpg', 683, 683, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(16255442, 'Beckoning Light', 'Trap Card', 'Trap Card', 'trap', 'Discard your entire hand, then for each card you discarded to the GY by this effect, add 1 LIGHT monster from your GY to your hand.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/16255442.jpg', 1048, 1048, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(16272453, 'Armor Ninjitsu Art of Alchemy', 'Spell Card', 'Spell Card', 'spell', 'If you control a \"Ninjitsu Art\" card: Destroy as many other \"Ninjitsu Art\" cards you control as possible, then draw 2 cards.', 4, 116, 'https://images.ygoprodeck.com/images/cards/16272453.jpg', 673, 673, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(16516630, 'Blackwing - Boreas the Sharp', 'Effect Monster', 'Effect Monster', 'effect', 'During your Main Phase 1: You can banish this card from the Graveyard, then target 1 \"Blackwing\" monster you control; if that monster attacks this turn, you take no battle damage from that attack, it is not destroyed by that battle, also destroy the opponent\'s monster that it battled, after damage calculation.', 24, 35, 'https://images.ygoprodeck.com/images/cards/16516630.jpg', 1202, 1202, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(16759958, 'Aromaseraphy Angelica', 'Tuner Monster', 'Tuner Monster', 'effect', 'During either player\'s turn: You can discard this card, then target 1 \"Aroma\" monster in your Graveyard; gain LP equal to that target\'s ATK. While your LP is higher than your opponent\'s, you control an \"Aroma\" monster, and this card is in your Graveyard: You can Special Summon this card, but banish it when it leaves the field. You can only use each effect of \"Aromaseraphy Angelica\" once per turn.', 21, 121, 'https://images.ygoprodeck.com/images/cards/16759958.jpg', 711, 711, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(16768387, 'Big Eye', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: Look at up to 5 cards from the top of your Deck, then place them on the top of the Deck in any order.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/16768387.jpg', 1107, 1107, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(16796157, 'Beast-Warrior Puma', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute this card; add 1 \"D.D. Esper Star Sparrow\" from your Deck or Graveyard to your hand.', 15, NULL, 'https://images.ygoprodeck.com/images/cards/16796157.jpg', 1034, 1034, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(16889337, 'Aratama', 'Spirit Monster', 'Spirit Monster', 'effect', 'Cannot be Special Summoned. During the End Phase of the turn this card is Normal Summoned or flipped face-up: Return it to the hand. When this card is Normal Summoned or flipped face-up: You can add 1 Spirit monster from your Deck to your hand, except \"Aratama\".', 9, NULL, 'https://images.ygoprodeck.com/images/cards/16889337.jpg', 559, 559, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(16899564, 'Beautiful Headhuntress', 'Normal Monster', 'Normal Monster', 'normal', 'A vicious creature that has decapitated numerous enemy monsters.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/16899564.jpg', 1044, 1044, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(16984449, 'Blazewing Butterfly', 'Gemini Monster', 'Gemini Monster', 'effect', 'This card is treated as a Normal Monster while face-up on the field or in the Graveyard. While this card is a Normal Monster on the field, you can Normal Summon it to have it become an Effect Monster with this effect.\n● You can Tribute this card, then target 1 Gemini monster in your Graveyard, except \"Blazewing Butterfly\"; Special Summon that target, and if you do, it becomes an Effect Monster, and gains its effect.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/16984449.jpg', 1273, 1273, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(17080584, 'Abyssrhine, the Atlantean Spirit', 'Effect Monster', 'Effect Monster', 'effect', '(This card is always treated as a \"Mermail\" card.)\r\nYou can Tribute this card from your hand and 1 \"Atlantean\" or \"Mermail\" monster from your hand or field; take 1 Level 7 Fish, Sea Serpent, or Aqua monster from your Deck and either add it to your hand or Special Summon it, also you cannot Special Summon from the Extra Deck for the rest of this turn, except WATER monsters. During your opponent\'s turn (Quick Effect): You can banish this card from your GY and discard 1 card to the GY; draw 1 card. You can only use each effect of \"Abyssrhine, the Atlantean Spirit\" once per turn.', 6, 19, 'https://images.ygoprodeck.com/images/cards/17080584.jpg', 106, 106, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(17092736, 'Ancient Telescope', 'Spell Card', 'Spell Card', 'spell', 'See the top 5 cards of your opponent\'s Deck. Return the cards to the Deck in the same order.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/17092736.jpg', 449, 449, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(17170970, 'Armored White Bear', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned while a Synchro Monster is on the field: You can target 1 Field Spell in your GY; add it to your hand. If this card is destroyed by battle and sent to the GY, or if this card in your possession is destroyed by an opponent\'s card effect and sent to your GY: You can Special Summon 1 Level 4 or lower Beast monster from your Deck or GY, except \"Armored White Bear\". You can only use each effect of \"Armored White Bear\" once per turn.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/17170970.jpg', 686, 686, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(17377751, 'Blackwing - Gram the Shining Star', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nMust first be Synchro Summoned. When this card is Synchro Summoned: You can Special Summon 1 Level 4 or lower non-Tuner \"Blackwing\" monster from your hand, but its effects are negated.', 24, 35, 'https://images.ygoprodeck.com/images/cards/17377751.jpg', 1217, 1217, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(17465972, 'Blackwing - Auster the South Wind', 'Tuner Monster', 'Tuner Monster', 'effect', 'Cannot be Special Summoned. When this card is Normal Summoned: You can target 1 of your banished Level 4 or lower \"Blackwing\" monsters; Special Summon it in Defense Position. You can banish this card from the GY to activate 1 of the following effects;\r\n● Place Black Feather Counter(s) on 1 \"Black-Winged Dragon\" you control, equal to the number of card(s) your opponent controls.\r\n● Place 1 Wedge Counter on each face-up monster your opponent controls that does not have one.', 24, 35, 'https://images.ygoprodeck.com/images/cards/17465972.jpg', 1195, 1195, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(17469113, 'Avida, Rebuilder of Worlds', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must be Special Summoned (from your hand) by there being at least 8 or more Link Monsters with different names on the field and/or in the GYs. You cannot Special Summon other monsters the turn you Special Summon this card. This card\'s Special Summon cannot be negated. If this card is Special Summoned: Shuffle all other monsters that are banished, on the field, and in the GYs into the Decks. Neither player can activate cards or effects in response to this effect\'s activation.', 22, 140, 'https://images.ygoprodeck.com/images/cards/17469113.jpg', 823, 823, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(17490535, 'Alien Brain', 'Trap Card', 'Trap Card', 'trap', 'When a Reptile-Type monster you control is destroyed by battle with an opponent\'s attacking monster and sent to the Graveyard: Take control of the opponent\'s monster, and if you do, it becomes Reptile-Type.', 4, 1, 'https://images.ygoprodeck.com/images/cards/17490535.jpg', 210, 210, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(17535588, 'Armored Starfish', 'Normal Monster', 'Normal Monster', 'normal', 'A bluish starfish with a solid hide capable of fending off attacks.', 6, NULL, 'https://images.ygoprodeck.com/images/cards/17535588.jpg', 685, 685, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
