(21546416, 'Armed Dragon Thunder LV5', 'Effect Monster', 'Effect Monster', 'effect', 'This card\'s name becomes \"Armed Dragon LV5\" while on the field or in the GY. You can only use each of the following effects of \"Armed Dragon Thunder LV5\" once per turn. You can send 1 monster from your hand to the GY; send this card from the field to the GY, and if you do, Special Summon 1 Level 7 or lower \"Armed Dragon\" monster from your hand or Deck. If this card is sent to the GY to activate a Dragon monster\'s effect: You can add 1 Level 5 or higher WIND Dragon monster from your Deck to your hand.', 19, 111, 'https://images.ygoprodeck.com/images/cards/21546416.jpg', 655, 655, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(21597117, 'A Hero Emerges', 'Trap Card', 'Trap Card', 'trap', 'When an opponent\'s monster declares an attack: Your opponent chooses 1 random card from your hand, then if it is a monster that can be Special Summoned, Special Summon it. Otherwise, send it to the Graveyard.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/21597117.jpg', 22, 22, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(21846145, 'Abduction', 'Trap Card', 'Trap Card', 'trap', 'Target 1 face-up monster your opponent controls; banish 1 monster from your Deck or Extra Deck with the same original Type, Attribute, and Level/Rank/Link Rating, and if you do, take control of it, but if you banished a monster with the same original name, negate the effects of the monster you took control of. You can only activate 1 \"Abduction\" per turn.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/21846145.jpg', 48, 48, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(21984400, 'Beast Magic Attack', 'Spell Card', 'Spell Card', 'spell', 'Remove Spell Counters from your field to activate 1 of these effects.\r\n● 2: Return 1 \"Mythical Beast\" Pendulum Monster you control to the hand.\r\n● 4: Special Summon 1 face-up \"Mythical Beast\" Pendulum Monster from your Extra Deck, then you can place 2 Spell Counters on it.\r\n● 6: Special Summon 1 face-up Pendulum Monster from your Extra Deck.\r\nYou can only activate 1 \"Beast Magic Attack\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/21984400.jpg', 1025, 1025, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(22024279, 'Altergeist Revitalization', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Altergeist\" Link Monster in your GY; Special Summon it. You can banish this card from your GY; immediately after this effect resolves, Normal Summon 1 \"Altergeist\" monster. You can only use 1 \"Altergeist Revitalization\" effect per turn, and only once that turn.', 4, 57, 'https://images.ygoprodeck.com/images/cards/22024279.jpg', 293, 293, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(22047978, 'Battle Break', 'Trap Card', 'Trap Card', 'trap', 'When an opponent\'s monster declares an attack: Your opponent can reveal 1 monster in their hand to negate this card\'s effect, otherwise destroy the attacking monster, then end the Battle Phase.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/22047978.jpg', 951, 951, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(22082163, 'Amazoness Willpower', 'Trap Card', 'Trap Card', 'trap', 'Select 1 \"Amazoness\" monster in your Graveyard and Special Summon it in Attack Position. It cannot change its battle position and must attack if able. When this card is removed from the field, destroy that monster. When that monster is destroyed, destroy this card.', 1, 61, 'https://images.ygoprodeck.com/images/cards/22082163.jpg', 355, 355, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(22125101, 'Beyond the Pendulum', 'Link Monster', 'Link Monster', 'link', '2 Effect Monsters, including a Pendulum Monster\r\nIf this card is Link Summoned in the Extra Monster Zone: You can pay 1200 LP; add 1 Pendulum Monster from your Deck to your hand, but for the rest of this turn, unless you Pendulum Summon after this effect resolves, you cannot activate monster effects, and the effects of any cards in your Pendulum Zones are negated. If 2 monsters with different original Levels are Pendulum Summoned at the same time to the zones this card points to: You can target 2 cards on the field; destroy them. You can only use this effect of \"Beyond the Pendulum\" once per turn.', 11, 176, 'https://images.ygoprodeck.com/images/cards/22125101.jpg', 1098, 1098, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(22174866, 'Aromage Cananga', 'Effect Monster', 'Effect Monster', 'effect', 'While your LP is higher than your opponent\'s, face-up monsters your opponent controls lose 500 ATK and DEF. Once per turn, if you gain LP: Target 1 Spell/Trap Card your opponent controls; return it to the hand.', 21, 121, 'https://images.ygoprodeck.com/images/cards/22174866.jpg', 703, 703, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(22371016, 'Ally of Justice Unknown Crusher', 'Effect Monster', 'Effect Monster', 'effect', 'When this card battles a LIGHT monster, remove that monster from play after damage calculation.', 12, 53, 'https://images.ygoprodeck.com/images/cards/22371016.jpg', 260, 260, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(22377815, 'Aquarian Alessa', 'Gemini Monster', 'Gemini Monster', 'effect', 'This card is treated as a Normal Monster while face-up on the field or in the Graveyard. While this card is face-up on the field, you can Normal Summon it to have it be treated as an Effect Monster with this effect:\n● When this card destroys an opponent\'s monster by battle and sends it to the Graveyard, they discard 1 random card.', 6, NULL, 'https://images.ygoprodeck.com/images/cards/22377815.jpg', 554, 554, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(22386234, 'Aurora Paragon', 'Effect Monster', 'Effect Monster', 'effect', 'Neither player can Special Summon monsters. When another monster is Normal Summoned to either player\'s side of the field, destroy this card.', 18, NULL, 'https://images.ygoprodeck.com/images/cards/22386234.jpg', 809, 809, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(22493812, 'Army Ant Token', 'Token', 'Token', 'token', 'Special Summoned with the effect of \"Multiplication of Ants\". This Token cannot be used as a Tribute for a Tribute Summon.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/22493812.jpg', 694, 694, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(22662014, 'Amazement Assistant Delia', 'Effect Monster', 'Effect Monster', 'effect', 'You can reveal 1 \"Attraction\" Trap in your hand; Special Summon this card from your hand. You can send 1 \"Attraction\" Trap from your hand or face-up field to the GY; Set 1 \"Attraction\" Trap directly from your Deck to your Spell & Trap Zone. You can only use each effect of \"Amazement Assistant Delia\" once per turn.', 12, 60, 'https://images.ygoprodeck.com/images/cards/22662014.jpg', 314, 314, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(22790789, 'B.E.S. Crystal Core', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned, put 3 counters on it. This card cannot be destroyed by battle. If this card attacks or is attacked, remove 1 counter from this card at the end of the Damage Step. If you cannot, destroy it. Once per turn, during your Main Phase, you can change 1 face-up Attack Position monster your opponent controls to face-up Defense Position.', 12, 146, 'https://images.ygoprodeck.com/images/cards/22790789.jpg', 856, 856, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(22796548, 'Archfiend\'s Oath', 'Spell Card', 'Spell Card', 'spell', 'Once per turn: You can pay 500 Life Points, then declare 1 card name; excavate the top card of your Deck, and if it is the declared card, add it to your hand. Otherwise, send it to the Graveyard.', 1, 5, 'https://images.ygoprodeck.com/images/cards/22796548.jpg', 611, 611, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(22802010, 'Blind Obliteration', 'Trap Card', 'Trap Card', 'trap', 'Roll a six-sided die twice and destroy all face-up monsters with Levels/Ranks lower than the total roll.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/22802010.jpg', 1284, 1284, '2025-03-10 13:13:13', '2025-03-10 13:13:13');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(22835145, 'Blackwing - Blizzard the Far North', 'Tuner Monster', 'Tuner Monster', 'effect', 'Cannot be Special Summoned. When this card is Normal Summoned: You can target 1 Level 4 or lower \"Blackwing\" monster in your Graveyard; Special Summon that target in Defense Position.', 24, 35, 'https://images.ygoprodeck.com/images/cards/22835145.jpg', 1198, 1198, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(22933016, 'A.I.dle Reborn', 'Spell Card', 'Spell Card', 'spell', 'Target 1 \"@Ignister\" monster in your GY; Special Summon it, also you cannot Special Summon monsters for the rest of this turn after this card resolves, except Cyberse monsters. When an attack is declared involving 2 monsters: You can banish this card from your GY and 1 card from your hand, then target 1 of your \"A.I.\" Spells/Traps that is banished or in your GY, except \"A.I.dle Reborn\"; add that card to your hand. You can only use each effect of \"A.I.dle Reborn\" once per turn.', 2, 11, 'https://images.ygoprodeck.com/images/cards/22933016.jpg', 42, 42, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(22953211, 'Bellcat Fighter', 'Link Monster', 'Link Monster', 'link', '3 monsters, including a Token\r\nWhen this card destroys an opponent\'s monster by battle: You can Special Summon 1 \"Bellcat Token\" (Machine/WIND/Level 4/ATK 2000/DEF 2000) in Defense Position.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/22953211.jpg', 1076, 1076, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(22996376, 'Behemoth the King of All Animals', 'Effect Monster', 'Effect Monster', 'effect', 'This card can be Normal Summoned or Set with 1 Tribute. In that case, the original ATK of this card becomes 2000. When this card is Tribute Summoned, you can return from your Graveyard to the owner\'s hand a number of Beast-Type monsters equal to the number of Tributed monsters.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/22996376.jpg', 1071, 1071, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(23160024, 'Amorphous Persona', 'Spell Card', 'Spell Card', 'spell', 'All \"Amorphage\" monsters on the field gain 300 ATK and DEF. Up to twice per turn, if an \"Amorphage\" monster(s) you control is Tributed, draw 1 card. You can banish this card from your Graveyard; Tribute Pendulum Monsters from your hand or field whose total Levels exactly equal 8, then Ritual Summon 1 \"Amorphactor Pain, the Imagination Dracoverlord\" from your hand.', 10, 67, 'https://images.ygoprodeck.com/images/cards/23160024.jpg', 374, 374, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(23232295, 'Battlin\' Boxer Lead Yoke', 'XYZ Monster', 'XYZ Monster', 'xyz', '2 Level 4 \"Battlin\' Boxer\" monsters\nIf a \"Battlin\' Boxer\" monster(s) you control would be destroyed by battle or by a card effect, you can detach 1 Xyz Material from this card instead of destroying 1 of those monsters. When an Xyz Material(s) is detached from this card: This card gains 800 ATK.', 14, 161, 'https://images.ygoprodeck.com/images/cards/23232295.jpg', 999, 999, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(23338098, 'Assault Blackwing - Chidori the Rain Sprinkling', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nIf this card is Synchro Summoned using a \"Blackwing\" monster as Material, it is treated as a Tuner monster while face-up on the field. This card gains 300 ATK for each \"Blackwing\" monster in your Graveyard. When this card is destroyed and sent to the Graveyard: You can target 1 Winged Beast-Type Synchro Monster in your Graveyard, except \"Assault Blackwing - Chidori the Rain Sprinkling\"; Special Summon it.', 24, 35, 'https://images.ygoprodeck.com/images/cards/23338098.jpg', 756, 756, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(23587624, 'A Wild Monster Appears!', 'Spell Card', 'Spell Card', 'spell', 'If your opponent controls a monster and you control no monsters: Special Summon from your hand, 1 monster with an original Level of 10 or lower that cannot be Normal Summoned/Set, ignoring its Summoning conditions. It is unaffected by the effects of your cards, except for its own effects and this card\'s, also shuffle it into the Deck during your opponent\'s next End Phase. For the rest of this turn, you cannot Normal Summon/Set or Special Summon monsters, and your opponent takes no damage.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/23587624.jpg', 29, 29, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(23756165, 'Allure Queen LV5', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, during your Main Phase, if this card was Special Summoned by the effect of \"Allure Queen LV3\", you can select 1 Level 5 or lower monster on your opponent\'s side of the field and equip it to this card. (Only 1 card at a time can be equipped due to this effect.) If this card would be destroyed by battle, the equipped monster is destroyed instead. During your Standby Phase, by sending this card to the Graveyard while it\'s equipped due to its effect, Special Summon 1 \"Allure Queen LV7\" from your hand or Deck.', 11, 51, 'https://images.ygoprodeck.com/images/cards/23756165.jpg', 236, 236, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(23771716, '7 Colored Fish', 'Normal Monster', 'Normal Monster', 'normal', 'A rare rainbow fish that has never been caught by mortal man.', 8, NULL, 'https://images.ygoprodeck.com/images/cards/23771716.jpg', 14, 14, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(23784496, 'Abyss Script - Opening Ceremony', 'Spell Card', 'Spell Card', 'spell', 'Gain 500 LP for each \"Abyss Actor\" monster you control. If this Set card in its owner\'s control is destroyed by an opponent\'s card effect, and you have a face-up \"Abyss Actor\" Pendulum Monster in your Extra Deck: You can draw until you have 5 cards in your hand. You can only use each effect of \"Abyss Script - Opening Ceremony\" once per turn.', 4, 16, 'https://images.ygoprodeck.com/images/cards/23784496.jpg', 88, 88, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(23790299, 'Altergeist Memorygant', 'Link Monster', 'Link Monster', 'link', '2+ \"Altergeist\" monsters\r\nDuring the Battle Phase (Quick Effect): You can Tribute 1 other monster; this card gains ATK equal to that Tributed monster\'s ATK on the field. When this card destroys a monster by battle: You can destroy 1 monster your opponent controls, and if you do, this card can make a second attack in a row. If this card would be destroyed, you can banish 1 monster from your GY instead. You can only use each effect of \"Altergeist Memorygant\" once per turn.', 11, 57, 'https://images.ygoprodeck.com/images/cards/23790299.jpg', 286, 286, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(23812568, 'Additional Mirror Level 7', 'Spell Card', 'Spell Card', 'spell', 'If a Level 7 monster(s) is Special Summoned to your field: Send 2 \"Additional Mirror Level 7\" from your hand and/or Deck to the GY, then target 1 of those monsters; Special Summon 2 monsters with the same name as that target from your Deck, then take damage equal to their combined original ATK, also, for the rest of this turn after this card resolves, you can only Special Summon from the Extra Deck once.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/23812568.jpg', 142, 142, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(23846921, 'Arcana Force XXI - The World', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Summoned, toss a coin: ● Heads: During your End Phase, you can send 2 monsters you control to the Graveyard to skip your opponent\'s next turn. ● Tails: During your opponent\'s Draw Phase, add the top card of their Graveyard to their hand.', 18, 101, 'https://images.ygoprodeck.com/images/cards/23846921.jpg', 578, 578, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(23927567, 'An Owl of Luck', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: Select 1 Field Spell Card from your Deck and place it on top of your Deck. If \"Necrovalley\" is on the field, you can add the selected Field Spell Card to your hand instead.', 24, NULL, 'https://images.ygoprodeck.com/images/cards/23927567.jpg', 384, 384, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(23965033, 'Amazoness Augusta', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 \"Amazoness\" Fusion Monster + 1 \"Amazoness\" monster\r\nYour opponent cannot target other \"Amazoness\" cards you control with card effects, also those cards cannot be destroyed by your opponent\'s card effects. If this card was Fusion Summoned using \"Amazoness Empress\" or \"Amazoness Queen\" as material, it can make a second attack during each Battle Phase. If this card is Fusion Summoned: You can Special Summon 1 \"Amazoness\" monster from your Deck. You can only use this effect of \"Amazoness Augusta\" once per turn.', 14, 61, 'https://images.ygoprodeck.com/images/cards/23965033.jpg', 324, 324, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(23969415, 'Beta Evolution Pill - Ultranscendance', 'Spell Card', 'Spell Card', 'spell', 'Tribute 2 monsters from your hand and/or field, including a Dinosaur monster; Special Summon 1 Level 5 or higher Dinosaur monster from your Deck or Extra Deck, with an equal or higher ATK than the total ATK of those Tributed monsters, also for the rest of this turn after this card resolves, you cannot Special Summon monsters from the Extra Deck, except Dragon, Dinosaur, Sea Serpent, or Wyrm monsters. You can only activate 1 \"Beta Evolution Pill - Ultranscendance\" per turn.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/23969415.jpg', 1092, 1092, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(23995346, 'Blue-Eyes Ultimate Dragon', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Blue-Eyes White Dragon\" + \"Blue-Eyes White Dragon\" + \"Blue-Eyes White Dragon\"', 19, 164, 'https://images.ygoprodeck.com/images/cards/23995346.jpg', 1333, 1333, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(24087580, 'Amazoness Silver Sword Master', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \n\"Amazoness\" monsters you control gain ATK equal to their own Level x 100. When an attack is declared involving your \"Amazoness\" monster: You can target 1 \"Amazoness\" Spell/Trap in your GY; add it to your hand. You can only use this effect of \"Amazoness Silver Sword Master\" once per turn.\n\n[ Monster Effect ] \nIf this card in the Monster Zone is destroyed by battle or card effect: You can place this card in your Pendulum Zone. If an \"Amazoness\" monster(s) is Special Summoned to your field, while this card is in your GY (except during the Damage Step): You can place this card in your Pendulum Zone. You can only use each effect of \"Amazoness Silver Sword Master\" once per turn.', 14, 61, 'https://images.ygoprodeck.com/images/cards/24087580.jpg', 346, 346, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(24104865, 'Alien Mother', 'Effect Monster', 'Effect Monster', 'effect', 'If this card destroys a monster with an A-Counter by battle and sends it to the Graveyard, Special Summon the destroyed monster to your side of the field at the end of the Battle Phase. When this card is removed from the field, all monsters that were Special Summoned by this card\'s effect are destroyed.', 27, 1, 'https://images.ygoprodeck.com/images/cards/24104865.jpg', 218, 218, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(24140059, 'A Cat of Ill Omen', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: Choose 1 Trap from your Deck and place it on top of your Deck, or, if \"Necrovalley\" is on the field, you can add that Trap to your hand instead.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/24140059.jpg', 18, 18, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(24184846, 'Battlin\' Boxer Rib Gardna', 'Effect Monster', 'Effect Monster', 'effect', 'During either player\'s turn: You can banish this card from your hand or Graveyard, then target 1 \"Battlin\' Boxer\" monster you control; banish it until your next Standby Phase.', 14, 161, 'https://images.ygoprodeck.com/images/cards/24184846.jpg', 1002, 1002, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(24672164, 'Bloom Prima the Melodious Choir', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 \"Melodious Maestra\" monster + 1 or more \"Melodious\" monsters\nThis card gains 300 ATK for each Fusion Material used for its Fusion Summon. This card can make a second attack during each Battle Phase. If this Fusion Summoned card is sent to the Graveyard: You can target 1 \"Melodious\" monster in your Graveyard; add it to your hand.', 18, 4, 'https://images.ygoprodeck.com/images/cards/24672164.jpg', 1307, 1307, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(24689197, 'Aromalilith Rosalina', 'Tuner Monster', 'Tuner Monster', 'effect', '(Quick Effect): You can discard this card, then target 1 \"Aroma\" monster you control; gain LP equal to half its ATK. If this card is Normal or Special Summoned: You can Special Summon 1 non-Tuner \"Aroma\" monster from your Deck, also you cannot Special Summon for the rest of this turn, except Plant monsters. You can only use each effect of \"Aromalilith Rosalina\" once per turn.', 21, 121, 'https://images.ygoprodeck.com/images/cards/24689197.jpg', 709, 709, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(24907044, 'Abyss Actor - Leading Lady', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nOnce per turn, when you take battle damage from an opponent\'s attacking monster: You can activate 1 of these effects; ● That opponent\'s monster loses ATK equal to the damage you took (even if this card leaves the field). ● Add 1 face-up \"Abyss Actor\" Pendulum Monster from your Extra Deck to your hand with ATK less than or equal to the damage you took.\n\n[ Monster Effect ] \nOnce per turn, when battle damage is inflicted: You can target 1 face-up monster your opponent controls; it loses ATK equal to that battle damage. When this card is destroyed by battle, or if this card in its owner\'s Monster Zone is destroyed by an opponent\'s card effect: You can Set 1 \"Abyss Script\" Spell directly from your Deck.', 9, 16, 'https://images.ygoprodeck.com/images/cards/24907044.jpg', 67, 67, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(25221249, 'Battlewasp - Nest', 'Trap Card', 'Trap Card', 'trap', 'When your \"Battlewasp\" monster is targeted for an attack: Special Summon 1 \"Battlewasp\" monster from your hand or Deck, and if you do, place 1 counter on this card, then end the Battle Phase. You can only use this effect of \"Battlewasp - Nest\" once per turn. If this card has 2 or more counters during the End Phase, send it to the GY.', 1, 160, 'https://images.ygoprodeck.com/images/cards/25221249.jpg', 985, 985, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(25247218, 'Big Piece Golem', 'Effect Monster', 'Effect Monster', 'effect', 'If your opponent controls a monster and you control no monsters, you can Normal Summon this card without Tributes.', 17, NULL, 'https://images.ygoprodeck.com/images/cards/25247218.jpg', 1113, 1113, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(25345186, 'After the Struggle', 'Spell Card', 'Spell Card', 'spell', 'This card can only be activated during Main Phase 1. All monsters on both sides of the field that have been involved in damage calculation are destroyed during the End Step of the turn.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/25345186.jpg', 169, 169, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(25396150, 'Amazoness Hall', 'Trap Card', 'Trap Card', 'trap', 'When this card is activated: You can take 1 \"Amazoness\" monster from your GY or your face-up Extra Deck, and either add it to your hand or (if it is a Pendulum Monster) place it in your Pendulum Zone. If a monster(s) is Special Summoned to your opponent\'s field while you control an \"Amazoness\" Monster Card (except during the Damage Step): You can target 1 of those opponent\'s monsters; gain LP equal to its ATK. You can only use this effect of \"Amazoness Hall\" once per turn.', 1, 61, 'https://images.ygoprodeck.com/images/cards/25396150.jpg', 333, 333, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(25435080, 'Blackwing - Bombardment', 'Trap Card', 'Trap Card', 'trap', 'Tribute 1 \"Blackwing\" monster to select 1 face-up Synchro Monster you control. That Synchro Monster gains ATK equal to the Tributed monster\'s ATK, until the End Phase.', 4, 35, 'https://images.ygoprodeck.com/images/cards/25435080.jpg', 1199, 1199, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
