(28486799, 'Backup Squad', 'Spell Card', 'Spell Card', 'spell', 'Each time you take 1000 or more damage by your opponent\'s card effect or their monster\'s attack: Draw 1 card for every 1000 damage you took.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/28486799.jpg', 879, 879, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(28493337, 'Armageddon Designator', 'Trap Card', 'Trap Card', 'trap', 'Banish 1 card from your hand; neither player can activate cards, or the effects of cards, with that name for the rest of this Duel.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/28493337.jpg', 639, 639, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(28596933, 'A Wingbeat of Giant Dragon', 'Spell Card', 'Spell Card', 'spell', 'Return 1 Level 5 or higher Dragon-Type monster you control to the hand, and if you do, destroy all Spell and Trap Cards on the field.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/28596933.jpg', 30, 30, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(28645123, 'A.I. Challenge You', 'Trap Card', 'Trap Card', 'trap', 'Monsters your opponent controls lose 100 ATK for each card you control. If your \"@Ignister\" monster battles, your opponent cannot activate cards or effects until the end of the Damage Step. When your \"@Ignister\" monster is destroyed by battle: You can target 1 other Cyberse monster with 2300 ATK in your GY; Special Summon it. You can only use this effect of \"A.I. Challenge You\" once per turn.', 1, 10, 'https://images.ygoprodeck.com/images/cards/28645123.jpg', 35, 35, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(28776350, 'Akashic Magician', 'Link Monster', 'Link Monster', 'link', '2 monsters with the same Type, except Tokens\r\nYou can only Link Summon \"Akashic Magician(s)\" once per turn. If this card is Link Summoned: Return all monsters this card points to to the hand. Once per turn: You can declare 1 card name; excavate cards from the top of your Deck, equal to the total Link Rating of the Link Monsters co-linked to this card, then if you excavated any copies of the declared card, add them to your hand, also send the remaining cards to the GY.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/28776350.jpg', 188, 188, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(28865322, 'Aether, the Evil Empowering Dragon', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nOnce per turn: You can banish 1 \"Empowered Warrior\" monster from your Graveyard, then target 1 card on the field; destroy it.\n\n[ Monster Effect ] \nWhen this card is Normal or Special Summoned: You can target 1 monster on the field; banish it.', 19, 34, 'https://images.ygoprodeck.com/images/cards/28865322.jpg', 167, 167, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(28985331, 'Armageddon Knight', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Summoned: You can send 1 DARK monster from your Deck to the GY.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/28985331.jpg', 640, 640, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(29047353, 'Aquarium Stage', 'Spell Card', 'Spell Card', 'spell', 'WATER monsters you control cannot be destroyed by battle with a non-WATER monster. \"Aquaactress\" monsters you control are unaffected by your opponent\'s monster effects. If this card is sent from the field to the Graveyard: You can target 1 Aqua-Type monster in your Graveyard; Special Summon it, also you cannot Special Summon monsters for the rest of this turn, except Aqua-Type monsters.', 1, 97, 'https://images.ygoprodeck.com/images/cards/29047353.jpg', 557, 557, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(29071332, 'Armory Arm', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nOnce per turn, you can either: Target 1 monster on the field; equip this card to that target, OR: Unequip this card and Special Summon it in Attack Position. While equipped by this effect, that target gains 1000 ATK. If that target destroys a monster by battle and sends it to the Graveyard: Inflict damage to your opponent equal to the ATK of the destroyed monster in the Graveyard.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/29071332.jpg', 690, 690, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(29139104, 'Avalanching Aussa', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, you can Tribute 1 EARTH monster (except this card) to Special Summon 1 EARTH monster from your hand. The monster Special Summoned by this effect is destroyed if \"Avalanching Aussa\" is removed from your side of the field.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/29139104.jpg', 817, 817, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(29189613, 'Aroma Gardening', 'Spell Card', 'Spell Card', 'spell', 'If you Normal or Special Summon an \"Aroma\" monster(s) (except during the Damage Step): You can gain 1000 LP. When an opponent\'s monster declares an attack, while your LP are lower than your opponent\'s: You can Special Summon 1 \"Aroma\" monster from your Deck. You can only use each effect of \"Aroma Gardening\" once per turn.', 1, 121, 'https://images.ygoprodeck.com/images/cards/29189613.jpg', 698, 698, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(29223325, 'Artifact Ignition', 'Spell Card', 'Spell Card', 'spell', 'Target 1 Spell/Trap Card on the field; destroy that target, and if you do, Set 1 \"Artifact\" monster directly from your Deck to your Spell & Trap Zone as a Spell Card. If this card in its owner\'s possession is destroyed by an opponent\'s card: Your opponent skips their next Battle Phase. (You must have an \"Artifact\" monster in your Main Deck to activate this card.)', 2, 123, 'https://images.ygoprodeck.com/images/cards/29223325.jpg', 731, 731, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(29311166, 'Assault Wyvern', 'Effect Monster', 'Effect Monster', 'effect', 'When this card destroys an opponent\'s monster by battle: You can Tribute this card; Special Summon 1 Dragon-Type monster from your hand or Graveyard, except \"Assault Wyvern\".', 19, NULL, 'https://images.ygoprodeck.com/images/cards/29311166.jpg', 776, 776, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(29330706, 'Armed Protector Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'Face-up Equip Cards you control cannot be destroyed by card effects. This card gains 500 ATK for each Equip Card equipped to this card.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/29330706.jpg', 661, 661, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(29374928, 'Armored Bitron', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute this card: Special Summon 1 Cyberse monster from your Deck, except \"Armored Bitron\", but negate its effects, also you cannot Special Summon for the rest of this turn, except Cyberse monsters. If a Link-3 or higher Link Monster you control is destroyed by battle or an opponent\'s card effect, while this card is in your GY: You can Special Summon this card, but banish it when it leaves the field. You can only use each effect of \"Armored Bitron\" once per turn.', 22, NULL, 'https://images.ygoprodeck.com/images/cards/29374928.jpg', 678, 678, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(29508346, 'Arrivalrivals', 'Spell Card', 'Spell Card', 'spell', 'During the Battle Phase: Immediately after this effect resolves, Normal Summon 1 monster. You can only activate 1 \"Arrivalrivals\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/29508346.jpg', 717, 717, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(29603180, 'Annihilator Archfiend', 'Effect Monster', 'Effect Monster', 'effect', 'You can target 1 card you control and 1 card your opponent controls; destroy them, and if you destroyed a face-up Fiend monster(s) by this effect, this card gains ATK equal to half the Fiend monster(s)\'s original ATK, until the end of this turn. You can only use this effect of \"Annihilator Archfiend\" once per turn.', 9, 5, 'https://images.ygoprodeck.com/images/cards/29603180.jpg', 489, 489, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(29616941, 'Beautiful Beast Trainer', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A rare female beast-master with a very dangerous whip.\'\'', 14, NULL, 'https://images.ygoprodeck.com/images/cards/29616941.jpg', 1043, 1043, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(29654737, 'Amazoness Chain Master', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is destroyed by battle and sent to the GY: You can pay 1500 LP; look at your opponent\'s hand, then add 1 monster from their hand to your hand.', 14, 61, 'https://images.ygoprodeck.com/images/cards/29654737.jpg', 328, 328, '2025-03-10 13:12:55', '2025-03-10 13:12:55');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(29687169, 'Arnis, the Empowered Warrior', 'Effect Monster', 'Effect Monster', 'effect', 'When this card you control is destroyed by battle with an opponent\'s attacking monster and sent to your Graveyard: You can Special Summon 1 Spellcaster-Type monster with 1500 or less ATK from your Deck in Attack Position.', 14, 120, 'https://images.ygoprodeck.com/images/cards/29687169.jpg', 695, 695, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(29863101, 'Assault Teleport', 'Spell Card', 'Spell Card', 'spell', 'Return 1 \"/Assault Mode\" monster from your hand to the Deck. Draw 2 cards.', 4, 103, 'https://images.ygoprodeck.com/images/cards/29863101.jpg', 775, 775, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(29867611, 'Amaze Attraction Majestic Merry-Go-Round', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls; equip this card to it. You can apply the following effect, based on which player controls the equipped monster;\r\n● You: The equipped monster gains 500 ATK. If it would be destroyed by battle or card effect, you can send this card to the GY instead.\r\n● Your opponent: The equipped monster loses 500 ATK for each of your \"Attraction\" Traps equipped to a monster(s).', 4, 59, 'https://images.ygoprodeck.com/images/cards/29867611.jpg', 306, 306, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(29904964, 'Arisen Gaia the Fierce Knight', 'Effect Monster', 'Effect Monster', 'effect', 'If your opponent controls more monsters than you do, you can Normal Summon this card without Tributing. If this card is Tributed: You can Special Summon 1 \"Black Luster Soldier\" monster from your hand or Graveyard. You can only use this effect of \"Arisen Gaia the Fierce Knight\" once per turn. When you Ritual Summon a \"Black Luster Soldier\" monster, you can banish this card from your Graveyard as 1 of the monsters required for the Ritual Summon.', 14, 109, 'https://images.ygoprodeck.com/images/cards/29904964.jpg', 633, 633, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(30012506, 'A-Assault Core', 'Union Effect Monster', 'Union Effect Monster', 'effect', 'Once per turn, you can either: Target 1 LIGHT Machine monster you control; equip this card to that target, OR: Unequip this card and Special Summon it. A monster equipped with this card is unaffected by your opponent\'s monster effects (except its own), also if the equipped monster would be destroyed by battle or card effect, destroy this card instead. If this card is sent from the field to the GY: You can add 1 other Union monster from your GY to your hand.', 12, 8, 'https://images.ygoprodeck.com/images/cards/30012506.jpg', 31, 31, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(30118200, 'Appliancer Vacculephant', 'Link Monster', 'Link Monster', 'link', '1 \"Appliancer\" monster\r\nCannot be used as Link Material the turn it is Link Summoned. Can attack directly while it is not co-linked. You can send 1 card from your hand to the GY, then target 1 card your opponent controls; destroy it. If this card is co-linked: You can target 1 monster in your opponent\'s Main Monster Zone; destroy it. You can only use 1 \"Appliancer Vacculephant\" effect per turn, and only once that turn.', 12, 94, 'https://images.ygoprodeck.com/images/cards/30118200.jpg', 532, 532, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(30118811, 'Backup @Ignister', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control a Cyberse monster Special Summoned from the Extra Deck: You can Special Summon this card from your hand. If this card is Normal or Special Summoned: You can add 1 DARK Cyberse monster from your Deck to your hand, except \"Backup @Ignister\", then discard 1 card. You can only use each effect of \"Backup @Ignister\" once per turn.', 22, 11, 'https://images.ygoprodeck.com/images/cards/30118811.jpg', 875, 875, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(30435145, 'Ancient Gear Factory', 'Spell Card', 'Spell Card', 'spell', 'Reveal 1 Level 5 or higher \"Ancient Gear\" monster from your hand, then banish a number of \"Ancient Gear\" monsters from your Graveyard, whose combined Levels are double the revealed monster\'s, and if you do, if you Normal Summon the revealed monster this turn, you must Normal Smmon it without Tributing.', 4, 75, 'https://images.ygoprodeck.com/images/cards/30435145.jpg', 415, 415, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(30453613, 'Awakening of Veidos', 'Spell Card', 'Spell Card', 'spell', 'Place 1 \"Obsidim, the Ashened City\" from your Deck, face-up in either Field Zone, then if your opponent controls a card in their Field Zone, you can add 1 Level 5 or higher DARK Pyro monster from your Deck to your hand. For the rest of this turn after this card resolves, you cannot Special Summon from the Deck or Extra Deck, except Pyro monsters. You can only activate 1 \"Awakening of Veidos\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/30453613.jpg', 832, 832, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(30576089, 'Blue-Eyes Jet Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'Other cards you control cannot be destroyed by your opponent\'s card effects. You can only use each of the following effects of \"Blue-Eyes Jet Dragon\" once per turn, and can only activate them while \"Blue-Eyes White Dragon\" is on your field or in your GY. If a card(s) on the field is destroyed by battle or card effect: You can Special Summon this card from the GY (if it was there when the card was destroyed) or hand (even if not). At the start of the Damage Step, if this card battles: You can target 1 card your opponent controls; return it to the hand.', 19, 164, 'https://images.ygoprodeck.com/images/cards/30576089.jpg', 1326, 1326, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(30587695, 'Beetron', 'Effect Monster', 'Effect Monster', 'effect', 'You can send 1 face-up Spell/Trap you control to the GY, then target 1 Level 4 or lower Insect monster in your GY; Special Summon that Insect monster in Defense Position. You can only use this effect of \"Beetron\" once per turn.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/30587695.jpg', 1053, 1053, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(30603688, 'Apprentice Illusion Magician', 'Effect Monster', 'Effect Monster', 'effect', 'You can Special Summon this card (from your hand) by discarding 1 card. If this card is Normal or Special Summoned: You can add 1 \"Dark Magician\" from your Deck to your hand. During damage calculation, if your other DARK Spellcaster monster battles an opponent\'s monster (Quick Effect): You can send this card from your hand or face-up field to the GY; that monster you control gains 2000 ATK/DEF during that damage calculation only.', 11, 69, 'https://images.ygoprodeck.com/images/cards/30603688.jpg', 534, 534, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(30653113, 'Blessings of the Nile', 'Spell Card', 'Spell Card', 'spell', 'Each time card(s) are discarded from your hand to the Graveyard by the effect of a card controlled by your opponent, increase your Life Points by 1000 points.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/30653113.jpg', 1282, 1282, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(30757396, 'Blood Mefist', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nOnce per turn, during your opponent\'s Standby Phase: You can inflict 300 damage to your opponent for each card your opponent controls. Each time your opponent Sets a Spell or Trap Card(s): Inflict 300 damage to your opponent.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/30757396.jpg', 1303, 1303, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(30761649, 'Barian Untopia', 'Spell Card', 'Spell Card', 'spell', '(This card is always treated as a \"Barian\'s\" card.)\r\n\"Number\" monsters you control with a number between \"101\" and \"107\" in their name, as well as \"CXyz\" monsters and \"Number C\" monsters you control, cannot be destroyed by your opponent\'s card effects, and your opponent cannot target them with card effects. Once per turn, if you Special Summon an Xyz Monster with a \"Rank-Up-Magic\" Spell\'s effect: You can target that Xyz Monster and 1 monster your opponent controls; attach that opponent\'s monster to that Xyz Monster as material.', 10, 150, 'https://images.ygoprodeck.com/images/cards/30761649.jpg', 909, 909, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(30829071, 'Amazement Ambassador Bufo', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can target 1 \"Attraction\" Trap in your GY and 1 face-up monster your opponent controls; equip that Trap to your opponent\'s monster. (Quick Effect): You can target 1 of your \"Attraction\" Traps equipped to a monster; equip it to 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls. You can only use this effect of \"Amazement Ambassador Bufo\" once per turn.', 5, 60, 'https://images.ygoprodeck.com/images/cards/30829071.jpg', 313, 313, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(30834988, 'All-Out Attacks', 'Trap Card', 'Trap Card', 'trap', 'If a monster(s) is Special Summoned while this card is face-up on the field: Change that monster to face-up Attack Position, and must attack, if able, during the turn they are Special Summoned.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/30834988.jpg', 229, 229, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(30964246, 'Argostars - Giant Hunting', 'Spell Card', 'Spell Card', 'spell', 'Add 1 \"Argostars\" monster from your Deck to your hand, then, if you control a Continuous Trap in your Monster Zone, or a Continuous Trap in your Spell & Trap Zone with an effect that Special Summons itself as a monster, immediately after this effect resolves, you can Normal Summon 1 Warrior monster. During your Main Phase: You can banish this card from your GY, then target 2 cards on the field, including an \"Argostars\" Continuous Trap you control; return them to the hand. You can only use 1 \"Argostars - Giant Hunting\" effect per turn, and only once that turn.', 2, 105, 'https://images.ygoprodeck.com/images/cards/30964246.jpg', 621, 621, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(30983281, 'Accel Synchro Stardust Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf this card is Synchro Summoned: You can Special Summon 1 Level 2 or lower Tuner from your GY. During the Main Phase (Quick Effect): You can Tribute this card; Special Summon 1 \"Stardust Dragon\" from your Extra Deck (this is treated as a Synchro Summon), then, immediately after this effect resolves, Synchro Summon 1 Synchro Monster using monsters you control as material. This turn, the monsters Synchro Summoned by this effect are unaffected by your opponent\'s activated effects. You can only use each effect of \"Accel Synchro Stardust Dragon\" once per turn.', 19, 21, 'https://images.ygoprodeck.com/images/cards/30983281.jpg', 108, 108, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(30989084, 'Aromalilith Rosemary', 'Link Monster', 'Link Monster', 'link', '2+ Plant monsters\r\nIf this card is Special Summoned: You can add 1 \"Aroma\" card from your Deck to your hand. If you gain LP, even during the Damage Step: You can Special Summon up to 3 \"Aroma\" monsters from your hand to your zones this card points to. You can Tribute 1 monster this card points to, then target 1 card on the field; banish it, and if you do, gain 1000 LP. You can only use each effect of \"Aromalilith Rosemary\" once per turn.', 21, 121, 'https://images.ygoprodeck.com/images/cards/30989084.jpg', 710, 710, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(30996652, 'Appliancer Reuse', 'Spell Card', 'Spell Card', 'spell', 'Target 1 \"Appliancer\" monster in your GY; Special Summon it, but place it on the bottom of the Deck when it leaves the field.', 4, 94, 'https://images.ygoprodeck.com/images/cards/30996652.jpg', 529, 529, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(31053337, 'Blackwing - Abrolhos the Megaquake', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Special Summoned. This card cannot destroy monsters by battle. If this card battles a monster, after damage calculation: Return that monster to the hand. Once per turn, during your Main Phase 1: You can have this card lose exactly 1000 ATK, and if you do, return all cards in your opponent\'s Spell & Trap Zone to the hand.', 24, 35, 'https://images.ygoprodeck.com/images/cards/31053337.jpg', 1193, 1193, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(31102447, 'Amazoness Spy', 'Effect Monster', 'Effect Monster', 'effect', 'You can reveal 1 other \"Amazoness\" monster in your hand; Special Summon this card from your hand. You can only use this effect of \"Amazoness Spy\" once per turn. When this card is destroyed by battle and sent to the GY: You can target 1 \"Amazoness\" monster in your GY, except \"Amazoness Spy\"; return it to the hand, or shuffle it into the Deck.', 14, 61, 'https://images.ygoprodeck.com/images/cards/31102447.jpg', 349, 349, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(31175914, 'Attack Gainer', 'Tuner Monster', 'Tuner Monster', 'effect', 'If this card is sent to the Graveyard as a Synchro Material Monster, select 1 face-up monster your opponent controls. The selected opponent\'s monster loses 1000 ATK until the End Phase.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/31175914.jpg', 798, 798, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(31245780, 'Battle Mania', 'Trap Card', 'Trap Card', 'trap', 'Activate only during your opponent\'s Standby Phase. All face-up monsters your opponent controls are changed to Attack Position, and cannot change their battle positions this turn. All monsters your opponent currently controls must attack this turn, if able.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/31245780.jpg', 957, 957, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(31322640, 'Allure Palace', 'Spell Card', 'Spell Card', 'spell', 'Spellcaster monsters you control gain 500 ATK/DEF. You can send 1 card from your hand to the GY; take 1 \"Allure Queen\" monster from your Deck, and either add it to your hand or Special Summon it to your opponent\'s field. You can only use this effect of \"Allure Palace\" up to thrice per turn. \"Allure Queen\" Effect Monsters you control gain this effect.\r\n● You can send this card equipped with a card(s) by its own effect to the GY; Special Summon 1 Spellcaster monster with 1500 or less ATK from your hand or Deck.', 10, NULL, 'https://images.ygoprodeck.com/images/cards/31322640.jpg', 234, 234, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(31539614, 'Antidote Nurse', 'XYZ Monster', 'XYZ Monster', 'xyz', '2+ Level 3 monsters\r\n(Quick Effect): You can detach 1 material from this card, then target 1 monster on the field whose current ATK or DEF is different from its original value; its ATK/DEF become their original values, also if you targeted a monster on your field, it cannot be destroyed by battle or card effects this turn. Once per turn, if another monster(s) is Special Summoned to your field and this card has 3 or more materials (except during the Damage Step): You can make that monster(s) gain 900 ATK.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/31539614.jpg', 505, 505, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(31557782, 'Ancient Gear', 'Effect Monster', 'Effect Monster', 'effect', 'If you control an \"Ancient Gear\", you can Special Summon this card (from your hand) in face-up Attack Position.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/31557782.jpg', 400, 400, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
