(34755994, 'Artemis, the Magistus Moon Maiden', 'Link Monster', 'Link Monster', 'link', '1 Level 4 or lower Spellcaster monster\r\nIf another \"Magistus\" monster(s) is Normal or Special Summoned while you control this monster (except during the Damage Step): You can target 1 of those monsters; equip this card you control to it. While this card is equipped to a monster: You can add 1 \"Magistus\" monster from your Deck to your hand. You can only use each effect of \"Artemis, the Magistus Moon Maiden\" once per turn. You can only Special Summon \"Artemis, the Magistus Moon Maiden\" once per turn.', 11, 40, 'https://images.ygoprodeck.com/images/cards/34755994.jpg', 722, 722, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(34813443, 'Ashened to Endlessness', 'Trap Card', 'Trap Card', 'trap', 'During the Main Phase: You can Fusion Summon 1 Pyro Fusion Monster from your Extra Deck using monsters from either field as material, including \"Veidos the Eruption Dragon of Extinction\", and if you do, it gains 500 ATK for each material used. You can banish this card and 1 DARK Pyro monster from your GY; all monsters your opponent currently controls become Pyro until the end of this turn. You can only use each effect of \"Ashened to Endlessness\" once per turn.', 1, 124, 'https://images.ygoprodeck.com/images/cards/34813443.jpg', 748, 748, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(34838437, 'Accellight', 'Spell Card', 'Spell Card', 'spell', 'If you control no monsters: Special Summon 1 Level 4 or lower \"Photon\" or \"Galaxy\" monster from your Deck. You can only activate 1 \"Accellight\" per turn. You cannot Normal Summon/Set during the turn you activate this card.', 4, 23, 'https://images.ygoprodeck.com/images/cards/34838437.jpg', 110, 110, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(34974462, 'Bloom Harmonist the Melodious Composer', 'Link Monster', 'Link Monster', 'link', '2 Fairy monsters\r\nIf this card is Link Summoned: You can discard 1 card; Special Summon 2 \"Melodious\" monsters with different Levels from your Deck to your zones this card points to, in Defense Position. You cannot Special Summon monsters the turn you activate this effect, except \"Melodious\" monsters. You can only use this effect of \"Bloom Harmonist the Melodious Composer\" once per turn. If a \"Melodious\" monster this card points to attacks, your opponent cannot activate cards or effects until the end of the Damage Step.', 18, 4, 'https://images.ygoprodeck.com/images/cards/34974462.jpg', 1306, 1306, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(34976176, 'Blackwing - Chinook the Snow Blast', 'Effect Monster', 'Effect Monster', 'effect', 'You can send this card from your hand or field to the GY, then target 1 face-up monster your opponent controls; send 1 \"Blackwing\" Synchro Monster or 1 \"Black-Winged Dragon\" from your Extra Deck to the GY, and if you do, until the end of this turn, the targeted monster loses 700 ATK, also negate its effects. This is a Quick Effect if you control a DARK Synchro Monster. You can only use this effect of \"Blackwing - Chinook the Snow Blast\" once per turn.', 24, 35, 'https://images.ygoprodeck.com/images/cards/34976176.jpg', 1207, 1207, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(35057188, 'Battlewasp - Grand Partisan the Revolution', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nCannot be destroyed by card effects. Insect Synchro Monsters you control gain 200 ATK for each of your banished Insect monsters. If this card is banished: You can Special Summon it, then you can destroy cards your opponent controls up to the number of your banished Insect monsters, then inflict 500 damage to your opponent for each card destroyed. You can only use this effect of \"Battlewasp - Grand Partisan the Revolution\" once per turn.', 7, 160, 'https://images.ygoprodeck.com/images/cards/35057188.jpg', 982, 982, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(35146019, 'Altergeist Manifestation', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Altergeist\" monster in your GY; Special Summon it in Attack Position, and if you do, equip it with this card. When this card leaves the field, destroy that monster. You can banish this card from your GY, then target 1 \"Altergeist\" Trap in your GY; add it to your hand. You can only use this effect of \"Altergeist Manifestation\" once per turn.', 4, 57, 'https://images.ygoprodeck.com/images/cards/35146019.jpg', 283, 283, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(35149085, 'Beast Soul Swap', 'Trap Card', 'Trap Card', 'trap', 'Target 1 Beast-Type monster you control; return it to the hand, and if you do, Special Summon 1 Beast-Type monster from your hand with the same Level as the monster that was returned to the hand.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/35149085.jpg', 1031, 1031, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(35215622, 'Blindly Loyal Goblin', 'Effect Monster', 'Effect Monster', 'effect', 'As long as this card remains face-up on the field, control of this card cannot switch.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/35215622.jpg', 1286, 1286, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(35282433, 'Blue-Eyed Silver Zombie', 'Normal Monster', 'Normal Monster', 'normal', 'The beams from the eyes of this creature are said to turn enemies into zombies.', 28, NULL, 'https://images.ygoprodeck.com/images/cards/35282433.jpg', 1320, 1320, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(35498188, 'Action Magic - Double Banking', 'Spell Card', 'Spell Card', 'spell', 'Discard 1 card; this turn, if a monster you currently control destroys an opponent\'s monster by battle, it can make a second attack in a row. During your Main Phase, if this card is in your GY, except the turn this card was sent to the GY: You can discard 1 Spell; Set this card.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/35498188.jpg', 125, 125, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(35537251, 'Battlin\' Boxer Shadow', 'Effect Monster', 'Effect Monster', 'effect', 'During your Main Phase: You can detach 1 Xyz Material from a \"Battlin\' Boxer\" Xyz Monster you control, and if you do, Special Summon this card from your hand. You can only use this effect of \"Battlin\' Boxer Shadow\" once per turn.', 14, 161, 'https://images.ygoprodeck.com/images/cards/35537251.jpg', 1003, 1003, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(35539880, 'Birthright', 'Trap Card', 'Trap Card', 'trap', 'Activate this card by targeting 1 Normal Monster in your Graveyard; Special Summon that target in face-up Attack Position. When this card leaves the field, destroy that monster. When that monster leaves the field, destroy this card.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/35539880.jpg', 1133, 1133, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(35778533, 'Beware the White Forest', 'Spell Card', 'Spell Card', 'spell', 'If you control a Level 6 or higher Illusion or Spellcaster monster: Target 1 card your opponent controls; destroy it. If this card is sent to the GY to activate a monster effect: You can Set this card. You can only use each effect of \"Beware the White Forest\" once per turn.', 4, 127, 'https://images.ygoprodeck.com/images/cards/35778533.jpg', 1097, 1097, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(35781051, 'Arcana Force III - The Empress', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Summoned, toss a coin: ● Heads: Each time your opponent Normal Summons or Sets a monster, you can Special Summon 1 \"Arcana Force\" monster from your hand. ● Tails: Each time your opponent Normal Summons or Sets a monster, send 1 card from your hand to the Graveyard.', 18, 101, 'https://images.ygoprodeck.com/images/cards/35781051.jpg', 569, 569, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(35877582, 'Aiwass, the Magistus Spell Spirit', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 \"Magistus\" monster + 1 Spellcaster monster\r\nWhile this card is an Equip Card, the equipped monster gains 1000 ATK/DEF. During the Main Phase (Quick Effect): You can target 1 other face-up monster on the field; equip this card you control to it. If this card was equipped to an opponent\'s monster by this effect, take control of the equipped monster, also it cannot activate its effects. You can only use this effect of \"Aiwass, the Magistus Spell Spirit\" once per turn.', 9, 40, 'https://images.ygoprodeck.com/images/cards/35877582.jpg', 185, 185, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(35956022, 'Acidic Downpour', 'Spell Card', 'Spell Card', 'spell', 'All EARTH monsters lose 500 ATK and gain 400 DEF.', 10, NULL, 'https://images.ygoprodeck.com/images/cards/35956022.jpg', 121, 121, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(36042004, 'Babycerasaurus', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is destroyed by a card effect and sent to the Graveyard: Special Summon 1 Level 4 or lower Dinosaur-Type monster from your Deck.', 16, NULL, 'https://images.ygoprodeck.com/images/cards/36042004.jpg', 865, 865, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(36092504, 'Bayonet Punisher', 'Spell Card', 'Spell Card', 'spell', 'Apply these effects, in sequence, depending on the type(s) of \"Borrel\" monsters you control and in your GY. If you control a monster with 3000 or more ATK, your opponent cannot activate cards or effects in response to this card\'s activation.\r\n● Fusion: Banish 1 monster your opponent controls.\r\n● Synchro: Banish 3 random face-down cards from your opponent\'s Extra Deck, face-up.\r\n● Xyz: Banish 1 Spell/Trap your opponent controls.\r\n● Link: Banish up to 3 cards from your opponent\'s GY.\r\nYou can only activate 1 \"Bayonet Punisher\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/36092504.jpg', 1013, 1013, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(36100154, 'Amazoness Fighting Spirit', 'Spell Card', 'Spell Card', 'spell', 'If an \"Amazoness\" monster attacks a monster with higher ATK, the attacking monster gains 1000 ATK during damage calculation only.', 1, 61, 'https://images.ygoprodeck.com/images/cards/36100154.jpg', 331, 331, '2025-03-10 13:12:55', '2025-03-10 13:12:55');
