(36320744, 'Angelica, Princess of Noble Arms', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf this card is Special Summoned: You can add 1 \"Horn of Olifant\", or 1 card that mentions \"Infernoble Knight Emperor Charles\", from your Deck to your hand. When a card or effect is activated that targets this card on the field, or when this card is targeted for an attack (Quick Effect): You can send 1 FIRE Warrior monster from your Deck to the GY, and if you do, banish this card (until the End Phase), then you can Special Summon 1 \"Roland\" monster from your Deck or Extra Deck. You can only use each effect of \"Angelica, Princess of Noble Arms\" once per turn.', 14, 82, 'https://images.ygoprodeck.com/images/cards/36320744.jpg', 482, 482, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
