(36591747, 'Amaze Attraction Thrill Train', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls; equip this card to it. You can activate the following effect, based on which player controls the equipped monster;\r\n● You: Change the equipped monster\'s battle position, then, your opponent chooses 1 \"Attraction\" Trap in your GY, and you Set it to your field.\r\n● Your opponent: Banish the equipped monster until the End Phase.\r\nYou can only use this effect of \"Amaze Attraction Thrill Train\" once per turn.', 4, 59, 'https://images.ygoprodeck.com/images/cards/36591747.jpg', 308, 308, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(36629203, 'Ally of Justice Core Destroyer', 'Effect Monster', 'Effect Monster', 'effect', 'At the start of the Damage Step, if this card battles a LIGHT monster: Destroy that monster.', 12, 53, 'https://images.ygoprodeck.com/images/cards/36629203.jpg', 243, 243, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(36694815, 'Bitrooper', 'Effect Monster', 'Effect Monster', 'effect', 'You can send 1 Level 2 or lower monster from your hand to the GY; Special Summon this card from your hand. You can only use this effect of \"Bitrooper\" once per turn.', 22, NULL, 'https://images.ygoprodeck.com/images/cards/36694815.jpg', 1138, 1138, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(36768783, 'Armillyre, the Starleader Dragon', 'Link Monster', 'Link Monster', 'link', '2 Effect Monsters\r\nCannot be used as Link Material. You can target 1 face-up monster this card points to; Special Summon 1 monster with the same original Level from your hand to your zone this card points to, in Defense Position, but negate its effects. You can only use this effect of \"Armillyre, the Starleader Dragon\" once per turn.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/36768783.jpg', 665, 665, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(36821538, 'Ancient Sorcerer', 'Normal Monster', 'Normal Monster', 'normal', '\'\'Armed with an array of magic wands, this creature is capable of multiple attacks.\'\'', 11, 76, 'https://images.ygoprodeck.com/images/cards/36821538.jpg', 448, 448, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
