(36904469, 'Akihiron', 'Normal Monster', 'Normal Monster', 'normal', '\'\'This strange creature hides in the deep, dark corners of the seven seas.\'\'', 6, NULL, 'https://images.ygoprodeck.com/images/cards/36904469.jpg', 189, 189, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(36916401, 'Battlin\' Boxing Spirits', 'Spell Card', 'Spell Card', 'spell', 'Send the top card of your Deck to the Graveyard, then target 1 \"Battlin\' Boxer\" monster in your Graveyard; Special Summon that target in face-up Defense Position. You can only activate 1 \"Battlin\' Boxing Spirits\" per turn.', 4, 161, 'https://images.ygoprodeck.com/images/cards/36916401.jpg', 1009, 1009, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(37053871, 'Astral Barrier', 'Trap Card', 'Trap Card', 'trap', 'If your opponent\'s monster attacks a monster you control: You can make the attack a direct attack instead.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/37053871.jpg', 780, 780, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(37104630, 'Atlantean Heavy Infantry', 'Effect Monster', 'Effect Monster', 'effect', 'During your Main Phase, you can Normal Summon 1 Level 4 or lower Sea Serpent-Type monster in addition to your Normal Summon/Set. (You can only gain this effect once per turn.) When this card is sent to the Graveyard to activate a WATER monster\'s effect: Target 1 face-up card your opponent controls; destroy that target.', 20, 131, 'https://images.ygoprodeck.com/images/cards/37104630.jpg', 791, 791, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(37457534, 'Ancient Gear Tank', 'Spell Card', 'Spell Card', 'spell', 'Equip only to an \"Ancient Gear\" monster. It gains 600 ATK. When this card is destroyed and sent to the Graveyard: Inflict 600 damage to your opponent.', 3, 75, 'https://images.ygoprodeck.com/images/cards/37457534.jpg', 434, 434, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(37478723, '\"Infernoble Arms - Durendal\"', 'Spell Card', 'Spell Card', 'spell', 'While this card is equipped to a monster: You can add 1 Level 5 or lower FIRE Warrior monster from your Deck to your hand, then destroy this card. If this card is sent to the GY because the equipped monster is sent to the GY: You can target 1 Level 5 or lower FIRE Warrior monster in your GY; Special Summon it, also you cannot Special Summon monsters for the rest of the turn, except Warrior monsters. You can only use 1 \"\"Infernoble Arms - Durendal\"\" effect per turn, and only once that turn.', 3, 3, 'https://images.ygoprodeck.com/images/cards/37478723.jpg', 6, 6, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(37663536, 'Ancient Gear Megaton Golem', 'Fusion Monster', 'Fusion Monster', 'fusion', '3 \"Ancient Gear\" monsters\r\nIf this card attacks, your opponent cannot activate Spell/Trap Cards until the end of the Damage Step. If this card was Fusion Summoned using 2 or more \"Ancient Gear Golem\" and/or \"Ancient Gear Golem - Ultimate Pound\" as material, it can attack up to that many times during each Battle Phase. If this face-up Fusion Summoned card in its owner\'s control leaves the field because of an opponent\'s card effect: You can Special Summon 1 \"Ultimate Ancient Gear Golem\" from your Extra Deck, ignoring its Summoning conditions.', 12, 75, 'https://images.ygoprodeck.com/images/cards/37663536.jpg', 429, 429, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(37675907, 'Accel Synchron', 'Synchro Tuner Monster', 'Synchro Tuner Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nOnce per turn: You can send 1 \"Synchron\" monster from your Deck to the GY, then activate 1 of these effects;\r\n● Increase this card\'s Level by the Level of the sent monster.\r\n● Reduce this card\'s Level by the Level of the sent monster.\r\nDuring your opponent\'s Main Phase, you can (Quick Effect): Immediately after this effect resolves, Synchro Summon using this card you control. You can only Synchro Summon \"Accel Synchron\" once per turn.', 12, 22, 'https://images.ygoprodeck.com/images/cards/37675907.jpg', 109, 109, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(37683547, 'Albaz the Ashen', 'Effect Monster', 'Effect Monster', 'effect', 'This card\'s name becomes \"Fallen of Albaz\" while on the field or in the GY. While a Level 8 Fusion Monster is in your GY, this card gains 200 ATK for each monster in your GY, also your opponent cannot target other monsters you control with card effects. If a monster(s) you control leaves the field by an opponent\'s card effect, while this card and a Fusion Monster are in your GY (except during the Damage Step): You can Special Summon this card. You can only use this effect of \"Albaz the Ashen\" once per turn.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/37683547.jpg', 193, 193, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(37803970, 'Amazing Pendulum', 'Spell Card', 'Spell Card', 'spell', 'If you have no cards in your Pendulum Zones: Add 2 face-up \"Magician\" Pendulum Monsters with different names from your Extra Deck to your hand. You can only activate 1 \"Amazing Pendulum\" per turn.', 4, 26, 'https://images.ygoprodeck.com/images/cards/37803970.jpg', 319, 319, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(37910722, 'Ascension Sky Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf this card is Synchro Summoned: It gains 800 ATK for each card currently in your hand. When this card you control is destroyed by your opponent\'s card and sent to your GY, if all of the monsters that were used for the Synchro Summon of this card are in your GY: You can Special Summon all of them, but their effects are negated. You can only use this effect of \"Ascension Sky Dragon\" once per turn.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/37910722.jpg', 744, 744, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(37970940, 'Aussa the Earth Charmer', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: While this card is face-up on the field, take control of 1 EARTH monster your opponent controls.', 11, 136, 'https://images.ygoprodeck.com/images/cards/37970940.jpg', 812, 812, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(38035986, 'Akakieisu', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A sorcerer who utters spells that render monsters unconscious.\'\'', 11, NULL, 'https://images.ygoprodeck.com/images/cards/38035986.jpg', 187, 187, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(38148100, 'Aromaseraphy Rosemary', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nWhile your LP is higher than your opponent\'s, all Plant-Type monsters you control gain 500 ATK and DEF. Once per turn, if you gain LP: Target 1 face-up card your opponent controls; that face-up card has its effects negated until the end of this turn.', 21, 121, 'https://images.ygoprodeck.com/images/cards/38148100.jpg', 713, 713, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(38173725, 'Arcjet Lightcraft', 'Effect Monster', 'Effect Monster', 'effect', 'If you control no monsters, you can Normal Summon this card without Tributing. If this card is Normal or Special Summoned: You can target 1 Level 8 or lower Machine monster in your GY; Special Summon it in Defense Position, and if you do, its Level becomes 9, also negate its effects. You can only use this effect of \"Arcjet Lightcraft\" once per turn. You cannot Special Summon monsters from the Extra Deck, except Machine Xyz Monsters.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/38173725.jpg', 619, 619, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(38379052, 'Argostars - Slayer Eteo', 'Trap Card', 'Trap Card', 'trap', 'While this card is face-up in the Spell & Trap Zone, Warrior monsters you control cannot be destroyed by card effects. Once per turn, when your opponent activates a card or effect: You can Special Summon this card as an Effect Monster (Warrior/LIGHT/Level 4/ATK 800/DEF 800) with the following effect (this card is also still a Trap), then if you have a banished \"Argostars\" monster, you can return 1 card on the field to the hand.\r\n● Once per turn (Quick Effect): You can place this card face-up in your Spell & Trap Zone.', 1, 105, 'https://images.ygoprodeck.com/images/cards/38379052.jpg', 625, 625, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
