(42023223, 'Alpha The Electromagnet Warrior', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned: You can add 1 Level 8 \"Magna Warrior\" monster from your Deck to your hand. You can only use this effect of \"Alpha The Electromagnet Warrior\" once per turn. During your opponent\'s turn: You can Tribute this card; Special Summon 1 Level 4 \"Magnet Warrior\" monster from your Deck (this is a Quick Effect).', 17, 55, 'https://images.ygoprodeck.com/images/cards/42023223.jpg', 266, 266, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(42129512, 'Big Koala', 'Normal Monster', 'Normal Monster', 'normal', 'A species of huge Des Koala. He\'s meek, but people are afraid of him because he\'s very powerful.', 5, 177, 'https://images.ygoprodeck.com/images/cards/42129512.jpg', 1111, 1111, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(42201897, 'Azamina Determination', 'Trap Card', 'Trap Card', 'trap', 'Reveal 1 \"Azamina\" Fusion Monster in your Extra Deck, and for every 4 Levels it has (round down), shuffle 1 \"Sinful Spoils\" card from your GY and/or banishment into the Deck, then Special Summon the revealed monster. (This is treated as a Fusion Summon.) You can banish this card from your GY, then target 1 \"Sinful Spoils\" Spell/Trap in your GY; Set it, but it cannot be activated this turn. You can only use 1 \"Azamina Determination\" effect per turn, and only once that turn.', 4, 144, 'https://images.ygoprodeck.com/images/cards/42201897.jpg', 841, 841, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(42216237, 'Angel of Zera', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nThis card gains 100 ATK for each of your opponent\'s banished cards. During the Standby Phase of the next turn after this card was banished: Special Summon this banished card. You can only use the effect of \"Angel of Zera\" once per turn.', 18, 79, 'https://images.ygoprodeck.com/images/cards/42216237.jpg', 478, 478, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(42228966, 'Battlefield Tragedy', 'Spell Card', 'Spell Card', 'spell', 'During your Main Phase 2, if no monsters battled each other this turn: You can discard 1 card; Set 1 \"Battlefield Tragedy\" directly from your Deck to your Spell & Trap Zone. You can only use this effect of \"Battlefield Tragedy\" once per turn. Once per turn, during the End Phase, if any monsters battled each other this turn: The turn player sends 5 cards from the top of their Deck to the GY.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/42228966.jpg', 971, 971, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(42233477, 'Battleguard Rage', 'Trap Card', 'Trap Card', 'trap', 'Activate this card by targeting 1 Warrior-Type monster you control; it gains 1000 ATK. Monsters destroyed by battle with it are returned to the hand instead of going to the Graveyard. When that monster leaves the field, destroy this card.', 1, 159, 'https://images.ygoprodeck.com/images/cards/42233477.jpg', 976, 976, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(42364257, 'Anti Raigeki', 'Trap Card', 'Trap Card', 'trap', 'When your opponent activates \"Raigeki\": Negate its effect, and if you do, destroy all monsters your opponent controls.', 4, 87, 'https://images.ygoprodeck.com/images/cards/42364257.jpg', 497, 497, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(42364374, 'Arsenal Bug', 'Effect Monster', 'Effect Monster', 'effect', 'If you control no other Insect-Type monsters, this card\'s ATK and DEF become 1000.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/42364374.jpg', 719, 719, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(42431843, 'Ancient Brain', 'Normal Monster', 'Normal Monster', 'normal', 'A fallen fairy that is powerful in the dark.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/42431843.jpg', 389, 389, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(42502956, 'Ayers Rock Sunrise', 'Spell Card', 'Spell Card', 'spell', 'Target 1 Beast-Type monster in your Graveyard; Special Summon that target, and if you do, all face-up monsters your opponent currently controls lose 200 ATK for each Beast, Plant, and Winged Beast-Type monster currently in your Graveyard, until the end of this turn. You can only activate 1 \"Ayers Rock Sunrise\" per turn.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/42502956.jpg', 838, 838, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(42790071, 'Altergeist Multifaker', 'Effect Monster', 'Effect Monster', 'effect', 'If you activate a Trap Card (except during the Damage Step): You can Special Summon this card from your hand. If this card is Special Summoned: You can Special Summon 1 \"Altergeist\" monster from your Deck in Defense Position, except \"Altergeist Multifaker\". You cannot Special Summon monsters the turn you activate this effect, except \"Altergeist\" monsters. You can only use each effect of \"Altergeist Multifaker\" once per turn.', 11, 57, 'https://images.ygoprodeck.com/images/cards/42790071.jpg', 287, 287, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(42878636, 'Ancient Gear Hunting Hound', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal Summoned: Inflict 600 damage to your opponent. If this card attacks, your opponent cannot activate any Spell/Trap Cards until the end of the Damage Step. Once per turn: You can Fusion Summon 1 \"Ancient Gear\" Fusion Monster from your Extra Deck, using monsters from your hand or field as Fusion Materials.', 12, 75, 'https://images.ygoprodeck.com/images/cards/42878636.jpg', 426, 426, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(42901635, 'Berserkion the Electromagna Warrior', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand) by banishing 1 \"Alpha The Electromagnet Warrior\", \"Beta The Electromagnet Warrior\", and \"Gamma The Electromagnet Warrior\" from your hand, Graveyard, and/or face-up from your Monster Zone. You can banish 1 Level 4 or lower \"Magnet Warrior\" monster from your Graveyard, then target 1 card your opponent controls; destroy it. If this card is destroyed by battle, or if this card in its owner\'s possession is destroyed by an opponent\'s card effect: You can target 1 each of your banished \"Alpha The Electromagnet Warrior\", \"Beta The Electromagnet Warrior\", and \"Gamma The Electromagnet Warrior\"; Special Summon them.', 17, 55, 'https://images.ygoprodeck.com/images/cards/42901635.jpg', 1091, 1091, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(42969214, 'Aye-Iron', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn: You can have this card gain 400 ATK. This card cannot attack the turn you activate this effect.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/42969214.jpg', 837, 837, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(43096270, 'Alexandrite Dragon', 'Normal Monster', 'Normal Monster', 'normal', 'Many of the czars\' lost jewels can be found in the scales of this priceless dragon. Its creator remains a mystery, along with how they acquired the imperial treasures. But whosoever finds this dragon has hit the jackpot... whether they know it or not.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/43096270.jpg', 205, 205, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(43143567, 'Angelcaido of the Golden Land', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Eldlich the Golden Lord\" + 1 Zombie monster\r\nMust be either Fusion Summoned, or Special Summoned (from your Extra Deck) by Tributing 1 LIGHT Zombie monster while you have \"Eldlich the Golden Lord\" on your field or in your GY. You can only Special Summon \"Angelcaido of the Golden Land\" once per turn either of these ways. If this card is sent from the field to the GY: You can Special Summon 1 \"Eldlich\" monster from your Deck, Extra Deck, or GY. You can only use this effect of \"Angelcaido of the Golden Land\" once per turn.', 28, 81, 'https://images.ygoprodeck.com/images/cards/43143567.jpg', 481, 481, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(43225434, 'Battle Fusion', 'Spell Card', 'Spell Card', 'spell', 'When an attack is declared involving a Fusion Monster you control and an opponent\'s monster: That monster you control gains ATK equal to the ATK of the opponent\'s monster, until the end of the Damage Step. You can only activate 1 \"Battle Fusion\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/43225434.jpg', 955, 955, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(43228023, 'Blue-Eyes Alternative Ultimate Dragon', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Blue-Eyes White Dragon\" + \"Blue-Eyes White Dragon\" + \"Blue-Eyes White Dragon\"\r\nYour opponent cannot target or destroy this card with card effects. Once per turn: You can target 1 card your opponent controls; destroy it. If this card was Fusion Summoned using a monster whose original name is \"Blue-Eyes Alternative White Dragon\" as material, you can target up to 3 cards your opponent controls instead. This card cannot attack the turn this effect is activated.', 19, 164, 'https://images.ygoprodeck.com/images/cards/43228023.jpg', 1322, 1322, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(43230671, 'Ancient Lizard Warrior', 'Normal Monster', 'Normal Monster', 'normal', 'Before the dawn of man, this lizard warrior ruled supreme.', 27, NULL, 'https://images.ygoprodeck.com/images/cards/43230671.jpg', 442, 442, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(43262273, 'Appointer of the Red Lotus', 'Trap Card', 'Trap Card', 'trap', 'Pay 2000 Life Points and reveal all cards in your hand. Look at your opponent\'s hand and select 1 card. Remove that card from play until your opponent\'s next End Phase.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/43262273.jpg', 533, 533, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(43321985, 'Ancient Fairy Life Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf this card is Synchro Summoned: You can draw 1 card, or, if \"The World of Spirits\" is on the field, add 1 LIGHT Beast, Plant, or Fairy monster or 1 \"Eternal Sunshine\" from your Deck to your hand instead. You can only use this effect of \"Ancient Fairy Life Dragon\" once per turn. Your \"Ancient Fairy Dragon\" and monsters that mention it can attack while in face-up Defense Position. If they do, apply their DEF for damage calculation.', 19, 72, 'https://images.ygoprodeck.com/images/cards/43321985.jpg', 396, 396, '2025-03-10 13:12:56', '2025-03-10 13:12:56');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(43341600, 'Apple of Enlightenment', 'Trap Card', 'Trap Card', 'trap', 'Target cards in your opponent\'s GY, up to the number of \"Valkyrie\" monsters you control; banish them. If this Set card in its owner\'s control has left the field because of an opponent\'s effect, and is now in the GY or banished: You can draw cards equal to the number of \"Valkyrie\" monsters you control +1.', 4, 93, 'https://images.ygoprodeck.com/images/cards/43341600.jpg', 519, 519, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(43378048, 'Armityle the Chaos Phantasm', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Uria, Lord of Searing Flames\" + \"Hamon, Lord of Striking Thunder\" + \"Raviel, Lord of Phantasms\"\r\nMust first be Special Summoned (from your Extra Deck) by banishing the above cards you control. (You do not use \"Polymerization\".) Cannot be destroyed by battle. Gains 10,000 ATK during your turn only.', 9, 113, 'https://images.ygoprodeck.com/images/cards/43378048.jpg', 666, 666, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(43575579, 'Afterglow', 'Spell Card', 'Spell Card', 'spell', 'Banish this card, and as many \"Afterglow\" from your hand, Deck, GY, and face-up field as possible, then shuffle 1 of your banished \"Afterglow\" into the Deck. During your next Draw Phase, reveal the card you draw for your normal draw, and inflict 4000 damage to your opponent if it is \"Afterglow\". You can only activate 1 \"Afterglow\" per Duel.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/43575579.jpg', 170, 170, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(43583400, 'Antialian', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, if this card battled a monster this Battle Phase, you can (Quick Effect): Immediately after this effect resolves, Normal Summon 1 Cyberse monster. If this face-up card you control leaves the field because of an opponent\'s card effect: Draw 1 card.', 22, 87, 'https://images.ygoprodeck.com/images/cards/43583400.jpg', 504, 504, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(43694481, 'Blizzard Falcon', 'Effect Monster', 'Effect Monster', 'effect', 'If this card\'s current ATK is higher than its original ATK: You can inflict 1500 damage to your opponent. This effect can only be used once while this card is face-up on the field. You can only use the effect of \"Blizzard Falcon\" once per turn.', 24, NULL, 'https://images.ygoprodeck.com/images/cards/43694481.jpg', 1290, 1290, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(43739056, 'Amanokujaki', 'Tuner Monster', 'Tuner Monster', 'effect', 'You cannot activate the effects of other Special Summoned monsters with the same Attribute as this card. Once per turn, during the Main Phase of this card\'s owner (Quick Effect): You can give control of this card to your opponent, then you (the activating player) can make this card become any Attribute until the end of the next turn.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/43739056.jpg', 300, 300, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(43906884, 'Blackwing - Boobytrap', 'Trap Card', 'Trap Card', 'trap', 'When this Set card is destroyed by your opponent\'s card effect while you control a face-up \"Blackwing\" monster, inflict 1000 damage to your opponent and draw 1 card.', 4, 35, 'https://images.ygoprodeck.com/images/cards/43906884.jpg', 1200, 1200, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(44028461, 'Blackback', 'Trap Card', 'Trap Card', 'trap', 'During your turn: Target 1 \"Blackwing\" monster with 2000 or less ATK in your Graveyard; Special Summon that target. You cannot Normal Summon/Set during the turn you activate this card.', 4, 35, 'https://images.ygoprodeck.com/images/cards/44028461.jpg', 1186, 1186, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(44052074, 'Ancient Gear Catapult', 'Spell Card', 'Spell Card', 'spell', 'While you control no monsters: Target 1 face-up card you control; destroy it, and if you do, Special Summon 1 \"Ancient Gear\" monster from your Deck, ignoring its Summoning conditions. You can banish this card from your Graveyard, then target 1 face-up card you control; destroy it, and if you do, Special Summon 1 \"Ancient Gear Token\" (Machine-Type/EARTH/Level 1/ATK 0/DEF 0). You can only use 1 \"Ancient Gear Catapult\" effect per turn, and only once that turn.', 4, 75, 'https://images.ygoprodeck.com/images/cards/44052074.jpg', 407, 407, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(44052075, 'Ancient Gear Token', 'Token', 'Token', 'token', 'This card can be used as an \"Ancient Gear Token\".\r\n\r\n\r\n*If used for another Token, apply that Token\'s Type/Attribute/Level/ATK/DEF.', 12, 75, 'https://images.ygoprodeck.com/images/cards/44052075.jpg', 436, 436, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(44179224, 'Abyss Actor - Curtain Raiser', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nIf you control no monsters: You can Special Summon this card from your Pendulum Zone. You can only use this effect of \"Abyss Actor - Curtain Raiser\" once per Duel.\n\n[ Monster Effect ] \nGains 1100 ATK if you control no other monsters. Once per turn: You can send 1 \"Abyss Script\" Spell from your Deck to the GY; add 1 face-up \"Abyss Actor\" Pendulum Monster from your Extra Deck to your hand.', 9, 16, 'https://images.ygoprodeck.com/images/cards/44179224.jpg', 62, 62, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(44223284, 'Abyssal Kingshark', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, if this card would be destroyed by an effect that does not target it, it is not destroyed.', 8, NULL, 'https://images.ygoprodeck.com/images/cards/44223284.jpg', 105, 105, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(44256816, '1st Movement Solo', 'Spell Card', 'Spell Card', 'spell', 'If you control no monsters: Special Summon 1 Level 4 or lower \"Melodious\" monster from your hand or Deck. You can only activate 1 \"1st Movement Solo\" per turn. You cannot Special Summon monsters during the turn you activate this card, except \"Melodious\" monsters.', 4, 4, 'https://images.ygoprodeck.com/images/cards/44256816.jpg', 9, 9, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(44553392, 'A Shattered, Colorless Realm', 'Trap Card', 'Trap Card', 'trap', 'If \"Vicious Astraloud\" is on the field: Target 1 card on the field; destroy it, then, if the destroyed card\'s original name was \"Vicious Astraloud\", you can Special Summon 1 of your banished \"Visas Starfrost\", or if it was not, you can make 1 \"Vicious Astraloud\" you control gain 1500 ATK.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/44553392.jpg', 28, 28, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(44586426, 'Batteryman Solar', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned: You can send 1 Thunder monster from your Deck to the GY. If a Thunder monster(s) is Normal or Special Summoned while this monster is on the field: Special Summon 1 \"Batteryman Token\" (Thunder/LIGHT/Level 1/ATK 0/DEF 0). You can target 1 \"Batteryman\" Effect Monster you control or in your GY; this card\'s name becomes that monster\'s until the End Phase. You can only use each effect of \"Batteryman Solar\" once per turn.', 32, 158, 'https://images.ygoprodeck.com/images/cards/44586426.jpg', 949, 949, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(44586427, 'Batteryman Token', 'Token', 'Token', 'token', 'Special Summoned with the effect of \"Batteryman Solar\".', 32, 158, 'https://images.ygoprodeck.com/images/cards/44586427.jpg', 950, 950, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(44702857, 'Bitelon', 'Effect Monster', 'Effect Monster', 'effect', 'During battle between this attacking card and a Defense Position monster whose DEF is lower than the ATK of this card, inflict the difference as Battle Damage to your opponent.', 27, NULL, 'https://images.ygoprodeck.com/images/cards/44702857.jpg', 1136, 1136, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(44822037, 'Angel Statue - Azurune', 'Trap Card', 'Trap Card', 'trap', 'Special Summon this card as an Effect Monster (Fairy/LIGHT/Level 4/ATK 1800/DEF 1800). (This card is also still a Trap.) Once per turn, when your opponent would Special Summon a monster(s) while this card is in your Monster Zone: You can send to the GY, 1 Continuous Trap in your Monster Zone that was Special Summoned from the Spell & Trap Zone; negate the Summon, and if you do, destroy that monster(s). When this card in the Monster Zone is destroyed by battle: You can destroy the monster that destroyed this card.', 1, 80, 'https://images.ygoprodeck.com/images/cards/44822037.jpg', 479, 479, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(44874522, 'Ancient Gear Reactor Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'If this card that was Tribute Summoned by Tributing an \"Ancient Gear\" monster attacks a Defense Position monster, inflict piercing battle damage to your opponent. If this card was Tribute Summoned by Tributing a \"Gadget\" monster, it can make a second attack during each Battle Phase. If this card attacks, your opponent\'s Spell/Trap Cards and monster effects cannot be activated until the end of the Damage Step. At the end of the Damage Step, if this card attacked: You can destroy 1 Spell/Trap Card on the field.', 12, 75, 'https://images.ygoprodeck.com/images/cards/44874522.jpg', 430, 430, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(44954628, 'B.E.S. Tetran', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned, put 3 counters on it. This card cannot be destroyed by battle. If this card attacks or is attacked, remove 1 counter from this card at the end of the Damage Step. If you cannot, destroy it. Once per turn, you can remove 1 counter on this card to destroy 1 Spell or Trap Card on the field.', 12, 146, 'https://images.ygoprodeck.com/images/cards/44954628.jpg', 857, 857, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(45033006, 'Ally of Justice Enemy Catcher', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned, you can take control of 1 face-down Defense Position monster your opponent controls, until the End Phase of this turn.', 12, 53, 'https://images.ygoprodeck.com/images/cards/45033006.jpg', 248, 248, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(45115956, 'Ancient Warriors Saga - Deception and Betrayal', 'Spell Card', 'Spell Card', 'spell', 'During your Main Phase: You can Special Summon 1 \"Ancient Warriors\" monster from your hand, and if you do, take damage equal to its Level x 100. You can send this face-up card from the Spell & Trap Zone to the GY, then target 1 \"Ancient Warriors\" monster on the field; change it to any Attribute, then, if you targeted an opponent\'s monster, you can take control of it. You can only use each effect of \"Ancient Warriors Saga - Deception and Betrayal\" once per turn.', 1, 77, 'https://images.ygoprodeck.com/images/cards/45115956.jpg', 467, 467, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(45154513, 'Alghoul Mazera', 'Effect Monster', 'Effect Monster', 'effect', 'If a Zombie monster(s) you control would be destroyed by battle or card effect, you can banish this card from your hand or GY instead. If this card is banished from the hand or GY: You can Special Summon this card in Defense Position, then you can reduce its Level by 1. You can only use each effect of \"Alghoul Mazera\" once per turn.', 28, 46, 'https://images.ygoprodeck.com/images/cards/45154513.jpg', 206, 206, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(45236142, 'Advanced Crystal Beast Cobalt Eagle', 'Effect Monster', 'Effect Monster', 'effect', 'If \"Advanced Dark\" is not in a Field Zone, send this monster to the GY. You can send this card from your hand or field to the GY; add 1 \"Advanced Dark\" from your Deck to your hand. Once per turn: You can target 1 \"Advanced Crystal Beast\" card you control; return it to the hand or place it on top of the Deck. If this face-up card is destroyed in a Monster Zone, you can place it face-up in your Spell & Trap Zone as a Continuous Spell, instead of sending it to the GY.', 24, 29, 'https://images.ygoprodeck.com/images/cards/45236142.jpg', 152, 152, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(45349196, 'Archfiend Black Skull Dragon', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 Level 6 \"Archfiend\" Normal Monster + 1 \"Red-Eyes\" Normal Monster\nYou can only Special Summon \"Archfiend Black Skull Dragon(s)\" once per turn. If this card battles, your opponent\'s cards and effects cannot be activated until the end of the Damage Step. If damage calculation is performed involving this Fusion Summoned card, at the end of the Battle Phase: You can target 1 \"Red-Eyes\" Normal Monster in your Graveyard; inflict damage to your opponent equal to its ATK in the Graveyard, then shuffle it into the Deck.', 19, 5, 'https://images.ygoprodeck.com/images/cards/45349196.jpg', 588, 588, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(45450218, 'Ally of Justice Omni-Weapon', 'Effect Monster', 'Effect Monster', 'effect', 'When this card destroys a LIGHT monster by battle and sends it to the Graveyard, draw 1 card. If that card is a Level 4 or lower DARK monster, you can reveal that card to Special Summon it.', 12, 53, 'https://images.ygoprodeck.com/images/cards/45450218.jpg', 253, 253, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
