(50122883, 'Bite Shoes', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: Change the battle position of 1 face-up monster on the field.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/50122883.jpg', 1135, 1135, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(50140163, 'Allure Queen LV7', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, during your Main Phase, if this card was Special Summoned by the effect of \"Allure Queen LV5\", you can select 1 monster on your opponent\'s side of the field and equip it to this card. (Only 1 card at a time can be equipped due to this effect.) If this card would be destroyed by battle, the equipped monster is destroyed instead.', 11, 51, 'https://images.ygoprodeck.com/images/cards/50140163.jpg', 237, 237, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(50179591, 'Abyss Script - Fire Dragon\'s Lair', 'Spell Card', 'Spell Card', 'spell', 'Target 1 \"Abyss Actor\" monster you control; if it destroys your opponent\'s monster by battle this turn, your opponent banishes 3 monsters from their Extra Deck (their choice). If this Set card in its owner\'s control is destroyed by an opponent\'s card effect, and you have a face-up \"Abyss Actor\" Pendulum Monster in your Extra Deck: You can look at your opponent\'s Extra Deck, also banish 1 monster from their Extra Deck. You can only use this effect of \"Abyss Script - Fire Dragon\'s Lair\" once per turn.', 4, 16, 'https://images.ygoprodeck.com/images/cards/50179591.jpg', 87, 87, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(50287060, 'Archfiend of Gilfer', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is sent to the Graveyard: You can target 1 face-up monster on the field; equip that target with this card. That monster loses 500 ATK while equipped with this card.', 9, 5, 'https://images.ygoprodeck.com/images/cards/50287060.jpg', 600, 600, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(50323155, 'Black Horn of Heaven', 'Trap Card', 'Trap Card', 'trap', 'When your opponent would Special Summon exactly 1 monster: Negate the Special Summon, and if you do, destroy it.', 23, NULL, 'https://images.ygoprodeck.com/images/cards/50323155.jpg', 1151, 1151, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(50371210, 'Beacon of White', 'Spell Card', 'Spell Card', 'spell', 'If you do not control another \"Beacon of White\", and you have 3 or more \"Blue-Eyes\" monsters in your GY: Target 1 of them; Special Summon it, but it has its effects negated, also equip it with this card. When this card leaves the field, banish the equipped monster. Other monsters you control cannot attack, also if you have any number of \"Blue-Eyes\" monster(s) in your GY, the equipped monster can attack up to that number of times during each Battle Phase.', 3, 164, 'https://images.ygoprodeck.com/images/cards/50371210.jpg', 1016, 1016, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(50486289, 'Amazoness War Chief', 'Effect Monster', 'Effect Monster', 'effect', 'If you control no monsters, or only \"Amazoness\" monsters: You can Special Summon this card from your hand. If this card is Normal or Special Summoned: You can Set 1 \"Amazoness\" Spell/Trap or 1 \"Polymerization\" directly from your Deck, also you can only attack with \"Amazoness\" monsters for the rest of this turn. You can only use each effect of \"Amazoness War Chief\" once per turn.', 14, 61, 'https://images.ygoprodeck.com/images/cards/50486289.jpg', 354, 354, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(50554729, 'Amorphage Infection', 'Spell Card', 'Spell Card', 'spell', 'All \"Amorphage\" monsters on the field gain 100 ATK and DEF for each \"Amorphage\" card on the field. If a monster(s) in your hand or you control is Tributed, or destroyed by battle or card effect: You can add 1 \"Amorphage\" card from your Deck to your hand. You can only use this effect of \"Amorphage Infection\" once per turn.', 1, 67, 'https://images.ygoprodeck.com/images/cards/50554729.jpg', 368, 368, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(50675040, 'Beast King Unleashed', 'Trap Card', 'Trap Card', 'trap', 'Once per turn, at the start of the Damage Step, if your monster battles an opponent\'s monster in the same column: You can return your monster and any other cards in its column to the hand. You can only activate the effect of \"Beast King Unleashed\" once per Chain.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/50675040.jpg', 1023, 1023, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(50687050, 'Arktos XII - Chronochasm Vaylantz', 'Pendulum Effect Fusion Monster', 'Pendulum Effect Fusion Monster', 'fusion_pendulum', '[ Pendulum Effect ] \nYou can activate 1 of these effects;\r\n● Special Summon this card to your Main Monster Zone in its same column.\r\n● Move 1 monster in your Main Monster Zone to an adjacent (horizontal) Monster Zone.\r\nYou can only use this effect of \"Arktos XII - Chronochasm Vaylantz\" once per turn.\n\n[ Monster Effect ] \n2 Level 5 or higher \"Vaylantz\" monsters\r\nMust first be Special Summoned (from your face-down Extra Deck) by Tributing the above cards. (Quick Effect): You can switch the locations of 2 monsters in your Main Monster Zones or 2 monsters in your opponent\'s Main Monster Zones. If a card in the Monster Zone moves to another Monster Zone (except during the Damage Step): You can destroy 1 card on the field. You can only use each effect of \"Arktos XII - Chronochasm Vaylantz\" once per turn.', 18, 110, 'https://images.ygoprodeck.com/images/cards/50687050.jpg', 635, 635, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(50781944, 'Ancient Crimson Ape', 'Effect Monster', 'Effect Monster', 'effect', 'When a monster(s) you control is destroyed and sent to the Graveyard, gain 1000 Life Points.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/50781944.jpg', 392, 392, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(50789693, 'Armored Kappa', 'XYZ Monster', 'XYZ Monster', 'xyz', '2 Level 2 monsters\nOnce per turn: You can detach 1 Xyz Material from this card; this card gains 1000 ATK or DEF. During either player\'s Battle Step, while an attack involving your monster is occurring: You can discard 1 card; for the rest of this turn, monsters you control cannot be destroyed by battle, also you take no battle damage. You can only use this effect of \"Armored Kappa\" once per Duel.', 29, NULL, 'https://images.ygoprodeck.com/images/cards/50789693.jpg', 681, 681, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(50896944, 'Black Brachios', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can target 1 monster on the field; change that target to face-up Defense Position.', 16, NULL, 'https://images.ygoprodeck.com/images/cards/50896944.jpg', 1141, 1141, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(50903514, 'Blue Flame Swordsman', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, during either player\'s Battle Phase: You can target 1 other Warrior-Type monster you control; this card loses exactly 600 ATK, and if it does, that monster gains 600 ATK. When this card you control is destroyed by your opponent\'s card (by battle or card effect) and sent to your Graveyard: You can banish this card from your Graveyard, then target 1 FIRE Warrior-Type monster in your Graveyard; Special Summon that target.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/50903514.jpg', 1314, 1314, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(50920465, 'Blizzard Thunderbird', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard 1 card; Special Summon 2 WATER Winged Beast-Type monsters, 1 from your hand and 1 from your Graveyard, except \"Blizzard Thunderbird\", then return this card from the field to the hand. You can only use this effect of \"Blizzard Thunderbird\" once per turn.', 24, NULL, 'https://images.ygoprodeck.com/images/cards/50920465.jpg', 1292, 1292, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(50933533, 'Ancient Gear Gadjiltron Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'If this card attacks, your opponent cannot activate any Spell/Trap Cards until the end of the Damage Step. This card gains the appropriate effects if you Normal Summon it by Tributing these monsters.\n● Green Gadget: If this card attacks a Defense Position monster, inflict piercing battle damage to your opponent. \n● Red Gadget: If this card inflicts battle damage to your opponent: Inflict 400 damage to your opponent. \n● Yellow Gadget: If this card destroys an opponent\'s monster by battle: Inflict 600 damage to your opponent.', 12, 75, 'https://images.ygoprodeck.com/images/cards/50933533.jpg', 422, 422, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(51028231, 'Abyss Actor - Sassy Rookie', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nIf an \"Abyss Actor\" monster(s) you control would be destroyed by battle or an opponent\'s card effect, you can destroy this card instead.\n\n[ Monster Effect ] \nThe first time this card would be destroyed by battle or card effect each turn, it is not destroyed. If this card is destroyed by battle, or if this card in its owner\'s Monster Zone is destroyed by an opponent\'s card effect: You can Special Summon 1 Level 4 or lower \"Abyss Actor\" monster from your Deck, except \"Abyss Actor - Sassy Rookie\". If this card in the Pendulum Zone is destroyed: You can target 1 Level 4 or lower monster your opponent controls; destroy it.', 9, 16, 'https://images.ygoprodeck.com/images/cards/51028231.jpg', 70, 70, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(51208877, 'Blast Held by Destiny', 'Trap Card', 'Trap Card', 'trap', 'When an opponent\'s monster declares an attack: Destroy the 1 monster your opponent controls with the highest ATK (your choice, if tied), and if you do, inflict damage to your opponent equal to its original ATK, then if \"Exchange of the Spirit\" is not in your GY, you take damage equal to the damage they took. If this card is sent from the hand or Deck to the GY: You can target 1 Level 4 EARTH Fairy monster in your GY; add it to your hand. You can only use each effect of \"Blast Held by Destiny\" once per turn.', 4, 36, 'https://images.ygoprodeck.com/images/cards/51208877.jpg', 1259, 1259, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(51254277, 'Big Jaws', 'Effect Monster', 'Effect Monster', 'effect', 'At the end of the Battle Phase, if this card attacked: Banish it.', 8, NULL, 'https://images.ygoprodeck.com/images/cards/51254277.jpg', 1110, 1110, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(51351302, 'A Man with Wdjat', 'Effect Monster', 'Effect Monster', 'effect', 'When you Normal Summon this card, and during each of your Standby Phases, select 1 Set card on your opponent\'s side of the field. Pick it up and look at it, then return it to its original position.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/51351302.jpg', 26, 26, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(51369889, 'Barrage Blast', 'Trap Card', 'Trap Card', 'trap', 'Once per turn, you can detach any number of materials from Machine Xyz Monsters you control, then target that many cards on the field; destroy them. If a Machine Xyz Monster(s) you control is destroyed by battle or an opponent\'s card effect while this card is in your GY: You can banish this card and 1 Machine Xyz Monster from your GY; inflict damage to your opponent equal to the banished monster\'s Rank x 200.', 1, 153, 'https://images.ygoprodeck.com/images/cards/51369889.jpg', 917, 917, '2025-03-10 13:13:06', '2025-03-10 13:13:06');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(51391183, 'Abyss Actor - Wild Hope', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nOnce per turn: You can target 1 \"Abyss Actor\" card in your other Pendulum Zone; its Pendulum Scale becomes 9 until the end of this turn, also you cannot Special Summon monsters for the rest of this turn, except \"Abyss Actor\" monsters (even if this card leaves the field).\n\n[ Monster Effect ] \nOnce per turn: You can make this card gain 100 ATK for each \"Abyss Actor\" monster you currently control with different names, until the end of this turn. If this card is destroyed by battle or card effect: You can add 1 \"Abyss Actor\" card from your Deck to your hand, except \"Abyss Actor - Wild Hope\". You can only use this effect of \"Abyss Actor - Wild Hope\" once per turn.', 9, 16, 'https://images.ygoprodeck.com/images/cards/51391183.jpg', 75, 75, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(51562916, 'Big Wave Small Wave', 'Spell Card', 'Spell Card', 'spell', 'Destroy all face-up WATER monsters you control, then you can Special Summon WATER monsters from your hand, up to the number of monsters destroyed by this effect.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/51562916.jpg', 1115, 1115, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(51578214, 'Beetrooper Assault Roller', 'Effect Monster', 'Effect Monster', 'effect', 'You can Special Summon this card (from your hand) by banishing 1 Insect monster from your GY. You can only Special Summon \"Beetrooper Assault Roller\" once per turn this way. Gains 200 ATK for each Insect monster you control, except this card. When this card is destroyed by battle: You can add 1 \"Beetrooper\" monster from your Deck to your hand, except \"Beetrooper Assault Roller\". You can only use this effect of \"Beetrooper Assault Roller\" once per turn.', 7, 170, 'https://images.ygoprodeck.com/images/cards/51578214.jpg', 1055, 1055, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(51618973, 'Avance, Swordsman of the Nekroz', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can Special Summon 1 \"Nekroz\" monster from your Deck, except \"Avance, Swordsman of the Nekroz\". If you Ritual Summon exactly 1 \"Nekroz\" Ritual Monster with a card effect that requires use of monsters, this card you control can be used as the entire Tribute. If this card is Tributed by card effect: You can add any number of your banished \"Nekroz\" cards with different names to your hand. You can only use this effect of \"Avance, Swordsman of the Nekroz\" once per Duel.', 11, 107, 'https://images.ygoprodeck.com/images/cards/51618973.jpg', 819, 819, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(51630558, 'Advance Draw', 'Spell Card', 'Spell Card', 'spell', 'Tribute 1 face-up Level 8 or higher monster you control; draw 2 cards.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/51630558.jpg', 147, 147, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(51706604, 'Blizzard', 'Spell Card', 'Spell Card', 'spell', 'Target 1 face-up Spell your opponent controls; this turn, negate the activated effects of that Spell and all Spells on the field with that same original name. If the targeted card would be sent to the opponent\'s GY this turn, it is added to their hand instead. You can only activate 1 \"Blizzard\" per turn.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/51706604.jpg', 1288, 1288, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(51779204, 'Absolute Powerforce', 'Spell Card', 'Spell Card', 'spell', 'Target 1 \"Red Dragon Archfiend\" you control; if it battles an opponent\'s monster this turn while you control it, apply these effects until the end of the Damage Step.\r\n● It gains 1000 ATK.\r\n● Your opponent cannot activate cards or effects.\r\n● If it attacks a Defense Position monster, inflict piercing battle damage to your opponent.\r\n● Any battle damage your opponent takes from that battle is doubled.', 2, 13, 'https://images.ygoprodeck.com/images/cards/51779204.jpg', 56, 56, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(52198054, 'Blaze Accelerator Reload', 'Trap Card', 'Trap Card', 'trap', 'This card\'s name becomes \"Tri-Blaze Accelerator\" while in the Spell & Trap Zone. During either player\'s Main Phase: You can send 1 \"Volcanic\" card from your hand to the Graveyard, and if you do, draw 1 card. You can only use this effect of \"Blaze Accelerator Reload\" once per turn. During either player\'s Main Phase: You can banish this card from your Graveyard; send 1 \"Volcanic\" card from your Deck to the Graveyard.', 1, 186, 'https://images.ygoprodeck.com/images/cards/52198054.jpg', 1269, 1269, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(52240819, 'Abyss Actor - Evil Heel', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nOnce per turn: You can Tribute 1 \"Abyss Actor\" monster, then target 1 face-up monster your opponent controls; it loses ATK equal to the original ATK of the Tributed monster, until the end of this turn (even if this card leaves the field).\n\n[ Monster Effect ] \nIf this card is Normal or Special Summoned: You can target 1 face-up monster your opponent controls; it loses 1000 ATK for each \"Abyss Actor\" monster you currently control, until the end of this turn. When this card destroys an opponent\'s monster by battle: You can target 1 \"Abyss Script\" Spell Card in your Graveyard; Set that card.', 9, 16, 'https://images.ygoprodeck.com/images/cards/52240819.jpg', 63, 63, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(52265835, 'Ally of Justice Rudra', 'Effect Monster', 'Effect Monster', 'effect', 'If this card battles a LIGHT monster, it gains 700 ATK during the Damage Step only.', 12, 53, 'https://images.ygoprodeck.com/images/cards/52265835.jpg', 256, 256, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(52296675, 'Anchamoufrite', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nIf you have no cards in your Extra Deck except \"Anchamoufrite\": You can destroy this card, then draw 1 card. You can only use this effect of \"Anchamoufrite\" once per turn.\n\n[ Monster Effect ] \nCannot be Normal Summoned/Set. Must be Special Summoned (from your face-up Extra Deck) by having no cards in your Extra Deck except \"Anchamoufrite\". You can only Special Summon \"Anchamoufrite\" once per turn this way. If this face-up card in the Monster Zone leaves the field, banish it.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/52296675.jpg', 388, 388, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(52319752, 'Black Veloci', 'Effect Monster', 'Effect Monster', 'effect', 'If this card attacks an opponent\'s monster, this card gains 400 ATK during the Damage Step only. If this card is attacked by an opponent\'s monster, this card loses 400 ATK during the Damage Step only.', 16, NULL, 'https://images.ygoprodeck.com/images/cards/52319752.jpg', 1180, 1180, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(52495649, 'Balameuniere de Nouvelles', 'Ritual Effect Monster', 'Ritual Effect Monster', 'ritual', 'You can Ritual Summon this card with a \"Recipe\" card. If this card is Special Summoned: You can add 1 \"Nouvelles\" or \"Recipe\" card from your Deck to your hand. You can target 1 Attack Position monster your opponent controls; Tribute it, and if you do, Special Summon 1 Level 6 \"Nouvelles\" Ritual Monster from your hand or Deck. This is a Quick Effect if this card was Special Summoned by the effect of a \"Nouvelles\" monster. You can only use each effect of \"Balameuniere de Nouvelles\" once per turn.', 15, 148, 'https://images.ygoprodeck.com/images/cards/52495649.jpg', 892, 892, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(52497105, 'Berserk Scales', 'Spell Card', 'Spell Card', 'spell', 'Target 1 face-up monster you control (except a monster that is attacking directly); it gains 1000 ATK, also it cannot attack your opponent directly for the rest of this turn. During the End Phase of this turn, it loses 2000 ATK.', 2, NULL, 'https://images.ygoprodeck.com/images/cards/52497105.jpg', 1086, 1086, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(52833089, 'Black Thunder', 'Trap Card', 'Trap Card', 'trap', 'Activate only when a \"Blackwing\" monster you control is destroyed by battle and sent to the Graveyard. Inflict 400 damage to your opponent for each card your opponent controls.', 4, 35, 'https://images.ygoprodeck.com/images/cards/52833089.jpg', 1178, 1178, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(52869807, 'Blackwing - Gust the Backblast', 'Effect Monster', 'Effect Monster', 'effect', 'If you control no cards, you can Special Summon this card (from your hand). If your opponent\'s monster attacks a \"Blackwing\" monster you control, the attacking monster loses 300 ATK during the Damage Step only.', 24, 35, 'https://images.ygoprodeck.com/images/cards/52869807.jpg', 1218, 1218, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(52900379, 'Blackwing - Brisote the Tailwind', 'Effect Monster', 'Effect Monster', 'effect', 'If 2 or more face-up \"Blackwing\" monsters you control were destroyed this turn, you can Special Summon this card (from your hand). If this card is sent to the Graveyard as a Synchro Material: Gain 600 LP.', 24, 35, 'https://images.ygoprodeck.com/images/cards/52900379.jpg', 1205, 1205, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(52927340, 'Altergeist Kunquery', 'Effect Monster', 'Effect Monster', 'effect', 'When an opponent\'s monster declares an attack, if you control an \"Altergeist\" card: You can Special Summon this card from your hand, and if you do, negate that attack. If this card is Special Summoned: You can target 1 face-up card your opponent controls; negate the effects of that card while it and this monster are face-up on the field.', 11, 57, 'https://images.ygoprodeck.com/images/cards/52927340.jpg', 281, 281, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(53008933, 'Archfiend\'s Advent', 'Effect Monster', 'Effect Monster', 'effect', 'While you control \"Shining Sarcophagus\", you can Normal Summon this card without Tributing. Other monsters you control gain 500 ATK, during your turn only. If this card is Normal or Special Summoned: You can target 1 monster your opponent controls; take control of it until the End Phase, but that monster cannot attack unless you controlled \"Shining Sarcophagus\" when this effect was activated. You can only use this effect of \"Archfiend\'s Advent\" once per turn.', 9, 5, 'https://images.ygoprodeck.com/images/cards/53008933.jpg', 604, 604, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(53112492, 'Anti-Spell', 'Trap Card', 'Trap Card', 'trap', 'Remove 2 Spell Counters on your side of the field to negate the activation of a Spell Card and destroy it.', 23, 87, 'https://images.ygoprodeck.com/images/cards/53112492.jpg', 502, 502, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(53143898, 'Altergeist Marionetter', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can Set 1 \"Altergeist\" Trap directly from your Deck to your Spell & Trap Zone. You can target 1 \"Altergeist\" card you control and 1 \"Altergeist\" monster in your GY; send that card on the field to the GY, and if you do, Special Summon that other monster from your GY. You can only use this effect of \"Altergeist Marionetter\" once per turn.', 11, 57, 'https://images.ygoprodeck.com/images/cards/53143898.jpg', 284, 284, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(53153481, 'Armaill', 'Normal Monster', 'Normal Monster', 'normal', 'A strange warrior who manipulates three deadly blades with both hands and his tail.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/53153481.jpg', 641, 641, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(53162898, 'Amazoness Sage', 'Effect Monster', 'Effect Monster', 'effect', 'At the end of the Damage Step, if this card attacked and is still on the field: Target 1 Spell/Trap your opponent controls; destroy that target.', 14, 61, 'https://images.ygoprodeck.com/images/cards/53162898.jpg', 342, 342, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(53167658, 'Blockout Curtain', 'Spell Card', 'Spell Card', 'spell', 'If a card(s) you control would be destroyed by battle or an opponent\'s card effect, you can destroy this card instead of 1 of those cards. If a card(s) your opponent controls would be destroyed by battle or card effect, you can banish this card from your GY instead of 1 of those cards. You can only use each effect of \"Blockout Curtain\" once per turn.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/53167658.jpg', 1302, 1302, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(53183600, 'Blue-Eyes Toon Dragon', 'Toon Monster', 'Toon Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand) by Tributing 2 monsters, while you control \"Toon World\". Cannot attack the turn it is Special Summoned. You must pay 500 LP to declare an attack with this monster. If \"Toon World\" on the field is destroyed, destroy this card. Can attack your opponent directly, unless they control a Toon monster, in which case this card must target a Toon monster for its attacks.', 19, 191, 'https://images.ygoprodeck.com/images/cards/53183600.jpg', 1330, 1330, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(53266486, 'Anesthrokket Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'When a Link Monster\'s effect is activated that targets this face-up card on the field (Quick Effect): You can destroy this card, then make 1 face-up monster on the field unable to attack, also it has its effects negated. During the End Phase, if this card is in the GY because it was destroyed on the field by battle or card effect and sent there this turn: You can Special Summon 1 \"Rokket\" monster from your Deck, except \"Anesthrokket Dragon\". You can only use each effect of \"Anesthrokket Dragon\" once per turn.', 19, 15, 'https://images.ygoprodeck.com/images/cards/53266486.jpg', 474, 474, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(53318263, 'Bahalutiya, the Grand Radiance', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute Summon this card by Tributing 1 Effect Monster. During your opponent\'s Main Phase, if a card(s) is added from the Main Deck to their hand (except by drawing it) and this card is in your hand, you can: Immediately after this effect resolves, Tribute Summon this card. If this card is Normal or Special Summoned from the hand, you can: Make your opponent banish the top cards of their Deck face-down, equal to the number of cards in their hand, then, they shuffle their entire hand into the Deck, and if they do, they add the card(s) banished by this effect to their hand. You can only use this effect of \"Bahalutiya, the Grand Radiance\" once per turn.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/53318263.jpg', 888, 888, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(53347303, 'Blue-Eyes Shining Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must be Special Summoned (from your hand) by Tributing 1 \"Blue-Eyes Ultimate Dragon\". Gains 300 ATK for each Dragon monster in your GY. When a card or effect is activated that targets this card (Quick Effect): You can negate that effect.', 19, 164, 'https://images.ygoprodeck.com/images/cards/53347303.jpg', 1327, 1327, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(53389254, 'Assault Blackwing - Sohaya the Rain Storm', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nIf this card is Synchro Summoned using a \"Blackwing\" monster as Material, it is treated as a Tuner while face-up on the field. You can only use each of these effects of \"Assault Blackwing - Sohaya the Rain Storm\" once per turn. ● When this card is Synchro Summoned: You can target 1 \"Assault Blackwing\" monster in your Graveyard; Special Summon it. ● During your Main Phase, if this card is in the Graveyard because it was sent there this turn: You can banish 1 other \"Assault Blackwing - Sohaya the Rain Storm\" from your Graveyard; Special Summon this card.', 24, 35, 'https://images.ygoprodeck.com/images/cards/53389254.jpg', 761, 761, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
