(53701259, 'Awakening of the Sacred Beasts', 'Trap Card', 'Trap Card', 'trap', 'This card gains these effects based on the number of \"Uria, Lord of Searing Flames\", \"Hamon, Lord of Striking Thunder\", and/or \"Raviel, Lord of Phantasms\" with different names you control.\r\n● 1+: Each time your opponent Normal or Special Summons a monster(s): Gain LP equal to the ATK of that monster(s).\r\n● 2+: Negate the activated effects of monsters your opponent controls.\r\n● 3: Any monsters sent to your opponent\'s GY are banished instead.\r\nOnce per your turn, if you control a Level 10 monster: You can add 1 Continuous Trap from your GY to your hand.', 1, 114, 'https://images.ygoprodeck.com/images/cards/53701259.jpg', 831, 831, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
