(57030525, 'Armed Dragon Thunder LV3', 'Effect Monster', 'Effect Monster', 'effect', 'This card\'s name becomes \"Armed Dragon LV3\" while on the field or in the GY. You can only use each of the following effects of \"Armed Dragon Thunder LV3\" once per turn. You can send 1 monster from your hand to the GY; send this card from the field to the GY, and if you do, Special Summon 1 Level 5 or lower \"Armed Dragon\" monster from your hand or Deck. If this card is sent to the GY to activate a Dragon monster\'s effect: You can draw 1 card.', 19, 111, 'https://images.ygoprodeck.com/images/cards/57030525.jpg', 654, 654, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(57043986, 'Blue-Eyes Solid Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned: You can target 1 face-up monster your opponent controls; negate its effects. When your opponent activates a card or effect (Quick Effect): You can shuffle this card from the field into the Deck, and if you do, Special Summon 1 \"Blue-Eyes White Dragon\" from your Deck. You can only use each effect of \"Blue-Eyes Solid Dragon\" once per turn.', 19, 164, 'https://images.ygoprodeck.com/images/cards/57043986.jpg', 1328, 1328, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(57312333, 'Amazoness Call', 'Spell Card', 'Spell Card', 'spell', 'Take 1 \"Amazoness\" card from your Deck, except \"Amazoness Call\", and either add it to your hand or send it to the GY. During your Main Phase: You can banish this card from your GY, then target 1 \"Amazoness\" monster you control; this turn, that monster can attack all monsters your opponent controls, once each, also other monsters you control cannot attack. You can only activate 1 \"Amazoness Call\" per turn.', 2, 61, 'https://images.ygoprodeck.com/images/cards/57312333.jpg', 327, 327, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(57605303, 'Armed Dragon Thunderbolt', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Armed Dragon\" monster you control; it gains 1000 ATK for each \"Armed Dragon\" monster in your GY with an equal or lower Level than it and with different names from each other, also for the rest of this turn, your opponent takes no battle damage from its attacks. You can banish this card from your GY, then target 1 \"Armed Dragon\" Spell in your GY; add it to your hand. You can only use 1 \"Armed Dragon Thunderbolt\" effect per turn, and only once that turn.', 4, 111, 'https://images.ygoprodeck.com/images/cards/57605303.jpg', 657, 657, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(57624336, 'Archfiend Eccentrick', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nYou can target 1 other Spell/Trap on the field; destroy both it and this card. You can only use this effect of \"Archfiend Eccentrick\" once per turn.\n\n[ Monster Effect ] \nYou can Tribute this card, then target 1 monster on the field; destroy it. You can only use this effect of \"Archfiend Eccentrick\" once per turn.', 9, 5, 'https://images.ygoprodeck.com/images/cards/57624336.jpg', 591, 591, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(57769391, 'Altergeist Pixiel', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute this card; excavate the top 3 cards of your Deck, add 1 excavated \"Altergeist\" card to your hand, also send the rest to the GY. You can only use this effect of \"Altergeist Pixiel\" once per turn.', 11, 57, 'https://images.ygoprodeck.com/images/cards/57769391.jpg', 289, 289, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(57964143, 'Arbitration of White', 'Trap Card', 'Trap Card', 'trap', 'You can target 1 Fish monster you control; it is treated as a Tuner this turn. When an opponent\'s monster declares an attack: You can discard 1 Fish monster; change all monsters your opponent controls to Defense Position. If your Fish monster is destroyed by battle or sent to your GY: You can send this face-up card from your Spell & Trap Zone to the GY; Special Summon 1 Fish monster from your GY. You can only use each effect of \"Arbitration of White\" once per turn.', 1, 100, 'https://images.ygoprodeck.com/images/cards/57964143.jpg', 560, 560, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(58012107, 'Alien Psychic', 'Effect Monster', 'Effect Monster', 'effect', 'This card is changed to Defense Position when it is Normal Summoned or Flip Summoned. Monsters with A-Counters cannot declare an attack.', 27, 1, 'https://images.ygoprodeck.com/images/cards/58012107.jpg', 220, 220, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(58066722, 'Alien Stealthbuster', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is sent to the GY: You can target 1 face-up monster on the field; place 2 A-Counters on it. During your Main Phase, except the turn this card was sent to the GY: You can banish this card from your GY, then target 1 card with an A-Counter; destroy it. You can only use each effect of \"Alien Stealthbuster\" once per turn.', 27, 1, 'https://images.ygoprodeck.com/images/cards/58066722.jpg', 224, 224, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(58116537, 'Ancient Warriors Saga - Sun-Liu Alliance', 'Spell Card', 'Spell Card', 'spell', 'If you control \"Ancient Warriors\" monsters with 2 or more different Attributes: You can declare 1 Attribute; your opponent cannot activate the effects of monsters they currently control with that Attribute, until the end of this turn (even if this card leaves the field). If your opponent Special Summons a monster(s), or you activate an \"Ancient Warriors\" monster\'s effect (except during the Damage Step): You can make all \"Ancient Warriors\" monsters you control gain 300 ATK for each \"Ancient Warriors\" monster you control until the end of this turn (even if this card leaves the field). You can only use each effect of \"Ancient Warriors Saga - Sun-Liu Alliance\" once per turn.', 1, 77, 'https://images.ygoprodeck.com/images/cards/58116537.jpg', 470, 470, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(58131925, 'Blackwing - Damascus the Polar Night', 'Effect Monster', 'Effect Monster', 'effect', 'During either player\'s turn: You can discard this card to target 1 \"Blackwing\" monster you control; it gains 500 ATK until the End Phase.', 24, 35, 'https://images.ygoprodeck.com/images/cards/58131925.jpg', 1208, 1208, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(58153103, 'Armed Dragon Thunder LV10', 'Effect Monster', 'Effect Monster', 'effect', 'If this card was Special Summoned by the effect of an \"Armed Dragon\" monster, it gains the following effects based on its ATK.\r\n● 1+: Its name becomes \"Armed Dragon LV10\". ● 10+: Control of it cannot switch. ● 100+: Cannot be destroyed by battle. ● 1000+: Once per opponent\'s turn (Quick Effect): You can send 1 card from your hand to the GY, then target 1 other card on the field; destroy it, and if you do, this card gains 1000 ATK. ● 10000+: Once per turn: You can destroy all other cards on the field.', 19, 111, 'https://images.ygoprodeck.com/images/cards/58153103.jpg', 653, 653, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(58268433, 'Blade Rabbit', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is changed from Attack Position to face-up Defense Position, destroy 1 monster on your opponent\'s side of the field.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/58268433.jpg', 1254, 1254, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(58324930, 'Anarchist Monk Ranshin', 'Effect Monster', 'Effect Monster', 'effect', 'When this card you control is sent to your Graveyard by your opponent\'s card (either by battle, by card effect, or by being destroyed): Target 1 monster in your opponent\'s Graveyard; banish that target.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/58324930.jpg', 387, 387, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(58400390, 'Beckoned by the World Chalice', 'Normal Monster', 'Normal Monster', 'normal', 'His battle with the Mekkstrosities never seems to end. Even when their forest was invaded by Mekkstrocious Insects, he stood his ground and inspired the other defenders around him.', 14, 134, 'https://images.ygoprodeck.com/images/cards/58400390.jpg', 1047, 1047, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(58569561, 'Aromage Rosemary', 'Effect Monster', 'Effect Monster', 'effect', 'While your LP are higher than your opponent\'s, if a Plant monster you control attacks, your opponent cannot activate monster effects until the end of the Damage Step. Once per turn, if you gain LP: Target 1 face-up monster on the field; change its battle position.', 21, 121, 'https://images.ygoprodeck.com/images/cards/58569561.jpg', 707, 707, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(58685438, 'Bicorn Re\'em', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is sent to the Graveyard as a Synchro Material Monster for a Synchro Summon, send the top 2 cards from your opponent\'s Deck to the Graveyard.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/58685438.jpg', 1101, 1101, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(58696829, 'Bio-Mage', 'Normal Monster', 'Normal Monster', 'normal', 'A mysterious priest created as a result of the latest advances in biotechnology.', 18, NULL, 'https://images.ygoprodeck.com/images/cards/58696829.jpg', 1127, 1127, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(58820853, 'Blackwing - Shura the Blue Flame', 'Effect Monster', 'Effect Monster', 'effect', 'When this card destroys an opponent\'s monster by battle and sends it to the Graveyard: You can Special Summon 1 \"Blackwing\" monster with 1500 or less ATK from your Deck, but its effects are negated.', 24, 35, 'https://images.ygoprodeck.com/images/cards/58820853.jpg', 1234, 1234, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(58827995, 'Armor Dragon Ritual', 'Spell Card', 'Spell Card', 'spell', 'This card is used to Ritual Summon \"Knight of Armor Dragon\". You must also Tribute monsters from your hand or field whose total Levels equal 4 or more. During your Main Phase, except the turn this card was sent to the GY: You can banish monsters from your hand or face-up field whose total Levels equal 4 or more; banish this card from your GY, and if you do, Special Summon 1 \"Knight of Armor Dragon\" from your GY. You can only use this effect of \"Armor Dragon Ritual\" once per turn.', 13, NULL, 'https://images.ygoprodeck.com/images/cards/58827995.jpg', 671, 671, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(58844135, 'Antihuman Intelligence ME-PSY-YA', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nAny card sent to the GY is banished instead, except Monster Cards.\n\n[ Monster Effect ] \nYou can reveal this card in your hand; add 1 other Pendulum Monster from your hand, or 1 card from your Pendulum Zone, to its owner\'s Extra Deck face-up, and if you do, Special Summon this card. You can only use this effect of \"Antihuman Intelligence ME-PSY-YA\" once per turn. If another monster(s) is Normal or Special Summoned while you control this card: Send that monster(s) to the GY during the End Phase of this turn.', 22, NULL, 'https://images.ygoprodeck.com/images/cards/58844135.jpg', 506, 506, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(58921041, 'Anti-Spell Fragrance', 'Trap Card', 'Trap Card', 'trap', 'Both players must Set Spell Cards before activating them, and cannot activate them until their next turn after Setting them.', 1, 87, 'https://images.ygoprodeck.com/images/cards/58921041.jpg', 503, 503, '2025-03-10 13:12:58', '2025-03-10 13:12:58');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(58990631, 'Automatic Laser', 'Trap Card', 'Trap Card', 'trap', 'When your opponent Normal or Special Summons a monster(s) with 1000 or more ATK, reveal 1 \"Iron Core of Koa\'ki Meiru\" in your hand to activate this card. Destroy that Summoned monster(s).', 4, 137, 'https://images.ygoprodeck.com/images/cards/58990631.jpg', 814, 814, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(58996839, 'Ashoka Pillar', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Summoned: You can add 1 Equip Spell from your Deck to your hand, then if this card is in Attack Position, change it to Defense Position. You can only use this effect of \"Ashoka Pillar\" once per turn. If this card is destroyed by battle or card effect: Take 2000 damage.', 17, 125, 'https://images.ygoprodeck.com/images/cards/58996839.jpg', 749, 749, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(59048135, 'Augmented Heraldry', 'Spell Card', 'Spell Card', 'spell', 'Psychic-Type Xyz Monsters on the field cannot be targeted by Spell/Trap effects. Once per turn: You can discard 1 \"Heraldic Beast\" monster; add 1 \"Heraldry\" Spell/Trap Card from your Deck to your hand, except \"Augmented Heraldry\". You cannot Normal or Special Summon monsters during the turn you activate this effect, except Psychic-Type Xyz Monsters and \"Heraldic Beast\" monsters (even if this card leaves the field).', 10, 31, 'https://images.ygoprodeck.com/images/cards/59048135.jpg', 806, 806, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(59057953, 'Abyss Actors Back Stage', 'Trap Card', 'Trap Card', 'trap', 'If you have 2 \"Abyss Actor\" cards in your Pendulum Zones: Add 2 \"Abyss Actor\" Pendulum Monsters with different names from your Deck to your Extra Deck face-up. You can only activate 1 \"Abyss Actors Back Stage\" per turn.', 4, 16, 'https://images.ygoprodeck.com/images/cards/59057953.jpg', 76, 76, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(59131526, 'Aqua Chorus Round', 'Spell Card', 'Spell Card', 'spell', 'Banish 1 card from your hand, and if you do, during your next Standby Phase, you can add up to 2 cards with the same name as that banished card from your Deck to your hand. If you activated this card while your opponent controlled no cards, for the rest of this turn you cannot activate cards, or the effects of cards, with the same original name as that banished card.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/59131526.jpg', 540, 540, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(59185998, 'Altergeist Pookuery', 'Effect Monster', 'Effect Monster', 'effect', 'If an \"Altergeist\" monster you control would be used as Link Material for an \"Altergeist\" monster, this card in your hand can also be used as material. You can only use this effect of \"Altergeist Pookuery\" once per turn. If an \"Altergeist\" Link Monster is Link Summoned to your field, while this card is in your GY (except during the Damage Step): You can add this card to your hand. You can only use this effect of \"Altergeist Pookuery\" once per Duel.', 11, 57, 'https://images.ygoprodeck.com/images/cards/59185998.jpg', 290, 290, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(59332125, 'A.I. Love Fusion', 'Spell Card', 'Spell Card', 'spell', 'Fusion Summon 1 Cyberse Fusion Monster from your Extra Deck, using monsters from your hand or field as Fusion Material. If you use your \"@Ignister\" monster as Fusion Material, you can also use 1 Link Monster your opponent controls as material. You can only activate 1 \"A.I. Love Fusion\" per turn.', 4, 11, 'https://images.ygoprodeck.com/images/cards/59332125.jpg', 37, 37, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(59353647, 'Amazoness Pet Liger King', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 Level 5 or higher \"Amazoness\" monster + 1 \"Amazoness\" monster\r\nYour opponent\'s monsters cannot attack any monsters, except this one. You can target 1 \"Amazoness\" card you control and 1 \"Amazoness\" Warrior monster in your GY; destroy that card on the field, and if you do, Special Summon that other monster from the GY. This card cannot attack the turn this effect is activated. You can only use this effect of \"Amazoness Pet Liger King\" once per turn.', 5, 61, 'https://images.ygoprodeck.com/images/cards/59353647.jpg', 339, 339, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(59380081, 'Big-Tusked Mammoth', 'Effect Monster', 'Effect Monster', 'effect', 'Monsters your opponent controls cannot attack the turn they are Summoned.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/59380081.jpg', 1119, 1119, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(59464593, 'Armed Dragon LV10', 'Effect Monster', 'Effect Monster', 'effect', 'This card cannot be Normal Summoned or Set. This card cannot be Special Summoned except by Tributing 1 \"Armed Dragon LV7\". You can send 1 card from your hand to the Graveyard to destroy all face-up monsters your opponent controls.', 19, 111, 'https://images.ygoprodeck.com/images/cards/59464593.jpg', 648, 648, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(59482302, 'Ally Salvo', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is destroyed by battle with a LIGHT monster and sent to the Graveyard, select 2 cards on the field and destroy them.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/59482302.jpg', 262, 262, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(59509952, 'Archlord Kristya', 'Effect Monster', 'Effect Monster', 'effect', 'If you have exactly 4 Fairy monsters in your GY, you can Special Summon this card (from your hand). If Summoned this way: Target 1 Fairy monster in your GY; add that target to your hand. Neither player can Special Summon monsters. If this face-up card would be sent from the field to the GY, place it on top of the Deck, instead.', 18, NULL, 'https://images.ygoprodeck.com/images/cards/59509952.jpg', 615, 615, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(59712426, 'Arcana Force XV - The Fiend', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard this card; add 1 \"Light Barrier\" from your Deck or GY to your hand. If this card is Summoned: Toss a coin and this card gains the appropriate effect.\r\n● Heads: When an attack is declared involving this card: You can target 1 monster on the field; destroy it, and if you do, inflict 500 damage to its controller.\r\n● Tails: If an attack is declared involving this card: Destroy all monsters on the field.', 18, 101, 'https://images.ygoprodeck.com/images/cards/59712426.jpg', 576, 576, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(59808784, 'Berlineth the Firestorm Vassal', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard 1 card; Special Summon this card from your hand, also you cannot Special Summon monsters from the Extra Deck for the rest of this turn. If this card is Tributed for a Tribute Summon: You can look at your opponent\'s hand and banish 1 card from their hand until the End Phase. You can only use each effect of \"Berlineth the Firestorm Vassal\" once per turn.', 26, 174, 'https://images.ygoprodeck.com/images/cards/59808784.jpg', 1081, 1081, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(59811955, 'Ancient Gear Workshop', 'Spell Card', 'Spell Card', 'spell', 'Target 1 \"Ancient Gear\" monster in your Graveyard; add that target to your hand.', 4, 75, 'https://images.ygoprodeck.com/images/cards/59811955.jpg', 437, 437, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(59822133, 'Blue-Eyes Spirit Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner \"Blue-Eyes\" monsters\r\nNeither player can Special Summon 2 or more monsters at the same time. Once per turn, during either player\'s turn, when an effect of a card in the Graveyard is activated: You can negate the activation. During either player\'s turn: You can Tribute this Synchro Summoned card; Special Summon 1 LIGHT Dragon-Type Synchro Monster from your Extra Deck in Defense Position, except \"Blue-Eyes Spirit Dragon\", but destroy it during the End Phase of this turn.', 19, 164, 'https://images.ygoprodeck.com/images/cards/59822133.jpg', 1329, 1329, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(59919307, 'Back to the Front', 'Trap Card', 'Trap Card', 'trap', 'Target 1 monster in your GY; Special Summon it in Defense Position.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/59919307.jpg', 869, 869, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(59969392, 'Archfiend Zombie-Skull', 'Synchro Monster', 'Synchro Monster', 'synchro', '\"Plaguespreader Zombie\" + 2+ non-Tuner Zombie monsters\r\nZombie monsters you control cannot be destroyed by card effects.', 28, 5, 'https://images.ygoprodeck.com/images/cards/59969392.jpg', 603, 603, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(60023855, 'Baby Spider', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute 1 DARK monster; increase the Levels of all \"Baby Spiders\" you currently control by the Level of that Tributed monster. You can pay half your LP, banish this card from your GY, and detach 1 material from your DARK Xyz Monster, then target 1 DARK monster in your GY; Special Summon it. You can only use each effect of \"Baby Spider\" once per turn.', 7, 147, 'https://images.ygoprodeck.com/images/cards/60023855.jpg', 863, 863, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(60033398, 'Ancient Warriors - Fearsome Zhang Yuan', 'Effect Monster', 'Effect Monster', 'effect', 'All other \"Ancient Warriors\" monsters you control cannot be destroyed by battle. You can only use each of the following effects of \"Ancient Warriors - Fearsome Zhang Yuan\" once per turn.\r\n● At the start of the Damage Step, when your \"Ancient Warriors\" monster battles an opponent\'s face-up monster: You can Special Summon this card from your hand, and if you do, that opponent\'s monster loses 1000 ATK.\r\n● If a card(s) your opponent controls is destroyed by battle or card effect: You can target 1 card your opponent controls; destroy it.', 15, 77, 'https://images.ygoprodeck.com/images/cards/60033398.jpg', 455, 455, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(60110982, 'Armityle the Chaos Phantasm - Phantom of Fury', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"Uria, Lord of Searing Flames\" + \"Hamon, Lord of Striking Thunder\" + \"Raviel, Lord of Phantasms\"\r\nThis card\'s name becomes \"Armityle the Chaos Phantasm\" while on the field. Once per turn, during your Main Phase: You can give control of this card to your opponent. Once per turn, during the End Phase, if this card\'s control was changed this turn: Banish all cards you control, then the owner of this card can Special Summon 1 \"Armityle the Chaos Phantasm\" from their Extra Deck, ignoring its Summoning conditions.', 9, 114, 'https://images.ygoprodeck.com/images/cards/60110982.jpg', 667, 667, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(60161788, 'Blizzed, Defender of the Ice Barrier', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is destroyed by battle and sent to the Graveyard, draw 1 card.', 6, 188, 'https://images.ygoprodeck.com/images/cards/60161788.jpg', 1294, 1294, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(60202749, 'Abyss-sphere', 'Trap Card', 'Trap Card', 'trap', 'Special Summon 1 \"Mermail\" monster from your Deck. Its effects are negated. You cannot activate any Spell Cards. When this card leaves the field, destroy that monster. Destroy this card during your opponent\'s next End Phase after activation.', 1, 20, 'https://images.ygoprodeck.com/images/cards/60202749.jpg', 99, 99, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(60411677, 'Anubis the Last Judge', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand or GY) while you have 3 or more cards in your GY with different names that are \"Temple of the Kings\" and/or Traps, by placing 2 of them on the bottom of the Deck in any order. You can send this card from your hand to the GY; add 1 \"The Man with the Mark\" from your Deck to your hand. If a Spell/Trap(s) you control is destroyed by card effect: You can target 1 card your opponent controls; destroy it. You can only use each effect of \"Anubis the Last Judge\" once per turn.', 9, 88, 'https://images.ygoprodeck.com/images/cards/60411677.jpg', 507, 507, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
