(64202399, 'Blue-Eyes Abyss Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Special Summoned: You can add 1 Ritual Spell or 1 \"Polymerization\" from your Deck to your hand. During your End Phase: You can add 1 Level 8 or higher Dragon monster from your Deck to your hand. You can banish this card from your GY; all Level 8 or higher Dragon monsters you control gain 1000 ATK. You can only use each effect of \"Blue-Eyes Abyss Dragon\" once per turn, and can only activate them while \"Blue-Eyes White Dragon\" is on your field or in your GY.', 19, 164, 'https://images.ygoprodeck.com/images/cards/64202399.jpg', 1321, 1321, '2025-03-10 13:13:14', '2025-03-10 13:13:14'),
(64213017, 'Beetrooper Formation', 'Spell Card', 'Spell Card', 'spell', 'You can target 1 \"Beetrooper\" monster in your GY; Special Summon it, but it cannot attack this turn, also you lose LP equal to its original ATK. If a face-up Insect monster(s) you control is destroyed by battle or card effect: You can Special Summon 1 \"Beetrooper Token\" (Insect/EARTH/Level 3/ATK 1000/DEF 1000). You can only use each effect of \"Beetrooper Formation\" once per turn.', 10, 170, 'https://images.ygoprodeck.com/images/cards/64213017.jpg', 1059, 1059, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(64276752, 'Arc Rebellion Xyz Dragon', 'XYZ Monster', 'XYZ Monster', 'xyz', '3 Level 5 monsters\r\nThis Xyz Summoned card cannot be destroyed by card effects. You can detach 1 material from this card; this card gains ATK equal to the total original ATK of all other monsters on the field, then, if this card has a DARK Xyz Monster as material, negate the effects of all other face-up monsters on the field. After this effect resolves, you cannot declare attacks with other monsters for the rest of this turn. You can only use this effect of \"Arc Rebellion Xyz Dragon\" once per turn.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/64276752.jpg', 561, 561, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(64342551, 'Amphibious Bugroth MK-3', 'Effect Monster', 'Effect Monster', 'effect', 'While \"Umi\" is face-up on the field, this card can attack your opponent\'s Life Points directly.', 12, 7, 'https://images.ygoprodeck.com/images/cards/64342551.jpg', 378, 378, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(64428736, 'Alligator\'s Sword', 'Normal Monster', 'Normal Monster', 'normal', 'ey, dis mighty lissard man can swing his sword so fast, dat it\'s more dan da speed a sound!', 5, 50, 'https://images.ygoprodeck.com/images/cards/64428736.jpg', 230, 230, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(64437633, 'Aquamirror Illusion', 'Trap Card', 'Trap Card', 'trap', 'Special Summon 1 \"Gishki\" Ritual Monster from your hand. It cannot attack, and is returned to the hand during the End Phase.', 4, 98, 'https://images.ygoprodeck.com/images/cards/64437633.jpg', 552, 552, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(64454614, 'Arcana Extra Joker', 'Link Monster', 'Link Monster', 'link', '3 Warrior monsters with different names\r\nOnce per turn, when a Spell/Trap Card, or monster effect, is activated that targets this face-up card on the field or a monster this card points to (Quick Effect): You can discard the same type of card (Monster, Spell, or Trap); negate the activation. When this Link Summoned card is destroyed by battle and sent to the GY: You can Special Summon 1 Level 4 Warrior Normal Monster from your Deck, and if you do, add 1 Level 4 Warrior monster from your Deck to your hand.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/64454614.jpg', 563, 563, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(64591429, 'Astral Kuriboh', 'Effect Monster', 'Effect Monster', 'effect', 'You can reveal 1 \"Number\" Xyz Monster in your Extra Deck; Special Summon this card from your hand. If you do, this card\'s Level becomes the revealed monster\'s Rank, also while it is face-up in the Monster Zone, you cannot Special Summon monsters from the Extra Deck, except \"Number\" Xyz Monsters. You can only use this effect of \"Astral Kuriboh\" once per turn. A \"Number\" Xyz Monster that was Summoned using this card on the field as material gains this effect.\r\n● Cannot be destroyed by battle or your opponent\'s card effects.', 9, 85, 'https://images.ygoprodeck.com/images/cards/64591429.jpg', 781, 781, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(64603182, 'Ancient Gear Dark Golem', 'Effect Monster', 'Effect Monster', 'effect', 'This card\'s name becomes \"Ancient Gear Golem\" while on the field or in the GY. If this card is Normal or Special Summoned: You can add up to 2 cards (\"Ancient Gear\" cards and/or \"Geartown\") from your Deck to your hand, except \"Ancient Gear Dark Golem\", then discard 1 card, also you cannot Set cards for the rest of this turn. You can only use this effect of \"Ancient Gear Dark Golem\" once per turn. If this card attacks, your opponent cannot activate Spell/Trap Cards until the end of the Damage Step.', 12, 75, 'https://images.ygoprodeck.com/images/cards/64603182.jpg', 409, 409, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(64635042, 'Archfiend\'s Call', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nThis card\'s name becomes \"Summoned Skull\" on the field, but is still treated as an \"Archfiend\" card. Your opponent cannot target any \"Summoned Skull\" you control with card effects. If this Synchro Summoned card you control is sent to your GY by an opponent\'s card: You can Special Summon 1 \"Summoned Skull\" from your hand, Deck, or GY.', 9, 5, 'https://images.ygoprodeck.com/images/cards/64635042.jpg', 607, 607, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(64867422, '\"Infernoble Arms - Hauteclere\"', 'Spell Card', 'Spell Card', 'spell', 'While this card is equipped to a monster: You can target 1 face-up monster you control; this turn, you cannot declare attacks, except with that monster, also it gains the ability this turn to make a second attack during each Battle Phase, then destroy this card. If this card is sent to the GY because the equipped monster is sent to the GY: You can target 1 face-up monster on the field; destroy it. You can only use 1 \"\"Infernoble Arms - Hauteclere\"\" effect per turn, and only once that turn.', 3, 3, 'https://images.ygoprodeck.com/images/cards/64867422.jpg', 7, 7, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(64952266, 'Against the Wind', 'Spell Card', 'Spell Card', 'spell', 'Select 1 \"Blackwing\" monster in your Graveyard. Take damage equal to the ATK of the selected monster, and add it to your hand.', 4, 35, 'https://images.ygoprodeck.com/images/cards/64952266.jpg', 171, 171, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(64977888, 'Apprentice Piper', 'Flip Effect Monster', 'Flip Effect Monster', 'effect', 'FLIP: You can Special Summon 1 monster from your hand.\r\nIf this card is destroyed by battle or card effect and sent to the Graveyard: You can Special Summon 1 monster from your hand.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/64977888.jpg', 536, 536, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(65064143, 'Anti-Aircraft Flower', 'Effect Monster', 'Effect Monster', 'effect', 'By Tributing 1 Insect-Type monster on your side of the field, inflict 800 points of damage to your opponent\'s Life Points.', 21, 87, 'https://images.ygoprodeck.com/images/cards/65064143.jpg', 498, 498, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(65150219, 'Armor Ninjitsu Art of Freezing', 'Trap Card', 'Trap Card', 'trap', 'When an opponent\'s monster declares an attack, if you control a \"Ninja\" monster: You can flip this card face-up; negate that attack and end the Battle Phase. While this card is face-up on the field and you control a \"Ninja\" monster, monsters your opponent controls cannot change their battle positions.', 1, 38, 'https://images.ygoprodeck.com/images/cards/65150219.jpg', 674, 674, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(65169794, 'Black Pendant', 'Spell Card', 'Spell Card', 'spell', 'The equipped monster gains 500 ATK. When this card is sent from the field to the Graveyard: Inflict 500 damage to your opponent.', 3, NULL, 'https://images.ygoprodeck.com/images/cards/65169794.jpg', 1165, 1165, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(65172015, 'A-to-Z-Dragon Buster Cannon', 'Fusion Monster', 'Fusion Monster', 'fusion', '\"ABC-Dragon Buster\" + \"XYZ-Dragon Cannon\"\nMust be Special Summoned (from your Extra Deck) by banishing cards you control with the above original names, and cannot be Special Summoned by other ways. (You do not use \"Polymerization\".) During either player\'s turn, when your opponent activates a Spell/Trap Card, or monster effect: You can discard 1 card; negate the activation, and if you do, destroy that card. During either player\'s turn: You can banish this card, then target 1 each of your banished \"ABC-Dragon Buster\", and \"XYZ-Dragon Cannon\"; Special Summon them.', 12, 8, 'https://images.ygoprodeck.com/images/cards/65172015.jpg', 34, 34, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(65240384, 'Big Shield Gardna', 'Effect Monster', 'Effect Monster', 'effect', 'When a Spell Card is activated that targets this face-down card (and no other cards) (Quick Effect): Change this card to face-up Defense Position, and if you do, negate the activation. If this card is attacked, change it to Attack Position at the end of the Damage Step.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/65240384.jpg', 1114, 1114, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(65268179, 'Awakening of the Possessed - Nefariouser Archfiend', 'Effect Monster', 'Effect Monster', 'effect', 'You can Special Summon this card (from your hand or Deck) by sending 1 face-up Spellcaster monster and 1 face-up Level 4 or lower EARTH monster you control to the GY. You can only use each of the following effects of \"Awakening of the Possessed - Nefariouser Archfiend\" once per turn.\r\n● When this card is Special Summoned by its effect: You can Special Summon 1 Level 4 or lower monster from your GY, but negate its effects.\r\n● If this card is sent from the field to the GY: You can add 1 \"Spiritual Earth Art\" card or 1 \"Possessed\" Spell/Trap from your Deck to your hand.', 5, 143, 'https://images.ygoprodeck.com/images/cards/65268179.jpg', 829, 829, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(65301952, 'Alchemic Magician', 'XYZ Monster', 'XYZ Monster', 'xyz', '3 Level 4 Spellcaster-Type monsters\nThis card gains 200 ATK for each Spell Card in your Graveyard. Once per turn, during your End Phase: You can detach 1 Xyz Material from this card and send 1 card from your hand to the Graveyard; choose 1 Spell Card from your Deck, then Set it in your Spell & Trap Card Zone.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/65301952.jpg', 197, 197, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(65351555, 'Basiltrice, Familiar of the Evil Eye', 'Effect Monster', 'Effect Monster', 'effect', 'If you control an \"Evil Eye\" monster and this card is in your hand or GY (Quick Effect): You can Special Summon this card, but banish it when it leaves the field. During your opponent\'s turn, you can (Quick Effect): Immediately after this effect resolves, Link Summon 1 \"Evil Eye\" Link Monster using monsters you control as material. When you do, you can also use \"Evil Eye\" Equip Spells you control as \"Evil Eye\" monsters. You can only use each effect of \"Basiltrice, Familiar of the Evil Eye\" once per turn.', 9, 157, 'https://images.ygoprodeck.com/images/cards/65351555.jpg', 936, 936, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(65384019, 'Alchemy Cycle', 'Trap Card', 'Trap Card', 'trap', 'The original ATK of all face-up monsters you control becomes 0, until the End Phase. Each time a monster that had its original ATK reduced to 0 by this effect is destroyed by battle and sent to the Graveyard, draw 1 card.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/65384019.jpg', 199, 199, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(65430555, 'Beetrooper Sting Lancer', 'Effect Monster', 'Effect Monster', 'effect', 'During the Main Phase (Quick Effect): You can target 1 Insect monster in your GY and 1 monster in your opponent\'s GY; Special Summon this card from your hand, and if you do, place the targeted monsters on the bottoms of the Decks. If this card is Normal or Special Summoned: You can add 1 \"Beetrooper\" Spell/Trap from your Deck to your hand. You can only use each effect of \"Beetrooper Sting Lancer\" once per turn.', 7, 170, 'https://images.ygoprodeck.com/images/cards/65430555.jpg', 1065, 1065, '2025-03-10 13:13:08', '2025-03-10 13:13:08');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(65433790, 'Battle Royal Mode - Joining', 'Spell Card', 'Spell Card', 'spell', 'Activate this card by targeting 1 Effect Monster on the field. The first two times that monster would be destroyed by battle each turn, it is not destroyed. When it is destroyed by battle, the player that destroyed it gains 2000 LP. If the turn player\'s opponent takes battle or effect damage: Activate this effect; that opponent can apply the following effect.\r\n● Special Summon 1 Level 4 or lower monster from your hand or Deck, but lose 2000 LP.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/65433790.jpg', 961, 961, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(65446452, 'Aquarium Set', 'Spell Card', 'Spell Card', 'spell', 'All WATER monsters you control gain 300 ATK and DEF. All \"Aquaactress\" monsters you control gain 300 ATK and DEF. If this card is sent from the field to the Graveyard: You can target 1 Aqua-Type monster in your Graveyard; Special Summon it, also you cannot Special Summon monsters for the rest of this turn, except Aqua-Type monsters.', 1, 97, 'https://images.ygoprodeck.com/images/cards/65446452.jpg', 556, 556, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(65477143, 'Abyss Actor - Liberty Dramatist', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nWhen a monster declares an attack: You can discard 1 card; Special Summon this card to your opponent\'s field. You can only use this effect of \"Abyss Actor - Liberty Dramatist\" once per turn.\n\n[ Monster Effect ] \nIf this card is Special Summoned from the Pendulum Zone: The owner of this card reveals 3 \"Abyss Script\" Spells from their Deck, their opponent randomly picks 1 for this card\'s owner to Set on their field (but the owner destroys it during the End Phase), also shuffle the rest into the Deck. If this card is destroyed: You can shuffle 1 \"Abyss Script\" Spell from your GY into the Deck. You can only use each effect of \"Abyss Actor - Liberty Dramatist\" once per turn.', 9, 16, 'https://images.ygoprodeck.com/images/cards/65477143.jpg', 68, 68, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(65612386, 'Angmarl the Fiendish Monarch', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Tribute Summoned: You can banish 1 Spell Card from your Graveyard; add 1 card with the same name as the banished Spell Card from your Deck to your hand.', 9, 84, 'https://images.ygoprodeck.com/images/cards/65612386.jpg', 485, 485, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(65711558, 'Ancient Warriors Oath - Double Dragon Lords', 'Link Monster', 'Link Monster', 'link', '2 Beast-Warrior monsters, including a WIND \"Ancient Warriors\" monster\r\nAll \"Ancient Warriors\" monsters you control gain 500 ATK/DEF. You can only use each of the following effects of \"Ancient Warriors Oath - Double Dragon Lords\" once per turn. If this card is Link Summoned: You can add 1 \"Ancient Warriors\" card from your Deck to your hand. (Quick Effect): You can send 1 card from your hand or field to the GY, then target 1 face-up card your opponent controls; return it to the hand.', 15, 77, 'https://images.ygoprodeck.com/images/cards/65711558.jpg', 464, 464, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(65889305, 'Argostars - Lightning Tydeu', 'Trap Card', 'Trap Card', 'trap', 'While this card is face-up in the Spell & Trap Zone, Warrior monsters you control gain 500 ATK/DEF. Once per turn: You can discard 1 card; Special Summon this card as an Effect Monster (Warrior/LIGHT/Level 4/ATK 2000/DEF 2000) with the following effect (this card is also still a Trap), then you can add 1 \"Argostars\" card from your Deck to your hand, except \"Argostars - Lightning Tydeu\".\r\n● Once per turn (Quick Effect): You can place this card face-up in your Spell & Trap Zone.', 1, 105, 'https://images.ygoprodeck.com/images/cards/65889305.jpg', 624, 624, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(65899613, 'Battlewasp - Pin the Bullseye', 'Effect Monster', 'Effect Monster', 'effect', 'If you control an Insect monster: You can Special Summon this card from your hand. During your Main Phase: You can inflict 200 damage to your opponent for each \"Battlewasp - Pin the Bullseye\" you control. You can only use each effect of \"Battlewasp - Pin the Bullseye\" once per turn.', 7, 160, 'https://images.ygoprodeck.com/images/cards/65899613.jpg', 986, 986, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(65910922, 'Arionpos, Serpent of the Ghoti', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf this card is Synchro Summoned: You can banish 1 Level 6 or lower Fish monster from your Deck. If this card is sent to the GY as Synchro Material: You can target 1 Fish monster in your GY; banish that target, then you can add 1 Fish monster with an equal or lower Level from your Deck to your hand. You can only use each effect of \"Arionpos, Serpent of the Ghoti\" once per turn.', 8, 108, 'https://images.ygoprodeck.com/images/cards/65910922.jpg', 632, 632, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(66380357, 'Appliancer Test', 'Spell Card', 'Spell Card', 'spell', 'Target 1 \"Appliancer\" Link Monster you control; Special Summon as many Link-1 \"Appliancer\" monsters from your GY as possible to your zones that monster points to, but banish them during the End Phase. You can only activate 1 \"Appliancer Test\" per turn.', 4, 94, 'https://images.ygoprodeck.com/images/cards/66380357.jpg', 531, 531, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(66500065, 'Bi\'an, Earth of the Yang Zing', 'Effect Monster', 'Effect Monster', 'effect', 'When this card you control is destroyed by battle or card effect and sent to your Graveyard: You can Special Summon 1 \"Yang Zing\" monster from your Deck in Defense Position, except \"Bi\'an, Earth of the Yang Zing\". You can only use this effect of \"Bi\'an, Earth of the Yang Zing\" once per turn. Once per turn, during your opponent\'s Main Phase or Battle Phase, you can: Immediately after this effect resolves, Synchro Summon 1 Synchro Monster, using only \"Yang Zing\" monsters you control (this is a Quick Effect). A Synchro Monster that used this card as a Synchro Material cannot be destroyed by battle.', 25, 163, 'https://images.ygoprodeck.com/images/cards/66500065.jpg', 1099, 1099, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(66540884, 'Archfiend Heiress', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is sent to the Graveyard because of a card effect or being destroyed by battle: You can add 1 \"Archfiend\" card from your Deck to your hand, except \"Archfiend Heiress\". You can only use the effect of \"Archfiend Heiress\" once per turn.', 9, 5, 'https://images.ygoprodeck.com/images/cards/66540884.jpg', 596, 596, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(66668900, 'Aquaactress Guppy', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn: You can Special Summon 1 \"Aquaactress\" monster from your hand.', 6, 97, 'https://images.ygoprodeck.com/images/cards/66668900.jpg', 549, 549, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(66719533, 'Asymmetaphys', 'Spell Card', 'Spell Card', 'spell', 'Once per turn: You can banish 1 \"Metaphys\" card from your hand, and if you do, draw 1 card. Once per turn, if your \"Metaphys\" card in its owner\'s possession is banished: Apply this effect depending on whose turn it is.\r\n● Your turn: All monsters on the field lose 500 ATK/DEF, except \"Metaphys\" monsters.\r\n● Opponent\'s turn: Change the battle positions of all monsters on the field, except \"Metaphys\" monsters.', 1, 129, 'https://images.ygoprodeck.com/images/cards/66719533.jpg', 786, 786, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(66848311, 'Ashened for Eternity', 'Trap Card', 'Trap Card', 'trap', 'When this card is activated: You can add 1 \"Veidos the Eruption Dragon of Extinction\" or 1 \"Ashened\" monster from your GY to your hand. You can target 1 face-up monster your opponent controls that you own; take control of that monster, then you can make all face-up monsters your opponent currently controls lose ATK equal to the targeted monster\'s original ATK. This ATK change lasts until the end of this turn. You can only use this effect of \"Ashened for Eternity\" once per turn. You can only activate 1 \"Ashened for Eternity\" per turn.', 1, 124, 'https://images.ygoprodeck.com/images/cards/66848311.jpg', 747, 747, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(66984907, 'Amaze Attraction Cyclo-Coaster', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls; equip this card to it. You can activate the following effect, based on which player controls the equipped monster;\r\n● You: Target 1 Spell/Trap your opponent controls; send both it and this card to the GY.\r\n● Your opponent: Add 1 \"Amazement\" monster from your Deck to your hand, and if you do, send this card to the GY.\r\nYou can only use this effect of \"Amaze Attraction Cyclo-Coaster\" once per turn.', 4, 59, 'https://images.ygoprodeck.com/images/cards/66984907.jpg', 304, 304, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(67048711, '7', 'Spell Card', 'Spell Card', 'spell', 'When there are 3 face-up \"7\" cards on your side of the field, draw 3 cards from your Deck. Then destroy all \"7\" cards. When this card is sent directly from the field to your Graveyard, increase your Life Points by 700 points.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/67048711.jpg', 13, 13, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(67073561, 'Baba Barber', 'Link Monster', 'Link Monster', 'link', '2 monsters\r\nAt the start of each Battle Phase: You can target this card or 1 monster this card points to; banish it until the End Phase. You can only use this effect of \"Baba Barber\" once per turn.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/67073561.jpg', 858, 858, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(67159705, 'Armored Cybern', 'Union Effect Monster', 'Union Effect Monster', 'effect', 'Once per turn, you can either: Target 1 \"Cyber Dragon\" you control, or 1 Fusion Monster you control that lists \"Cyber Dragon\" as Fusion Material; equip this card to that target, OR: Unequip this card and Special Summon it. Once per turn, while equipped to a monster by this effect: You can target 1 face-up monster on the field; the equipped monster loses exactly 1000 ATK (even if this card leaves the field), and if it does, destroy that target. If the equipped monster would be destroyed by battle or card effect, destroy this card instead.', 12, 117, 'https://images.ygoprodeck.com/images/cards/67159705.jpg', 679, 679, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(67284108, 'Black Sheep Token', 'Token', 'Token', 'token', 'This card can be used as a \"Black Sheep Token\".\r\n\r\n\r\n*If used for another Token, apply that Token\'s Type/Attribute/Level/ATK/DEF.', 28, 182, 'https://images.ygoprodeck.com/images/cards/67284108.jpg', 1174, 1174, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(67314110, 'Amazement Attendant Comica', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can Set 1 \"Attraction\" Trap directly from your Deck. (Quick Effect): You can target 1 of your \"Attraction\" Traps equipped to a monster; equip it to 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls. You can only use this effect of \"Amazement Attendant Comica\" once per turn.', 12, 60, 'https://images.ygoprodeck.com/images/cards/67314110.jpg', 315, 315, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(67371383, 'Amphibian Beast', 'Normal Monster', 'Normal Monster', 'normal', 'On land or in the sea, the speed of this monster is unmatchable.', 8, NULL, 'https://images.ygoprodeck.com/images/cards/67371383.jpg', 375, 375, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(67381587, 'Black Cat-astrophe', 'Trap Card', 'Trap Card', 'trap', 'During your opponent\'s Battle Phase, if you control 2 or more face-down Defense Position monsters: End the Battle Phase. You can banish this card from your Graveyard, then target 2 face-up monsters on the field, including at least 1 \"Prediction Princess\" monster; change them to face-down Defense Position.', 4, 179, 'https://images.ygoprodeck.com/images/cards/67381587.jpg', 1143, 1143, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(67441879, 'Battlewasp Wind', 'Spell Card', 'Spell Card', 'spell', 'Twice per turn, if a \"Battlewasp\" monster(s) is Normal or Special Summoned to your field (except during the Damage Step): You can target 1 of them; add 1 \"Battlewasp\" monster with less ATK than that monster from your Deck to your hand. Once per turn: You can target 1 Insect monster you control with a Level; this turn, you can treat it as a Tuner if used as Synchro Material. You can only activate 1 \"Battlewasp Wind\" per turn.', 1, 160, 'https://images.ygoprodeck.com/images/cards/67441879.jpg', 991, 991, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
