(71187462, 'Blackwing - Vata the Emblem of Wandering', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control a \"Blackwing\" monster other than \"Blackwing - Vata the Emblem of Wandering\", you can Special Summon this card (from your hand). You can only Special Summon \"Blackwing - Vata the Emblem of Wandering\" once per turn this way. During your Main Phase: You can send this card on the field to the GY along with 1 or more non-Tuner \"Blackwing\" monsters from your Deck, so that the total Levels sent equal exactly 8, and if you do, Special Summon 1 \"Black-Winged Dragon\" from your Extra Deck, also you cannot Special Summon monsters from the Extra Deck for the rest of this turn, except DARK monsters. You can only use this effect of \"Blackwing - Vata the Emblem of Wandering\" once per turn.', 24, 35, 'https://images.ygoprodeck.com/images/cards/71187462.jpg', 1242, 1242, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(71209500, 'Amazoness Scouts', 'Effect Monster', 'Effect Monster', 'effect', 'During either player\'s turn: You can Tribute this card; this turn, face-up \"Amazoness\" monsters you currently control cannot be targeted by monster effects, and cannot be destroyed by card effects.', 14, 61, 'https://images.ygoprodeck.com/images/cards/71209500.jpg', 343, 343, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(71422989, 'Absorb Fusion', 'Spell Card', 'Spell Card', 'spell', 'Add 1 \"Gem-Knight\" card from your Deck to your hand, then you can apply this effect.\n● Fusion Summon 1 \"Gem-Knight\" Fusion Monster from your Extra Deck, by banishing Fusion Materials listed on it from your hand or your side of the field.\nYou can only activate 1 \"Absorb Fusion\" per turn. You cannot Special Summon monsters the turn you activate this card, except \"Gem-Knight\" monsters.', 4, 14, 'https://images.ygoprodeck.com/images/cards/71422989.jpg', 57, 57, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(71438011, 'Ally of Justice Thunder Armor', 'Effect Monster', 'Effect Monster', 'effect', 'This card cannot be Special Summoned. During the battle between an attacking \"Ally of Justice\" monster you control and a Defense Position monster whose DEF is lower than the ATK of the attacking monster, inflict the difference as Battle Damage to your opponent.', 12, 53, 'https://images.ygoprodeck.com/images/cards/71438011.jpg', 259, 259, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(71453557, 'Autonomous Action Unit', 'Spell Card', 'Spell Card', 'spell', 'Pay 1500 Life Points, then target 1 monster in your opponent\'s Graveyard; Special Summon that target to your side of the field in face-up Attack Position, and equip it with this card. When this card leaves the field, destroy the equipped monster.', 3, NULL, 'https://images.ygoprodeck.com/images/cards/71453557.jpg', 815, 815, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(71456737, 'Battlewasp - Sachi the Ceremonial Bow', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Insect Tuner + 1+ non-Tuner monsters\r\nIf this card is Synchro Summoned: You can treat it as a Tuner. Once per turn: You can return 1 Continuous Spell you control to the hand; you can Normal Summon 1 \"Battlewasp\" monster during your Main Phase this turn, in addition to your Normal Summon/Set. (You can only gain this effect once per turn.) If this card is sent to the GY as Synchro Material: You can inflict 100 damage to your opponent for each of your banished \"Battlewasp\" monsters. You can only use this effect of \"Battlewasp - Sachi the Ceremonial Bow\" once per turn.', 7, 160, 'https://images.ygoprodeck.com/images/cards/71456737.jpg', 988, 988, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(71620241, 'Advanced Crystal Beast Sapphire Pegasus', 'Effect Monster', 'Effect Monster', 'effect', 'If \"Advanced Dark\" is not in a Field Zone, send this monster to the GY. If this card is Summoned: You can place 1 of your \"Advanced Crystal Beast\" monsters that is banished, or in your hand, Deck, or GY, face-up in your Spell & Trap Zone as a Continuous Spell. If this face-up card is destroyed in a Monster Zone, you can place it face-up in your Spell & Trap Zone as a Continuous Spell, instead of sending it to the GY.', 5, 29, 'https://images.ygoprodeck.com/images/cards/71620241.jpg', 155, 155, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(71645242, 'Black Garden', 'Spell Card', 'Spell Card', 'spell', 'If a monster(s) is Normal or Special Summoned face-up, except by the effect of \"Black Garden\": Halve its ATK, then, the controller of that monster Special Summons 1 \"Rose Token\" (Plant/DARK/Level 2/ATK 800/DEF 800) to their opponent\'s field in Attack Position. (This ATK loss remains even if this card leaves the field.) You can target 1 monster in your GY with ATK equal to the total ATK of all Plant monsters on the field; destroy this card and as many Plant monsters on the field as possible, then, if you destroyed all of them, Special Summon that targeted monster.', 10, 178, 'https://images.ygoprodeck.com/images/cards/71645242.jpg', 1150, 1150, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(71652522, 'Battle Teleportation', 'Trap Card', 'Trap Card', 'trap', 'Activate if you control only 1 face-up Psychic-Type monster, and select that monster. It can attack your opponent directly this turn. At the end of the Battle Phase, give control of that monster to your opponent.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/71652522.jpg', 965, 965, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(71821687, 'Ascator, Dawnwalker', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard 1 card; Special Summon this card from your hand in Defense Position, then you can Special Summon 1 \"Fire Ant Ascator\" from your hand or Deck. You cannot Special Summon monsters from the Extra Deck the turn you activate this effect, except Synchro Monsters. You can only use this effect of \"Ascator, Dawnwalker\" once per turn.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/71821687.jpg', 742, 742, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(72076281, 'Bat', 'Normal Monster', 'Normal Monster', 'normal', '\'\'A mechanical bat that drops blasts from its wings.\'\'', 12, NULL, 'https://images.ygoprodeck.com/images/cards/72076281.jpg', 937, 937, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(72150572, 'Anti-Fusion Device', 'Trap Card', 'Trap Card', 'trap', 'Destroy 1 face-up Fusion Monster on the field.', 4, 87, 'https://images.ygoprodeck.com/images/cards/72150572.jpg', 499, 499, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(72278479, 'Black Return', 'Trap Card', 'Trap Card', 'trap', 'When exactly 1 \"Blackwing\" monster (and no other monster) is Special Summoned: Target 1 face-up monster your opponent controls; gain LP equal to the ATK of that target, and if you do, return it to the hand.', 4, 35, 'https://images.ygoprodeck.com/images/cards/72278479.jpg', 1169, 1169, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(72378329, 'Beast-Eyes Pendulum Dragon', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 DARK Dragon-Type monster + 1 Beast-Type monster\nMust be either Fusion Summoned, or Special Summoned by Tributing the above cards you control (in which case you do not use \"Polymerization\"), and cannot be Special Summoned by other ways. If this card destroys a monster by battle: Inflict damage to your opponent equal to the original ATK of the Beast-Type Fusion Material used for this card\'s Summon.', 19, 166, 'https://images.ygoprodeck.com/images/cards/72378329.jpg', 1033, 1033, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(72580321, 'Block Golem', 'Effect Monster', 'Effect Monster', 'effect', 'If all the monsters in your Graveyard are EARTH: You can Tribute this card to target 2 Level 4 or lower Rock-Type monsters in your Graveyard, except \"Block Golem\"; Special Summon those targets, but their effects that activate on the field cannot be activated this turn.', 17, NULL, 'https://images.ygoprodeck.com/images/cards/72580321.jpg', 1297, 1297, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(72714226, 'Assault Dog', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is destroyed by battle and sent to the Graveyard: You can Special Summon any number of \"Assault Dog\" from your Deck.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/72714226.jpg', 763, 763, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(72714392, 'Blackwing - Vayu the Emblem of Honor', 'Tuner Monster', 'Tuner Monster', 'effect', 'This face-up card on the field cannot be used as a Synchro Material. If this card is in the Graveyard: You can target 1 non-Tuner \"Blackwing\" monster in your Graveyard; banish both this card and that target, and if you do, Special Summon 1 \"Blackwing\" Synchro Monster from your Extra Deck whose Level equals the total Levels of the banished monsters, but its effects are negated.', 24, 35, 'https://images.ygoprodeck.com/images/cards/72714392.jpg', 1243, 1243, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(72843899, 'Advanced Crystal Beast Topaz Tiger', 'Effect Monster', 'Effect Monster', 'effect', 'If \"Advanced Dark\" is not in a Field Zone, send this monster to the GY. All \"Advanced Crystal Beast\" monsters you control gain 400 ATK/DEF, also monsters your opponent controls lose 400 ATK/DEF. If this face-up card is destroyed in a Monster Zone, you can place it face-up in your Spell & Trap Zone as a Continuous Spell, instead of sending it to the GY.', 5, 29, 'https://images.ygoprodeck.com/images/cards/72843899.jpg', 156, 156, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(72845813, 'Ally of Justice Quarantine', 'Effect Monster', 'Effect Monster', 'effect', 'Neither player can Special Summon LIGHT monsters.', 12, 53, 'https://images.ygoprodeck.com/images/cards/72845813.jpg', 254, 254, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(72930878, 'Black Sonic', 'Trap Card', 'Trap Card', 'trap', 'When an opponent\'s monster declares an attack on a \"Blackwing\" monster you control: Banish all face-up Attack Position monsters your opponent controls. If you control exactly 3 \"Blackwing\" monsters (and no other monsters), you can activate this card from your hand.', 4, 35, 'https://images.ygoprodeck.com/images/cards/72930878.jpg', 1176, 1176, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(72932673, 'Abyss-scale of the Mizuchi', 'Spell Card', 'Spell Card', 'spell', 'Equip only to a \"Mermail\" monster. It gains 800 ATK. When a Spell effect that was activated on your opponent\'s side of the field resolves, negate that effect, then send this card to the Graveyard.', 3, 20, 'https://images.ygoprodeck.com/images/cards/72932673.jpg', 97, 97, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(72957245, 'Adamancipator Signs', 'Spell Card', 'Spell Card', 'spell', 'Target 1 Rock monster in your GY; Special Summon it in Defense Position, then, if you Special Summoned an \"Adamancipator\" monster by this effect, you can take 1 Level 4 or lower Rock monster from your Deck and place it on top of your Deck.', 4, 28, 'https://images.ygoprodeck.com/images/cards/72957245.jpg', 141, 141, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(72989439, 'Black Luster Soldier - Envoy of the Beginning', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand) by banishing 1 LIGHT and 1 DARK monster from your GY. Once per turn, you can activate 1 of these effects.\r\n● Target 1 monster on the field; banish it. This card cannot attack the turn this effect is activated.\r\n● If this attacking card destroys an opponent\'s monster by battle: It can make a second attack in a row.', 14, 171, 'https://images.ygoprodeck.com/images/cards/72989439.jpg', 1156, 1156, '2025-03-10 13:13:10', '2025-03-10 13:13:10');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(73046708, 'Armored Xyz', 'Spell Card', 'Spell Card', 'spell', 'Target 1 face-up monster you control and 1 Xyz Monster in your GY; equip that monster from your GY to that monster on the field as an Equip Spell with these effects.\r\n● Change the equipped monster\'s ATK to this card\'s ATK.\r\n● The equipped monster gains this card\'s Attribute.\r\n● At the end of the Damage Step, if the equipped monster attacked: You can send this card to the GY; that attacking monster can make a second attack in a row.', 4, 118, 'https://images.ygoprodeck.com/images/cards/73046708.jpg', 687, 687, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(73079836, 'Adamancipator Risen - Raptite', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nDuring your Main Phase: You can excavate the top 5 cards of your Deck, and if you do, you can Special Summon 1 excavated Rock monster in Defense Position, also place the rest on the bottom of your Deck in any order. During your opponent\'s turn, if a WIND monster is in your GY (Quick Effect): You can target 1 card in your opponent\'s GY; banish it. You can only use each effect of \"Adamancipator Risen - Raptite\" once per turn.', 17, 28, 'https://images.ygoprodeck.com/images/cards/73079836.jpg', 139, 139, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(73167098, 'Aromalilith Magnolia', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 \"Aroma\" monster + 1 Plant monster\r\nWhile your LP are higher than your opponent\'s, Plant monsters you control cannot be destroyed by your opponent\'s card effects. Once per turn: You can pay 2000 LP; banish cards on the field equal to the number of \"Humid Winds\", \"Dried Winds\", and \"Blessed Winds\" you control. Once per turn, if you gain LP, even during the Damage Step: You can make all Plant monsters you currently control gain ATK equal to the LP gained, until the end of this turn.', 21, 121, 'https://images.ygoprodeck.com/images/cards/73167098.jpg', 708, 708, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(73218989, 'Black-Winged Assault Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner Synchro Monster + 1+ non-Tuner monsters\r\nMust be either Synchro Summoned, or Special Summoned from your Extra Deck by banishing 1 Tuner Synchro Monster and 1 \"Black-Winged Dragon\" from your face-up field and/or GY. Each time your opponent activates a monster effect, place 1 Black Feather Counter on this card when that effect resolves, and if you do, inflict 700 damage to your opponent. During your opponent\'s turn (Quick Effect): You can Tribute this card with 4 or more Black Feather Counters on it; destroy all cards on the field.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/73218989.jpg', 1183, 1183, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(73262676, '\"A\" Cell Scatter Burst', 'Spell Card', 'Spell Card', 'spell', 'Select 1 face-up \"Alien\" monster you control. Destroy it and distribute new A-Counters equal to its Level among your opponent\'s face-up monsters.', 2, 1, 'https://images.ygoprodeck.com/images/cards/73262676.jpg', 4, 4, '2025-03-10 13:12:50', '2025-03-10 13:12:50'),
(73304257, 'Alpha, the Master of Beasts', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand) while the total ATK of all monsters your opponent controls is more than that of all monsters you control. You can target any number of Beast, Beast-Warrior, and/or Winged Beast monsters you control; return them to the hand, then, return face-up monsters your opponent controls to the hand, equal to the number of cards you returned to the hand, also for the rest of this turn, \"Alpha, the Master of Beasts\" you control cannot attack directly. You can only use this effect of \"Alpha, the Master of Beasts\" once per turn.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/73304257.jpg', 268, 268, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(73333463, 'Armoroid', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Tribute Summoned by Tributing at least 1 \"roid\" monster: Banish all Spells and Traps on the field.', 12, 62, 'https://images.ygoprodeck.com/images/cards/73333463.jpg', 689, 689, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(73345237, 'Benghalancer the Resurgent', 'Link Monster', 'Link Monster', 'link', '2+ Plant monsters\r\nDuring the Main Phase (Quick Effect): You can target 1 Effect Monster your opponent controls; take damage equal to its ATK, and if you did take damage, return it to the hand. If this card is in your GY: You can banish 2 or more Link Monsters from your GY whose combined Link Ratings equal exactly 4; Special Summon this card, but banish it when it leaves the field. You can only use 1 \"Benghalancer the Resurgent\" effect per turn, and only once that turn.', 21, NULL, 'https://images.ygoprodeck.com/images/cards/73345237.jpg', 1078, 1078, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(73355951, 'Alpha Summon', 'Trap Card', 'Trap Card', 'trap', 'Target 1 of your banished monsters and 1 of your opponent\'s banished monsters; Special Summon your monster to your opponent\'s field, and if you do, Special Summon that opponent\'s monster to your field. You can only activate 1 \"Alpha Summon\" per turn.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/73355951.jpg', 265, 265, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(73356503, 'Barrier Statue of the Stormwinds', 'Effect Monster', 'Effect Monster', 'effect', 'No monsters can be Special Summoned, except for WIND monsters.', 24, NULL, 'https://images.ygoprodeck.com/images/cards/73356503.jpg', 929, 929, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(73391962, 'Azamina Mu Rcielago', 'Fusion Monster', 'Fusion Monster', 'fusion', '1 Illusion monster + 1 LIGHT Spellcaster monster\r\nMonsters your opponent controls lose 500 ATK/DEF for each \"Azamina\" monster you control. You can only use each of the following effects of \"Azamina Mu Rcielago\" once per turn. If this card is Fusion Summoned: You can add 1 \"Azamina\" or \"Sinful Spoils\" card from your Deck to your hand. If this card is destroyed by battle or card effect: You can add 1 \"Sinful Spoils\" Spell from your Deck to your hand.', 36, 144, 'https://images.ygoprodeck.com/images/cards/73391962.jpg', 844, 844, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(73534250, 'Blackwing - Tornado the Reverse Wind', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned while your opponent controls a Special Summoned monster: You can target 1 \"Blackwing\" Tuner in your Graveyard; you cannot Special Summon monsters from the Extra Deck for the rest of this turn, except \"Blackwing\" monsters, also Special Summon that monster, but its effects are negated.', 24, 35, 'https://images.ygoprodeck.com/images/cards/73534250.jpg', 1240, 1240, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(73574678, 'Amazoness Blowpiper', 'Effect Monster', 'Effect Monster', 'effect', 'Select 1 face-up monster your opponent controls during each of your Standby Phases. It loses 500 ATK until the end of this turn.', 14, 61, 'https://images.ygoprodeck.com/images/cards/73574678.jpg', 326, 326, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(73580471, 'Black Rose Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nWhen this card is Synchro Summoned: You can destroy all cards on the field. Once per turn: You can banish 1 Plant monster from your GY, then target 1 Defense Position monster your opponent controls; change that target to face-up Attack Position, and if you do, its ATK becomes 0 until the end of this turn.', 19, 178, 'https://images.ygoprodeck.com/images/cards/73580471.jpg', 1170, 1170, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(73602965, 'Arias the Labrynth Butler', 'Effect Monster', 'Effect Monster', 'effect', 'During the Main Phase (Quick Effect): You can send this card from your hand or field to the GY; Special Summon 1 \"Labrynth\" monster, or Set 1 Normal Trap, from your hand. The Set Normal Trap can be activated this turn. When your opponent activates a card or effect in response to your card or effect activation of a Normal Trap or a \"Labrynth\" card, except \"Arias the Labrynth Butler\" (Quick Effect): You can activate this effect in the GY; Special Summon this card. You can only use each effect of \"Arias the Labrynth Butler\" once per turn.', 9, 106, 'https://images.ygoprodeck.com/images/cards/73602965.jpg', 630, 630, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(73652465, 'Blackwing - Oroshi the Squall', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control a \"Blackwing\" monster other than \"Blackwing - Oroshi the Squall\", you can Special Summon this card (from your hand). You can only Special Summon \"Blackwing - Oroshi the Squall\" once per turn this way. If this card is sent to the GY as a Synchro Material: You can target 1 monster on the field; change that target\'s battle position.', 24, 35, 'https://images.ygoprodeck.com/images/cards/73652465.jpg', 1230, 1230, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(73879377, 'Armed Dragon LV7', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must be Special Summoned by \"Armed Dragon LV5\". You can send 1 monster from your hand to the GY; destroy all monsters your opponent controls with ATK less than or equal to that sent monster\'s ATK.', 19, 111, 'https://images.ygoprodeck.com/images/cards/73879377.jpg', 652, 652, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(73979030, 'Angraecum Umbrella', 'Tuner Monster', 'Tuner Monster', 'effect', 'When this card is Normal Summoned: You can discard 1 card, then target 1 Level 4 or lower monster in your GY; Special Summon it in Defense Position, but negate its effects, also for the rest of this turn, you cannot Special Summon monsters from the Extra Deck, except Synchro Monsters.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/73979030.jpg', 486, 486, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(74130411, 'Biofalcon', 'Effect Monster', 'Effect Monster', 'effect', 'When a Machine-Type monster you control is destroyed by battle and sent to the Graveyard while this card is face-up on the field, you can add 1 Machine-Type monster with 1000 or less ATK from your Deck to your hand.', 12, NULL, 'https://images.ygoprodeck.com/images/cards/74130411.jpg', 1128, 1128, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(74213995, 'Battleguard Echoes', 'Spell Card', 'Spell Card', 'spell', 'When this card is activated: You can add 1 Level 5 EARTH Warrior monster from your Deck to your hand, then discard 1 card. Once per turn, if a monster(s) is returned from the field to the hand, even during the Damage Step: You can activate 1 of these effects;\r\n● Add 1 \"Battleguard Rage\" or \"Battleguard Howling\" from your Deck to your hand.\r\n● Change 1 face-up monster on the field to face-down Defense Position.\r\nYou can only activate 1 \"Battleguard Echoes\" per turn.', 1, 159, 'https://images.ygoprodeck.com/images/cards/74213995.jpg', 973, 973, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(74311226, 'Atlantean Dragoons', 'Effect Monster', 'Effect Monster', 'effect', 'All Level 3 or lower Sea Serpent-Type monsters you control can attack your opponent directly. When this card is sent to the Graveyard to activate a WATER monster\'s effect: Add 1 Sea Serpent-Type monster from your Deck to your hand, except \"Atlantean Dragoons\".', 20, 131, 'https://images.ygoprodeck.com/images/cards/74311226.jpg', 790, 790, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
