(77972406, 'Ambush Fangs', 'Trap Card', 'Trap Card', 'trap', 'Activate only when a face-up \"Venom\" monster you control is declared as an attack target. Negate the attack and end the Battle Phase. Then place 1 Venom Counter on the monster that attacked.', 4, 63, 'https://images.ygoprodeck.com/images/cards/77972406.jpg', 359, 359, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(78121572, 'Alchemist of Black Spells', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, you can change this face-up Attack Position card you control to face-up Defense Position and place 1 Spell Counter on a face-up card you control that you can place a Spell Counter on.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/78121572.jpg', 198, 198, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(78225596, 'Appliancer Celtopus', 'Link Monster', 'Link Monster', 'link', '2 \"Appliancer\" monsters\r\nThis linked card cannot be targeted by your opponent\'s card effects, or their monsters\' attacks. During damage calculation, if an \"Appliancer\" Link Monster you control co-linked to this card battles an opponent\'s monster: Your battling monster gains ATK equal to the number of monsters co-linked to this card x 1000, during that damage calculation only. Once per turn, if an \"Appliancer\" Link Monster(s) you control that is not co-linked to this card is destroyed by battle or card effect: You can draw 1 card.', 12, 94, 'https://images.ygoprodeck.com/images/cards/78225596.jpg', 521, 521, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(78310590, 'Abyss Actor - Mellow Madonna', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nYou can pay 1000 LP; add 1 \"Abyss Actor\" Pendulum Monster from your Deck to your hand, except \"Abyss Actor - Mellow Madonna\", also you cannot Special Summon monsters for the rest of this turn, except \"Abyss Actor\" Pendulum Monsters (even if this card leaves the field). You can only use this effect of \"Abyss Actor - Mellow Madonna\" once per turn.\n\n[ Monster Effect ] \nGains 100 ATK for each \"Abyss Script\" Spell in your GY. You can only use each of the following effects of \"Abyss Actor - Mellow Madonna\" once per turn.\r\n● When a Pendulum Monster you control is destroyed by battle: You can Special Summon this card from your hand.\r\n● If an \"Abyss Script\" Spell Card or effect is activated: You can Special Summon 1 Level 4 or lower \"Abyss Actor\" Pendulum Monster from your Deck, but return it to the hand during the End Phase.', 9, 16, 'https://images.ygoprodeck.com/images/cards/78310590.jpg', 69, 69, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(78447174, 'Appliancer Socketroll', 'Effect Monster', 'Effect Monster', 'effect', 'If you control an \"Appliancer\" monster: You can Special Summon this card from your hand. If another \"Appliancer Socketroll\" is Special Summoned to your field while you control this monster (except during the Damage Step): You can Special Summon 1 \"Appliancer Socketroll\" from your Deck. You can only use each effect of \"Appliancer Socketroll\" once per turn.', 12, 94, 'https://images.ygoprodeck.com/images/cards/78447174.jpg', 530, 530, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(78509901, 'Blade Garoodia the Cubic Beast', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must first be Special Summoned (from your hand) by sending 2 \"Cubic\" monsters you control to the Graveyard. If Summoned this way, this card gains 2000 ATK. This card can make a second attack during each Battle Phase. When this card destroys a monster by battle: You can target up to 3 \"Vijam the Cubic Seed\" in your Graveyard; send this card to the Graveyard, and if you do, Special Summon them, then you can add 1 \"Buster Gundil the Cubic Behemoth\" from your Deck to your hand.', 5, 185, 'https://images.ygoprodeck.com/images/cards/78509901.jpg', 1252, 1252, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(78564023, 'Blackwing - Etesian of Two Swords', 'Effect Monster', 'Effect Monster', 'effect', 'If a \"Blackwing\" monster you control battles an opponent\'s monster, and your opponent still controls that monster at the end of the Damage Step: You can send this card from your hand to the Graveyard; inflict 1000 damage to your opponent.', 24, 35, 'https://images.ygoprodeck.com/images/cards/78564023.jpg', 1211, 1211, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(78621186, 'Battleguard Howling', 'Trap Card', 'Trap Card', 'trap', 'When a Warrior monster you control is targeted for an attack, or by an opponent\'s monster effect: Target 1 face-up monster your opponent controls; inflict damage to your opponent equal to the original ATK of the face-up monster you targeted with this card, and if you do, return it to the hand.', 4, 159, 'https://images.ygoprodeck.com/images/cards/78621186.jpg', 974, 974, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(78651105, 'Beast King Barbaros', 'Effect Monster', 'Effect Monster', 'effect', 'You can Normal Summon/Set this card without Tributing, but its original ATK becomes 1900. You can Tribute 3 monsters to Tribute Summon (but not Set) this card. If Summoned this way: Destroy all cards your opponent controls.', 15, 165, 'https://images.ygoprodeck.com/images/cards/78651105.jpg', 1022, 1022, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(78665705, 'Ancient Chant', 'Spell Card', 'Spell Card', 'spell', 'Add 1 \"The Winged Dragon of Ra\" from your Deck or GY to your hand, and if you do, you can Tribute Summon 1 monster during your Main Phase this turn, in addition to your Normal Summon/Set. (You can only gain this effect once per turn.) You can banish this card from your GY: If you Tribute Summon \"The Winged Dragon of Ra\" this turn, its original ATK/DEF become the combined original ATK/DEF of the monsters Tributed for its Summon. You can only activate 1 \"Ancient Chant\" per turn.', 4, 71, 'https://images.ygoprodeck.com/images/cards/78665705.jpg', 390, 390, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(78783370, 'Barrel Behind the Door', 'Trap Card', 'Trap Card', 'trap', 'Activate only when a card\'s effect that would inflict damage to you is activated. Your opponent takes the damage instead.', 23, NULL, 'https://images.ygoprodeck.com/images/cards/78783370.jpg', 918, 918, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(78910579, 'Aquamirror Cycle', 'Trap Card', 'Trap Card', 'trap', 'Target 1 WATER monster you control and 2 WATER monsters in your Graveyard; shuffle the first target into the Deck, and if you do, add the second targets to your hand.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/78910579.jpg', 551, 551, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(79016563, 'Binary Sorceress', 'Link Monster', 'Link Monster', 'link', '2 monsters, except Tokens\r\nThis card gains these effects based on the number of monsters co-linked to this card.\r\n● 1+: When a monster co-linked to this card battles your opponent\'s monster and inflicts battle damage to them: You can gain that much LP.\r\n● 2: Once per turn (Quick Effect): You can target 2 face-up monsters you control; until the end of this turn, halve the ATK of 1 monster, and if you do, add that lost ATK to the other monster.', 22, NULL, 'https://images.ygoprodeck.com/images/cards/79016563.jpg', 1122, 1122, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(79155167, 'Armor Blast', 'Spell Card', 'Spell Card', 'spell', 'Target 1 face-up \"Inzektor\" card you control and 2 face-up cards your opponent controls; destroy them.', 4, 115, 'https://images.ygoprodeck.com/images/cards/79155167.jpg', 668, 668, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(79206750, 'Abyss-scorn', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Mermail\" monster you control; it gains 1000 ATK until the End Phase. When this Set card is sent to the Graveyard: Target 1 monster your opponent controls; send that target to the Graveyard.', 4, 20, 'https://images.ygoprodeck.com/images/cards/79206750.jpg', 98, 98, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(79409334, 'Black Stego', 'Effect Monster', 'Effect Monster', 'effect', 'If this Attack Position card is targeted for an attack: Change this card to Defense Position.', 16, NULL, 'https://images.ygoprodeck.com/images/cards/79409334.jpg', 1177, 1177, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(79418928, 'Beta The Electromagnet Warrior', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is Normal or Special Summoned: You can add 1 Level 4 or lower \"Magnet Warrior\" monster from your Deck to your hand, except \"Beta The Electromagnet Warrior\". You can only use this effect of \"Beta The Electromagnet Warrior\" once per turn. During your opponent\'s turn: You can Tribute this card; Special Summon 1 Level 4 \"Magnet Warrior\" monster from your Deck (this is a Quick Effect).', 17, 55, 'https://images.ygoprodeck.com/images/cards/79418928.jpg', 1093, 1093, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(79480466, 'Bazoo the Soul Eater Beast', 'XYZ Monster', 'XYZ Monster', 'xyz', '3 Level 4 monsters\r\nAny Xyz Material detached from a monster is banished instead of being sent to the GY. Once per Chain, if a Monster Card(s) is sent to the GY (except during the Damage Step): You can detach 1 material from this card. If the last material(s) is detached from this card (except during the Damage Step): You can target up to 3 cards in the GY(s); attach them to this card as material.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/79480466.jpg', 1014, 1014, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(79582540, 'Ancient Warriors - Savage Don Ying', 'Effect Monster', 'Effect Monster', 'effect', 'While you control a Level 7 or higher \"Ancient Warriors\" monster, your opponent must pay 400 LP to activate a card or effect. You can only use each of the following effects of \"Ancient Warriors - Savage Don Ying\" once per turn. If this card is Normal or Special Summoned: You can add 1 Level 7 or higher \"Ancient Warriors\" monster or 1 \"Ancient Warriors\" Continuous Spell/Trap from your Deck to your hand. If a monster is sent to your opponent\'s GY (except during the Damage Step): You can target 1 card in your opponent\'s GY; banish it, and if you do, draw 1 card.', 15, 77, 'https://images.ygoprodeck.com/images/cards/79582540.jpg', 461, 461, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(79636594, 'Block Spider', 'Effect Monster', 'Effect Monster', 'effect', 'Your opponent cannot target Insect-Type monsters for attacks, except this one. If this card is Special Summoned: You can Special Summon 1 \"Block Spider\" from your Deck. You can only use this effect of \"Block Spider\" once per turn.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/79636594.jpg', 1298, 1298, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(79649195, 'Armor Break', 'Trap Card', 'Trap Card', 'trap', 'Negate the activation of an Equip Spell Card and destroy it.', 23, NULL, 'https://images.ygoprodeck.com/images/cards/79649195.jpg', 669, 669, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(79656239, 'Aromaseraphy Sweet Marjoram', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nWhile your LP are higher than your opponent\'s, your opponent cannot target Plant monsters you control with card effects. You can only use each of the following effects of \"Aromaseraphy Sweet Marjoram\" once per turn.\r\n● If this card is Synchro Summoned: You can add 1 \"Humid Winds\", \"Dried Winds\", or \"Blessed Winds\" from your Deck to your hand.\r\n● If you gain LP: Target 1 card your opponent controls; destroy it.', 21, 121, 'https://images.ygoprodeck.com/images/cards/79656239.jpg', 714, 714, '2025-03-10 13:13:02', '2025-03-10 13:13:02');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(79794767, 'Amorphage Wrath', 'Pendulum Effect Monster', 'Pendulum Effect Monster', 'effect_pendulum', '[ Pendulum Effect ] \nWhile you control an \"Amorphage\" monster, neither player can Tribute monsters, except \"Amorphage\" monsters. Once per turn, during your Standby Phase, Tribute 1 monster or destroy this card.\n\n[ Monster Effect ] \nIf this card is Pendulum Summoned or flipped face-up, neither player can Special Summon monsters from the Extra Deck while this card is face-up on the field, except \"Amorphage\" monsters.', 19, 67, 'https://images.ygoprodeck.com/images/cards/79794767.jpg', 373, 373, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(79867938, 'Battlin\' Boxer Headgeared', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can send 1 \"Battlin\' Boxer\" monster from your Deck to the Graveyard. Once per turn, this face-up Attack Position card cannot be destroyed by battle.', 14, 161, 'https://images.ygoprodeck.com/images/cards/79867938.jpg', 997, 997, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(79875526, 'Attachment Cybern', 'Effect Monster', 'Effect Monster', 'effect', 'You can target 1 Dragon or Machine \"Cyber\" monster you control; equip this card from your hand or field to it. While this card is an Equip Card, the equipped monster gains 600 ATK. If this card is sent to the GY while equipped to a monster: You can target 1 other Dragon or Machine \"Cyber\" monster in your GY; Special Summon it. You can only use this effect of \"Attachment Cybern\" once per turn.', 19, 133, 'https://images.ygoprodeck.com/images/cards/79875526.jpg', 796, 796, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(79965360, 'Amazoness Heirloom', 'Spell Card', 'Spell Card', 'spell', 'Equip only to an \"Amazoness\" monster. Once per turn, that monster cannot be destroyed by battle. After damage calculation, if the equipped monster attacks a monster: Destroy the attacked monster.', 3, 61, 'https://images.ygoprodeck.com/images/cards/79965360.jpg', 334, 334, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(80045583, 'Ancient Gear Cannon', 'Effect Monster', 'Effect Monster', 'effect', 'You can Tribute this card; inflict 500 damage to your opponent, and if you do, neither player can activate Trap Cards during the Battle Phase of this turn.', 12, 75, 'https://images.ygoprodeck.com/images/cards/80045583.jpg', 405, 405, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(80088625, 'Binary Blader', 'Link Monster', 'Link Monster', 'link', '2 Normal Monsters\r\nThis card gains these effects based on the number of monsters co-linked to this card.\r\n● 1+: When this card declares an attack on an opponent\'s monster: You can activate this effect; this card can make a second attack during each Battle Phase this turn, also if this card battles an opponent\'s monster this turn, that opponent\'s monster cannot be destroyed by that battle.\r\n● 2: After damage calculation, if this card battled an opponent\'s monster: You can banish that opponent\'s monster.', 22, NULL, 'https://images.ygoprodeck.com/images/cards/80088625.jpg', 1121, 1121, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(80141055, 'Bearblocker', 'Effect Monster', 'Effect Monster', 'effect', 'During your opponent\'s turn, Set cards in your Spell & Trap Zones cannot be destroyed by card effects. If a Set card(s) in your Spell & Trap Zone is destroyed by an opponent\'s card effect: This card gains 800 ATK until the end of this turn.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/80141055.jpg', 1019, 1019, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(80143954, 'Altergeist Camouflage', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Altergeist\" monster you control; equip this card to it. Your opponent cannot target it for attacks, but it does not prevent your opponent from attacking you directly. Negate an opponent\'s monster effect that activates by targeting the equipped monster. If an \"Altergeist\" card(s) you control would be destroyed by battle or card effect, you can banish this card from your GY instead.', 4, 57, 'https://images.ygoprodeck.com/images/cards/80143954.jpg', 272, 272, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(80237445, 'Artifact Mjollnir', 'Effect Monster', 'Effect Monster', 'effect', 'You can Set this card from your hand to your Spell & Trap Zone as a Spell. During your opponent\'s turn, if this Set card in the Spell & Trap Zone is destroyed and sent to your GY: Special Summon it. If this card is Special Summoned during your opponent\'s turn: Target 1 \"Artifact\" monster in your GY; Special Summon it in Defense Position, also you cannot Special Summon monsters until the end of the next turn, except \"Artifact\" monsters. You can only use this effect of \"Artifact Mjollnir\" once per turn.', 18, 123, 'https://images.ygoprodeck.com/images/cards/80237445.jpg', 734, 734, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
(80250185, 'Autorokket Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'When a Link Monster\'s effect is activated that targets this face-up card on the field (Quick Effect): You can destroy this card, then send 1 Spell/Trap on the field to the GY. During the End Phase, if this card is in the GY because it was destroyed on the field by battle or card effect and sent there this turn: You can Special Summon 1 \"Rokket\" monster from your Deck, except \"Autorokket Dragon\". You can only use each effect of \"Autorokket Dragon\" once per turn.', 19, 15, 'https://images.ygoprodeck.com/images/cards/80250185.jpg', 816, 816, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(80254726, 'Blackbird Close', 'Trap Card', 'Trap Card', 'trap', 'When a monster your opponent controls activates its effect: You can send 1 face-up \"Blackwing\" monster you control to the GY; negate the activation, and if you do, destroy it, then, you can Special Summon 1 \"Black-Winged Dragon\" from your Extra Deck. If you control a \"Blackwing\" Synchro Monster or \"Black-Winged Dragon\", you can activate this card from your hand.', 23, 35, 'https://images.ygoprodeck.com/images/cards/80254726.jpg', 1188, 1188, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(80280737, 'Assault Mode Activate', 'Trap Card', 'Trap Card', 'trap', 'Tribute 1 Synchro Monster; Special Summon 1 \"/Assault Mode\" monster, whose name includes the Tributed monster\'s name, from your Deck in Attack Position.', 4, 103, 'https://images.ygoprodeck.com/images/cards/80280737.jpg', 765, 765, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(80447641, 'Bat, the Forest Ninja', 'Tuner Monster', 'Tuner Monster', 'effect', 'If a face-up card is in a Field Zone, you can Special Summon this card (from your hand). You can only Special Summon \"Bat, the Forest Ninja\" once per turn this way. If this card is Normal or Special Summoned and \"Fairy Tale Prologue: Journey\'s Dawn\" is on your field or in your GY: You can add 1 LIGHT Beast monster from your Deck to your hand. You can only use this effect of \"Bat, the Forest Ninja\" once per turn.', 5, 38, 'https://images.ygoprodeck.com/images/cards/80447641.jpg', 938, 938, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(80570228, 'Anarchist Monk of the Six Samurai', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control a \"Six Samurai\" monster other than \"Anarchist Monk of the Six Samurai\", you can Special Summon this card (from your hand). You can only Special Summon \"Anarchist Monk of the Six Samurai\" once per turn this way. You can only use each of the following effects of \"Anarchist Monk of the Six Samurai\" once per turn. If this card is sent from the field to the GY: You can add 1 \"Six Samurai\" Quick-Play Spell from your Deck to your hand. A \"Six Samurai\" monster that was Synchro Summoned using this card gains this effect.\r\n● The Levels of all monsters your opponent controls are reduced by 1.', 14, 70, 'https://images.ygoprodeck.com/images/cards/80570228.jpg', 386, 386, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(80584548, 'Ballista Squad', 'Trap Card', 'Trap Card', 'trap', 'Tribute 1 monster, then target 1 card your opponent controls; destroy it.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/80584548.jpg', 896, 896, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(80773359, 'Assault Blackwing - Onimaru the Divine Thunder', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\nIf this card is Synchro Summoned using a \"Blackwing\" monster as Material, it is treated as a Tuner while face-up on the field. Cannot be destroyed by card effects. You can target 1 \"Blackwing\" monster in your Graveyard; this card\'s Level becomes the same as that monster\'s. You can only use this effect of \"Assault Blackwing - Onimaru the Divine Thunder\" once per Duel. If this card that was Synchro Summoned using only Synchro Monsters attacks, this card gains 3000 ATK during the Damage Step only.', 24, 35, 'https://images.ygoprodeck.com/images/cards/80773359.jpg', 758, 758, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(80801743, 'Abominable Chamber of the Unchained', 'Trap Card', 'Trap Card', 'trap', 'Special Summon 1 \"Unchained\" monster from your hand or GY. If this Set card is destroyed by card effect: You can Special Summon 1 \"Unchained\" monster from your Deck. You can only use each effect of \"Abominable Chamber of the Unchained\" once per turn.', 4, 12, 'https://images.ygoprodeck.com/images/cards/80801743.jpg', 49, 49, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(80949182, 'Battlewasp - Hama the Conquering Bow', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nIf this card was Synchro Summoned using a Synchro Monster as material, it can make a second attack during each Battle Phase. You can only use each of the following effects of \"Battlewasp - Hama the Conquering Bow\" once per turn.\r\n● When this card inflicts battle damage to your opponent: You can make all monsters your opponent currently controls lose 1000 ATK/DEF.\r\n● At the end of your Battle Phase, if your opponent has not taken any battle damage this Phase: You can inflict 300 damage to your opponent for each \"Battlewasp\" monster in your GY.', 7, 160, 'https://images.ygoprodeck.com/images/cards/80949182.jpg', 984, 984, '2025-03-10 13:13:07', '2025-03-10 13:13:07'),
(80993256, 'Ashura King', 'XYZ Monster', 'XYZ Monster', 'xyz', '3+ Level 3 monsters\r\nWhile this card has material, it can attack a number of times each Battle Phase, up to the number of materials attached to it. At the start of the Damage Step, if this card battles: It gains 200 ATK. When another monster\'s effect is activated (Quick Effect): You can detach 1 material from this card; negate the activation, and if you do, destroy that card. You can only use this effect of \"Ashura King\" once per turn.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/80993256.jpg', 750, 750, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(81105204, 'Blackwing - Kris the Crack of Dawn', 'Effect Monster', 'Effect Monster', 'effect', 'If you control a \"Blackwing\" monster other than \"Blackwing - Kris the Crack of Dawn\", you can Special Summon this card (from your hand). You can only Special Summon \"Blackwing - Kris the Crack of Dawn\" once per turn this way. Once per turn, this card cannot be destroyed by Spell/Trap effects.', 24, 35, 'https://images.ygoprodeck.com/images/cards/81105204.jpg', 1227, 1227, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(81269231, 'Ancient Gear Hydra', 'Effect Monster', 'Effect Monster', 'effect', 'At the end of the Damage Step, when this card that was Tribute Summoned by Tributing an \"Ancient Gear\" monster battles an opponent\'s monster, but the opponent\'s monster was not destroyed by the battle: You can banish that opponent\'s monster. If this card was Tribute Summoned by Tributing a \"Gadget\" monster, it can attack all monsters your opponent controls, once each. If an \"Ancient Gear\" monster you control attacks, your opponent\'s Spell/Trap Cards and monster effects cannot be activated until the end of the Damage Step.', 12, 75, 'https://images.ygoprodeck.com/images/cards/81269231.jpg', 427, 427, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
