(81344637, 'Basilius, Familiar of the Evil Eye', 'Effect Monster', 'Effect Monster', 'effect', 'If you control an \"Evil Eye\" monster, you can Special Summon this card (from your hand). You can only Special Summon \"Basilius, Familiar of the Evil Eye\" once per turn this way. During your Main Phase: You can send 1 \"Evil Eye\" Spell/Trap from your Deck to the GY. You can only use this effect of \"Basilius, Familiar of the Evil Eye\" once per turn.', 9, 157, 'https://images.ygoprodeck.com/images/cards/81344637.jpg', 935, 935, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
