(84815190, 'Baronne de Fleur', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1+ non-Tuner monsters\r\nOnce per turn: You can target 1 card on the field; destroy it. Once while face-up on the field, when a card or effect is activated (Quick Effect): You can negate the activation, and if you do, destroy that card. You can only use the previous effect of \"Baronne de Fleur\" once per turn. Once per turn, during the Standby Phase: You can target 1 Level 9 or lower monster in your GY; return this card to the Extra Deck, and if you do, Special Summon that monster.', 14, 152, 'https://images.ygoprodeck.com/images/cards/84815190.jpg', 915, 915, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(84845628, 'Bird of Paradise Lost', 'Tuner Monster', 'Tuner Monster', 'effect', 'This card gains 100 ATK and DEF for each Tuner monster in your Graveyard. Once per turn: You can send 1 Tuner monster from your hand to the Graveyard, then target 1 monster your opponent controls; take control of it until the End Phase.', 25, NULL, 'https://images.ygoprodeck.com/images/cards/84845628.jpg', 1129, 1129, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
