(84976088, 'Background Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is in the GY and you control no cards: You can Special Summon both this card, and 1 Level 4 or lower Dragon monster from your hand, in Defense Position, but banish this card when it leaves the field. You can only use this effect of \"Background Dragon\" once per turn.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/84976088.jpg', 872, 872, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
