(85914562, 'Adamancipator Researcher', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control a Rock monster, except \"Adamancipator Researcher\": You can Special Summon this card from your hand. During your Main Phase: You can excavate the top 5 cards of your Deck, and if you do, you can Special Summon 1 excavated Level 4 or lower non-Tuner Rock monster, also place the rest on the bottom of your Deck in any order. You can only use each effect of \"Adamancipator Researcher\" once per turn.', 17, 28, 'https://images.ygoprodeck.com/images/cards/85914562.jpg', 135, 135, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
