(86377375, 'Ahrima, the Wicked Warden', 'Effect Monster', 'Effect Monster', 'effect', 'You can discard this card; add 1 \"Lair of Darkness\" from your Deck to your hand. You can Tribute 1 DARK monster; draw 1 card, or, if you Tributed a DARK monster other than this card to activate this effect, you can add 1 DARK monster with 2000 or more DEF from your Deck to your hand, instead. You can only use this effect of \"Ahrima, the Wicked Warden\" once per turn.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/86377375.jpg', 177, 177, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
