(86758746, 'Amazoness Secret Arts', 'Spell Card', 'Spell Card', 'spell', 'Fusion Summon 1 \"Amazoness\" Fusion Monster from your Extra Deck, using monsters from your hand or field as Fusion Material. During your Main Phase: You can banish this card from your GY; once, if you Fusion Summon an \"Amazoness\" Fusion Monster this turn, you can also send 1 \"Amazoness\" monster from your Extra Deck to the GY as material. You can only use 1 \"Amazoness Secret Arts\" effect per turn, and only once that turn.', 2, 61, 'https://images.ygoprodeck.com/images/cards/86758746.jpg', 344, 344, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
