(92053608, 'Aquaactress Arowana', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn: You can add 1 \"Aquaactress\" monster from your Deck to your hand.', 6, 97, 'https://images.ygoprodeck.com/images/cards/92053608.jpg', 548, 548, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(92142169, 'Bite Bug', 'Effect Monster', 'Effect Monster', 'effect', 'If your opponent controls a face-up Xyz Monster, you can Special Summon this card (from your hand). When you do: Target 1 monster your opponent controls; that monster loses 300 ATK.', 7, NULL, 'https://images.ygoprodeck.com/images/cards/92142169.jpg', 1134, 1134, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(92361635, 'Atomic Scrap Dragon', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 \"Scrap\" Tuner + 2 or more non-Tuner monsters\nOnce per turn, you can select 1 card you control and up to 3 cards in your opponent\'s Graveyard. Destroy your selected card and return the opponent\'s cards you selected to the Deck. When this card is destroyed by your opponent\'s card (either by battle or by card effect) and sent to the Graveyard, select 1 non-Synchro \"Scrap\" monster in your Graveyard, and Special Summon it.', 19, 132, 'https://images.ygoprodeck.com/images/cards/92361635.jpg', 795, 795, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(92510265, 'Black Luster Soldier - Sacred Soldier', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal or Special Summoned: You can target 1 of your banished LIGHT or DARK monsters and 1 card your opponent controls; return that banished card to the GY, and if you do, banish that card your opponent controls. You can only use this effect of \"Black Luster Soldier - Sacred Soldier\" once per turn. When this card destroys an opponent\'s monster by battle: You can target 1 Level 7 or lower Warrior monster in your GY; add it to your hand.', 14, 171, 'https://images.ygoprodeck.com/images/cards/92510265.jpg', 1159, 1159, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(92518817, 'Blazing Hiita', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn, you can Tribute 1 FIRE monster (except this card) to Special Summon 1 FIRE monster from your hand. The monster Special Summoned by this effect is destroyed if \"Blazing Hiita\" is removed from your side of the field.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/92518817.jpg', 1276, 1276, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(92650018, 'Amaze Attraction Horror House', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls; equip this card to it. You can activate the following effect, based on which player controls the equipped monster;\r\n● You: Target 1 Effect Monster your opponent controls; negate its effects until the end of this turn.\r\n● Your opponent: Change the equipped monster to face-down Defense Position.\r\nYou can only use this effect of \"Amaze Attraction Horror House\" once per turn.', 4, 59, 'https://images.ygoprodeck.com/images/cards/92650018.jpg', 305, 305, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(92652813, 'Awakening of the Possessed - Greater Inari Fire', 'Effect Monster', 'Effect Monster', 'effect', 'You can Special Summon this card (from your hand or Deck) by sending 1 face-up Spellcaster monster and 1 face-up Level 4 or lower FIRE monster you control to the GY. You can only use each of the following effects of \"Awakening of the Possessed - Greater Inari Fire\" once per turn.\r\n● When this card is Special Summoned by its effect: You can inflict damage to your opponent equal to the original ATK of 1 monster they control (your choice).\r\n● If this card is sent from the field to the GY: You can add 1 \"Spiritual Fire Art\" card or 1 \"Possessed\" Spell/Trap from your Deck to your hand.', 26, 143, 'https://images.ygoprodeck.com/images/cards/92652813.jpg', 828, 828, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(92714517, 'Big Welcome Labrynth', 'Trap Card', 'Trap Card', 'trap', 'Special Summon 1 \"Labrynth\" monster from your hand, Deck, or GY, then return 1 monster you control to the hand. You can banish this card from your GY, then target 1 Fiend monster you control, or, if you control a Level 8 or higher Fiend monster, you can target 1 card your opponent controls instead; return that card to the hand. You can only use 1 \"Big Welcome Labrynth\" effect per turn, and only once that turn.', 4, 106, 'https://images.ygoprodeck.com/images/cards/92714517.jpg', 1116, 1116, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(92729410, 'Baby Raccoon Ponpoko', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can Special Summon 1 Level 2 Beast-Type monster from your Deck in face-down Defense Position, except \"Baby Raccoon Ponpoko\". You cannot Special Summon any monsters during the turn you activate this effect, except Beast-Type monsters.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/92729410.jpg', 861, 861, '2025-03-10 13:13:04', '2025-03-10 13:13:04'),
(92881099, 'Alluring Mirror Split', 'Spell Card', 'Spell Card', 'spell', 'When a \"Harpie Lady\" or \"Harpie Lady Sisters\" you control is destroyed by battle: You can Special Summon 1 \"Harpie\" monster from your Deck with a different original name than the destroyed monster. If this card you control is destroyed by a \"Harpie\" card\'s effect or your opponent\'s card effect: Target 1 \"Harpie\" monster in your GY; Special Summon it. You can only use each effect of \"Alluring Mirror Split\" once per turn.', 1, 52, 'https://images.ygoprodeck.com/images/cards/92881099.jpg', 238, 238, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(92998610, 'Aloof Lupine', 'Effect Monster', 'Effect Monster', 'effect', 'When this card is Normal Summoned: You can banish 1 monster from your hand; banish 1 monster from your Deck with the same Type as that monster. If this card is destroyed by battle, or if this card in its owner\'s possession is destroyed by an opponent\'s card effect: You can target 1 of your banished monsters; add it to your hand. You can only use each effect of \"Aloof Lupine\" once per turn.', 5, NULL, 'https://images.ygoprodeck.com/images/cards/92998610.jpg', 263, 263, '2025-03-10 13:12:54', '2025-03-10 13:12:54'),
(93221206, 'Ancient Elf', 'Normal Monster', 'Normal Monster', 'normal', 'This elf is rumored to have lived for thousands of years. He leads an army of spirits against his enemies.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/93221206.jpg', 394, 394, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(93437091, 'Bingo Machine, Go!!!', 'Spell Card', 'Spell Card', 'spell', 'Reveal 3 cards from your Deck that each meets at least 1 of the criteria listed below, your opponent randomly picks 1 for you to add to your hand, and you shuffle the rest into your Deck. You can only activate 1 \"Bingo Machine, Go!!!\" per turn.\r\n● \"Blue-Eyes\" monster\r\n● Spell/Trap that specifically lists the card \"Blue-Eyes White Dragon\" or \"Blue-Eyes Ultimate Dragon\", except \"Bingo Machine, Go!!!\"', 4, 164, 'https://images.ygoprodeck.com/images/cards/93437091.jpg', 1124, 1124, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(93469007, 'Assault Overload', 'Spell Card', 'Spell Card', 'spell', 'Tribute 1 \"/Assault Mode\" monster. Inflict damage to both players equal to its Level x 200.', 2, 103, 'https://images.ygoprodeck.com/images/cards/93469007.jpg', 768, 768, '2025-03-10 13:13:03', '2025-03-10 13:13:03'),
(93473606, 'Amaze Attraction Wonder Wheel', 'Trap Card', 'Trap Card', 'trap', 'Target 1 \"Amazement\" monster you control or 1 face-up monster your opponent controls; equip this card to it. You can activate the following effect, based on which player controls the equipped monster;\r\n● You: During the Main Phase: Place 1 card from your hand on the bottom of the Deck, then draw 1 card.\r\n● Your opponent: Switch the equipped monster\'s current ATK and DEF until the end of this turn.\r\nYou can only use this effect of \"Amaze Attraction Wonder Wheel\" once per turn.', 4, 59, 'https://images.ygoprodeck.com/images/cards/93473606.jpg', 310, 310, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(93503294, 'Altergeist Primebanshee', 'Link Monster', 'Link Monster', 'link', '2+ \"Altergeist\" monsters\r\nDuring the Main Phase (Quick Effect): You can Tribute 1 other \"Altergeist\" monster; Special Summon 1 \"Altergeist\" monster from your Deck to your zone this card points to. If this card is sent from the field to the GY: You can target 1 \"Altergeist\" card in your GY; add it to your hand. You can only use each effect of \"Altergeist Primebanshee\" once per turn.', 11, 57, 'https://images.ygoprodeck.com/images/cards/93503294.jpg', 291, 291, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(93850652, 'Beat, Bladesman Fur Hire', 'Effect Monster', 'Effect Monster', 'effect', 'During your Main Phase: You can Special Summon 1 monster \"Fur Hire\" from your hand, except \"Beat, Bladesman Fur Hire\". If a monster \"Fur Hire\" is Special Summoned to your field while you control this monster (except during the Damage Step): You can add 1 monster \"Fur Hire\" from your Deck to your hand, except \"Beat, Bladesman Fur Hire\". You can only use each effect of \"Beat, Bladesman Fur Hire\" once per turn.', 14, 168, 'https://images.ygoprodeck.com/images/cards/93850652.jpg', 1039, 1039, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(93880808, 'Arcana Triumph Joker', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is in your hand or GY: You can send 1 \"Queen\'s Knight\", \"King\'s Knight\", and \"Jack\'s Knight\" from your hand and/or face-up Monster Zone to the GY; Special Summon this card. This card gains 500 ATK x the combined number of cards in both players\' hands. You can discard 1 card; destroy all face-up cards your opponent controls with the same type (Monster, Spell, or Trap) as the discarded card.', 14, 102, 'https://images.ygoprodeck.com/images/cards/93880808.jpg', 582, 582, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(93969023, 'Black Metal Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'You can target 1 \"Red-Eyes\" monster you control; equip this monster from your hand or field to that target. It gains 600 ATK. If this card is sent from the field to the GY: You can add 1 \"Red-Eyes\" card from your Deck to your hand.', 19, 180, 'https://images.ygoprodeck.com/images/cards/93969023.jpg', 1164, 1164, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(94004268, 'Amazoness Swords Woman', 'Effect Monster', 'Effect Monster', 'effect', 'Your opponent takes any battle damage you would have taken from battles involving this card instead.', 14, 61, 'https://images.ygoprodeck.com/images/cards/94004268.jpg', 350, 350, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(94022093, 'Behegon', 'Normal Monster', 'Normal Monster', 'normal', 'With an enormous maw and massive teeth, this monstrosity is one dangerous and strange serpent from the deep.', 6, NULL, 'https://images.ygoprodeck.com/images/cards/94022093.jpg', 1069, 1069, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(94119480, 'Adreus, Keeper of Armageddon', 'XYZ Monster', 'XYZ Monster', 'xyz', '2 Level 5 monsters\nOnce per turn: You can detach 1 Xyz Material from this card to target 1 face-up card your opponent controls; destroy it.', 9, NULL, 'https://images.ygoprodeck.com/images/cards/94119480.jpg', 145, 145, '2025-03-10 13:12:52', '2025-03-10 13:12:52'),
(94141712, 'Armed Dragon Thunder LV7', 'Effect Monster', 'Effect Monster', 'effect', 'This card\'s name becomes \"Armed Dragon LV7\" while on the field or in the GY. You can only use each of the following effects of \"Armed Dragon Thunder LV7\" once per turn. You can send 1 monster from your hand to the GY; send this card from the field to the GY, and if you do, Special Summon 1 Level 10 or lower \"Armed Dragon\" monster from your hand or Deck. If this card is sent to the GY to activate a Dragon monster\'s effect: You can add 1 \"Armed Dragon\" card from your Deck to your hand.', 19, 111, 'https://images.ygoprodeck.com/images/cards/94141712.jpg', 656, 656, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(94463200, 'Battle-Scarred', 'Trap Card', 'Trap Card', 'trap', 'Select 1 Archfiend monster on your side of the field to activate this card. Your opponent also pays the same Life Points that you pay for the selected monster during the Standby Phase. If this card is removed from the field, destroy the selected monster. When the selected monster is removed from the field, destroy this card.', 1, 5, 'https://images.ygoprodeck.com/images/cards/94463200.jpg', 969, 969, '2025-03-10 13:13:06', '2025-03-10 13:13:06');
INSERT INTO `cards` (`id`, `name`, `type`, `human_readable_card_type`, `frame_type`, `description`, `race_id`, `archetype_id`, `ygoprodeck_url`, `image_links_id`, `prices_id`, `created_at`, `modified_at`) VALUES
(94662235, 'Bending Destiny', 'Trap Card', 'Trap Card', 'trap', 'Activate only if all face-up monsters you control are \"Fortune Lady\" monsters. Negate the activation of a Spell or Trap Card, or the Normal Summon of a monster, and remove that card from play. The card removed from play by this effect is returned to its owner\'s hand during the End Phase.', 23, 173, 'https://images.ygoprodeck.com/images/cards/94662235.jpg', 1077, 1077, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(94670654, 'Baku the Beast Ninja', 'Effect Monster', 'Effect Monster', 'effect', 'If this card is added to your hand, except by drawing it: You can Special Summon it. If this card is Special Summoned or flipped face-up: You can target 1 \"Ninja\" or \"Ninjitsu Art\" card from your GY or face-up Spell & Trap Zone, except \"Baku the Beast Ninja\"; return it to the hand. You can only use each effect of \"Baku the Beast Ninja\" once per turn.', 5, 38, 'https://images.ygoprodeck.com/images/cards/94670654.jpg', 891, 891, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(94689206, 'Block Dragon', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned/Set. Must be Special Summoned (from your hand or GY) by banishing 3 EARTH monsters from your hand and/or GY. Rock monsters you control cannot be destroyed, except by battle. If this card is sent from the field to the GY: You can add up to 3 Rock monsters from your Deck to your hand, whose total Levels equal 8. You can only use this effect of \"Block Dragon\" once per turn.', 17, NULL, 'https://images.ygoprodeck.com/images/cards/94689206.jpg', 1296, 1296, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(94821366, 'Amazement Administrator Arlekino', 'Effect Monster', 'Effect Monster', 'effect', 'Once per turn: You can banish any number of \"Attraction\" Traps from your GY, then target that many cards your opponent controls; destroy them. You can only use each of the following effects of \"Amazement Administrator Arlekino\" once per turn. If a Trap Card is activated (except during the Damage Step): You can Special Summon this card from your hand. If your opponent Normal or Special Summons a monster(s) (except during the Damage Step): You can target 1 of those face-up monsters they control; equip 1 \"Attraction\" Trap from your Deck to that target.', 29, 60, 'https://images.ygoprodeck.com/images/cards/94821366.jpg', 312, 312, '2025-03-10 13:12:55', '2025-03-10 13:12:55'),
(94853057, 'Banisher of the Radiance', 'Effect Monster', 'Effect Monster', 'effect', 'Any card sent to the Graveyard is banished instead.', 18, NULL, 'https://images.ygoprodeck.com/images/cards/94853057.jpg', 901, 901, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(95040215, 'Blackwing - Nothung the Starlight', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner monsters\r\nIf this card is Special Summoned: Inflict 800 damage to your opponent, then 1 face-up monster your opponent controls loses 800 ATK and DEF. You can only use this effect of \"Blackwing - Nothung the Starlight\" once per turn. During your Main Phase, you can Normal Summon 1 \"Blackwing\" monster in addition to your Normal Summon/Set. (You can only gain this effect once per turn.)', 24, 35, 'https://images.ygoprodeck.com/images/cards/95040215.jpg', 1229, 1229, '2025-03-10 13:13:12', '2025-03-10 13:13:12'),
(95132338, 'Aqua Chorus', 'Trap Card', 'Trap Card', 'trap', 'If there are monsters with the same name on the field, increase the ATK and DEF of all of those monsters with the same name by 500 points.', 1, NULL, 'https://images.ygoprodeck.com/images/cards/95132338.jpg', 539, 539, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(95174353, 'Ameba', 'Effect Monster', 'Effect Monster', 'effect', 'When the control of this face-up card on the field shifts to your opponent, inflict 2000 points of damage to your opponent\'s Life Points. This effect can only be used once as long as this card remains face-up on the field.', 6, NULL, 'https://images.ygoprodeck.com/images/cards/95174353.jpg', 361, 361, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(95472621, 'Big Burn', 'Trap Card', 'Trap Card', 'trap', 'You can only activate this card when your opponent activates a card that targets a monster in the Graveyard. Remove from play all monsters in both players\' Graveyards.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/95472621.jpg', 1105, 1105, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(95515789, 'Blazing Cartesia, the Virtuous', 'Tuner Monster', 'Tuner Monster', 'effect', 'If you control \"Fallen of Albaz\" or it is in your GY: You can Special Summon this card from your hand. During the Main Phase (Quick Effect): You can Fusion Summon 1 Level 8 or higher Fusion Monster from your Extra Deck, using monsters from your hand or field as material. During the End Phase, if a Fusion Monster(s) was sent to your GY this turn: You can add this card from the GY to your hand. You can only use each effect of \"Blazing Cartesia, the Virtuous\" once per turn.', 11, NULL, 'https://images.ygoprodeck.com/images/cards/95515789.jpg', 1275, 1275, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(95561146, 'Apophis the Serpent', 'Trap Card', 'Trap Card', 'trap', 'Special Summon this card as a Normal Monster (Reptile/EARTH/Level 4/ATK 1600/DEF 1800) (this card is also still a Trap), then you can Set 1 \"Apophis\" Trap from your Deck, except \"Apophis the Serpent\". It can be activated this turn. If this card is sent to the GY: You can add 1 \"Embodiment of Apophis\" from your Deck to your hand. You can only use each effect of \"Apophis the Serpent\" once per turn.', 1, 89, 'https://images.ygoprodeck.com/images/cards/95561146.jpg', 513, 513, '2025-03-10 13:12:58', '2025-03-10 13:12:58'),
(95637655, 'Backup Warrior', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Normal Summoned or Set. Must first be Special Summoned (from your hand) while the only monsters you control are 2 Defense Position monsters. You cannot Synchro Summon the turn you Special Summon this card.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/95637655.jpg', 882, 882, '2025-03-10 13:13:05', '2025-03-10 13:13:05'),
(95735217, 'Ancient Gear Golem - Ultimate Pound', 'Effect Monster', 'Effect Monster', 'effect', 'Cannot be Special Summoned. If this card attacks a Defense Position monster, inflict piercing battle damage. Up to twice per turn, when this attacking card destroys a monster by battle: You can discard 1 Machine monster; this card can attack again in a row. If this card on the field is destroyed by battle or card effect: You can add 1 \"Polymerization\" from your Deck to your hand, and if you do, add 1 other \"Ancient Gear\" monster from your GY to your hand.', 12, 75, 'https://images.ygoprodeck.com/images/cards/95735217.jpg', 424, 424, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(95825679, 'Archfiend\'s Awakening', 'Ritual Effect Monster', 'Ritual Effect Monster', 'ritual', 'You can Ritual Summon this card with \"Contract with the Abyss\". This card\'s name becomes \"Summoned Skull\" on the field, but is still treated as an \"Archfiend\" card. Cannot be destroyed by battle, except by battle with a Ritual Monster, and cannot be destroyed by monster effects, except those of Ritual Monsters. If this Ritual Summoned card you control is sent to your GY by an opponent\'s card: You can Special Summon 1 \"Summoned Skull\" from your hand, Deck, or GY.', 9, 5, 'https://images.ygoprodeck.com/images/cards/95825679.jpg', 606, 606, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(96029574, 'Black Brutdrago', 'Synchro Monster', 'Synchro Monster', 'synchro', '1 Tuner + 1 or more non-Tuner Gemini monsters\nOnce per turn, you can send 1 Gemini monster from your hand to the Graveyard to select and destroy 1 Spell or Trap Card your opponent controls. When this card is destroyed and sent to the Graveyard, you can select 1 Gemini monster in your Graveyard and Special Summon it. The Special Summoned Gemini monster is treated as an Effect Monster, and gains its effect.', 19, NULL, 'https://images.ygoprodeck.com/images/cards/96029574.jpg', 1142, 1142, '2025-03-10 13:13:10', '2025-03-10 13:13:10'),
(96084564, 'Aileron', 'Effect Monster', 'Effect Monster', 'effect', '(This card is always treated as a \"Sky Striker\" card.)\r\nA \"Sky Striker Ace\" monster equipped with this card gains 400 ATK. You can only use 1 of the following effects of \"Aileron\" per turn, and only once that turn. During the Main Phase (Quick Effect): You can target 1 \"Sky Striker Ace\" monster you control; equip this card from your hand or field to it. If this card on the field is destroyed: You can send 1 \"Sky Striker\" Spell from your Deck to the GY.', 12, 37, 'https://images.ygoprodeck.com/images/cards/96084564.jpg', 178, 178, '2025-03-10 13:12:53', '2025-03-10 13:12:53'),
(96146814, 'A/D Changer', 'Effect Monster', 'Effect Monster', 'effect', 'You can banish this card from your Graveyard, then target 1 monster on the field; change its battle position.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/96146814.jpg', 44, 44, '2025-03-10 13:12:51', '2025-03-10 13:12:51'),
(96367119, 'Black Shadow Squall', 'Trap Card', 'Trap Card', 'trap', 'When a Spell/Trap Card is activated: Remove 1 Black Feather Counter from your field; negate the activation, and if you do, destroy that card. If you control \"Black-Winged Dragon\": You can Set this card from your GY, but banish it when it leaves the field. You can only use 1 \"Black Shadow Squall\" effect per turn, and only once that turn.', 23, NULL, 'https://images.ygoprodeck.com/images/cards/96367119.jpg', 1173, 1173, '2025-03-10 13:13:11', '2025-03-10 13:13:11'),
(96427353, 'Aqua Armor Ninja', 'Effect Monster', 'Effect Monster', 'effect', 'When your opponent\'s monster declares a direct attack, if you have another \"Ninja\" monster in your Graveyard: You can banish this card from your Graveyard to target the attacking monster; negate that attack.', 14, 38, 'https://images.ygoprodeck.com/images/cards/96427353.jpg', 538, 538, '2025-03-10 13:12:59', '2025-03-10 13:12:59'),
(96565487, 'Blizzard Warrior', 'Effect Monster', 'Effect Monster', 'effect', 'If this card destroys an opponent\'s monster by battle, look at the top card of their Deck, then return that card to either the top or the bottom of their Deck.', 14, NULL, 'https://images.ygoprodeck.com/images/cards/96565487.jpg', 1293, 1293, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(96700602, 'Barrier Wave', 'Trap Card', 'Trap Card', 'trap', 'Activate by Tributing 1 Synchro Monster when an opponent\'s monster declares an attack. Change all Attack Position monsters your opponent controls to Defense Position. Then, inflict damage to your opponent equal to the attacking monster\'s DEF.', 4, NULL, 'https://images.ygoprodeck.com/images/cards/96700602.jpg', 931, 931, '2025-03-10 13:13:06', '2025-03-10 13:13:06'),
(96789758, 'Aromage Jasmine', 'Effect Monster', 'Effect Monster', 'effect', 'During your Main Phase, while your LP are higher than your opponent\'s, you can Normal Summon 1 Plant monster in addition to your Normal Summon/Set, except \"Aromage Jasmine\". (You can only gain this effect once per turn.) Once per turn, if you gain LP: Draw 1 card.', 21, 121, 'https://images.ygoprodeck.com/images/cards/96789758.jpg', 704, 704, '2025-03-10 13:13:02', '2025-03-10 13:13:02'),
