(300302022, 'Ancient Fusion', 'Skill Card', 'Skill Card', 'skill', 'Once per Duel, you can discard 1 card to Fusion Summon 1 \"Ancient Gear\" Fusion Monster from your Extra Deck, using monsters from your field as Fusion Material. If 1 of those materials is an \"Ancient Gear Golem\" monster, you can also use monsters from your hand and/or Deck as the other material. Your opponent takes no damage for the rest of this turn. Any battle damage your opponent takes from that Fusion Monster is halved.', 30, 74, 'https://images.ygoprodeck.com/images/cards/300302022.jpg', 399, 399, '2025-03-10 13:12:56', '2025-03-10 13:12:56'),
(300302023, 'Armed and Ready!', 'Skill Card', 'Skill Card', 'skill', 'Once per Duel, during your Main Phase, you can send 1 \"LV\" monster you control to the GY, then Special Summon the \"LV\" monster mentioned in its text from your hand, Deck, or GY, as if it were Summoned by the sent monster\'s effect.', 34, NULL, 'https://images.ygoprodeck.com/images/cards/300302023.jpg', 642, 642, '2025-03-10 13:13:01', '2025-03-10 13:13:01'),
(300302024, 'Blaze Accelerator Deployment (Skill Card)', 'Skill Card', 'Skill Card', 'skill', 'Once per turn, you can change the name of 1 \"Blaze Accelerator\" you control to \"Tri-Blaze Accelerator\". This Skill can be used twice per Duel.', 41, 186, 'https://images.ygoprodeck.com/images/cards/300302024.jpg', 1268, 1268, '2025-03-10 13:13:13', '2025-03-10 13:13:13'),
(300302043, 'Behold, Gate Guardian!', 'Skill Card', 'Skill Card', 'skill', 'Activate this Skill during your Main Phase. Shuffle your entire hand into the Deck, then add 1 Level 11 monster from your Deck to your hand, and if you do, you can Special Summon up to 2 Level 7 monsters with different Attributes from your Deck and/or GY, but their ATK/DEF become 0, also their effects are negated. While you control \"Gate Guardian\", it gains the following effect.\r\n● Once while face-up on the field, when this card is targeted for an attack: You can change the attacking monster\'s ATK to 0, until the end of the Damage Step.', 40, 122, 'https://images.ygoprodeck.com/images/cards/300302043.jpg', 1072, 1072, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(300302044, 'Believe in your Bro', 'Skill Card', 'Skill Card', 'skill', 'Once per turn, you can activate 1 of these Skills based on the face-up monster(s) you control:\r\n● \"Elemental HERO\": Discard 1 Trap, then add 1 Level 6 or lower Machine \"roid\" monster from your GY to your hand, then you can destroy 1 monster your opponent controls whose ATK is less than or equal to the added card\'s.\r\n● Machine \"roid\": Discard 1 Spell, then Special Summon 1 Level 6 or lower Machine \"roid\" or \"Elemental HERO\" monster from your Deck in Defense Position, but negate its effects.\r\n ● Both: Discard 1 card, then Fusion Summon 1 Fusion Monster using only \"roid\" and \"Elemental HERO\" monsters you control.\r\nEach of these Skills can only be used once per Duel.', NULL, NULL, 'https://images.ygoprodeck.com/images/cards/300302044.jpg', 1075, 1075, '2025-03-10 13:13:08', '2025-03-10 13:13:08'),
(300302045, 'Beware the Brothers Paradox!', 'Skill Card', 'Skill Card', 'skill', 'Apply the following Skills:\r\n● You can Normal Summon Level 7 monsters for 1 less Tribute.\r\n● You can Tribute Summon 1 Level 7 monster face-up, in addition to your Normal Summon/Set.\r\n● Your opponent takes no effect damage.\r\n● You can only attack with 1 monster each turn, but that monster can make a second attack on monsters during each Battle Phase.', 40, NULL, 'https://images.ygoprodeck.com/images/cards/300302045.jpg', 1096, 1096, '2025-03-10 13:13:09', '2025-03-10 13:13:09'),
(300302056, 'Ancient Ruler Rises', 'Skill Card', 'Skill Card', 'skill', 'Apply the following Skills:\r\n● Once per turn, you can send 1 Level 2 Zombie monster from your Deck to the GY and place 1 of your \"The First Sarcophagus\", \"The Second Sarcophagus\", or \"The Third Sarcophagus\" from your Deck, GY, or that is banished, face-up in your Spell & Trap Zone. (This is treated as being placed by the effect of \"The First Sarcophagus\".)\r\n● Each \"Spirit of the Pharaoh\" you control gains ATK equal to the total number of \"Pharaoh\'s Servant\" and \"Pharaonic Protector\" on your field and in your GY x 900.', 31, NULL, 'https://images.ygoprodeck.com/images/cards/300302056.jpg', 445, 445, '2025-03-10 13:12:57', '2025-03-10 13:12:57'),
(300302057, 'Archfiend\'s Conscription', 'Skill Card', 'Skill Card', 'skill', 'You cannot Summon/Set non-Fiend monsters. Once per turn, during your Main Phase, you can roll a six-sided die. If you do, you lose LP equal to the result x 200, but if the result is 2, 3, or 4, you can Special Summon 1 \"Archfiend\" monster with a Level equal to the result from your hand, Deck, or GY.', 33, 5, 'https://images.ygoprodeck.com/images/cards/300302057.jpg', 608, 608, '2025-03-10 13:13:00', '2025-03-10 13:13:00'),
(300302058, 'Archfiend\'s Promotion', 'Skill Card', 'Skill Card', 'skill', 'Once per turn, during your Main Phase, if you control \"Vilepawn Archfiend\" and your opponent controls no card in its same column, you can Tribute it to Special Summon 1 Level 8 or lower \"Archfiend\" monster from your hand or Deck that has \"Queen\", \"Bishop\" , \"Rook\", or \"Knight\" in its name.', 33, 5, 'https://images.ygoprodeck.com/images/cards/300302058.jpg', 612, 612, '2025-03-10 13:13:00', '2025-03-10 13:13:00');
